            migrationBuilder.InsertData(
                table: "Wines",
                columns: new[] { "Id", "Color", "IssueDate", "Name", "Note", "Price", "Rank", "RankYear", "Score", "Vintage", "WineryId" },
                values: new object[,]
                {
                    { new Guid("a05164df-2bdb-4675-9afa-9f5cbd9e69bd"), 0, new DateTime(2018, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rasa Shiraz", "It is a complex wine, with power and finesse. Crafted from handpicked grapes from our own estate vineyards, Rasa Shiraz is aged for 12 months in premium French oak barrels and then further matured in the bottle before release.", 20m, 36, 0, 92, "2015", new Guid("d2835e85-89ab-4b23-a5d5-48db93f778dd") },
                    { new Guid("d2846c46-7c88-41a5-805a-7789bfc4cec0"), 1, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chablis", "Rich, with fine cut framing the apple, lemon and melon flavors. A chalky intensity leaves a puckering sensation, but the mineral element lingers. Give this time to settle down. Best from 2016 through 2024. 2,126 cases imported.", 31m, 88, 0, 91, "2012", new Guid("65390365-1ecf-436e-94c7-9c11b0df5f74") },
                    { new Guid("8ff043d0-0b23-49a6-89ba-9055c56d64ca"), 0, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sicilia Santagostino Baglio Soria Red", "Aromas and flavors of bacon fat and mesquite smoke mix with ripe black cherry, licorice snap, mocha and mint in this expressive red, with fine-grained tannins and juicy acidity. Elegant through to the aromatic, coffee-tinged finish. Nero d'Avola and Syrah. Drink now through 2024. 70,000 cases made.", 23m, 87, 0, 91, "2011", new Guid("57314130-4385-45ad-bf85-bb69fd7409c3") },
                    { new Guid("c0fe332e-6979-4c44-9904-dca4de585516"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Montepulciano d'Abruzzo Marina Cveti  S. Martino Rosso", "A fresh, harmonious red, offering a subtle range of flavors, with rich notes of smoky mineral, crushed blackberry, olive tapenade, grilled herb and ground anise. Fine-grained tannins emerge on the finish. Drink now through 2024. 2,500 cases imported.", 25m, 85, 0, 91, "2010", new Guid("2dcf94e6-b0d5-46e0-befb-90c7561f3381") },
                    { new Guid("7252c9df-91e4-485c-b92e-8c13e6cedd9b"), 1, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Rutherford", "Opens up with lemon verbena, citrus and melon notes that are round and juicy, balanced with sophisticated details of honeysuckle and grapefruit zest. This finishes with a crescendo of flavors, lingering on the finish. Drink now. 9,700 cases made.", 24m, 83, 0, 90, "2013", new Guid("a42482a0-ce46-450d-9d4b-25a9be411d64") },
                    { new Guid("521553f6-0f6e-4d7f-9e21-99df1034431d"), 0, new DateTime(2014, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vin de Pays du Var St.-Auguste", "A dark, smoky version, with mulled plum and blackberry paste notes liberally lined with charcoal, dark olive and bay leaf flavors. Features a rugged feel through the toasty finish. Syrah, Cabernet Sauvignon and Merlot. Drink now through 2016. 1,125 cases made.", 20m, 81, 0, 90, "2010", new Guid("e569759d-2e6a-4cee-95cc-67598fc0492f") },
                    { new Guid("ae30aafb-ba4d-4bf5-bd8b-61ef10916ac8"), 0, new DateTime(2014, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Valtellina Superiore Quadrio", "Rich, with a base note of tarry smoke, this remains elegant and medium-bodied overall, showing mouthwatering acidity and fine integration. Dried mint and thyme aromatics lace the dried strawberry and cherry fruit, offset with star anise and beef bouillon details. Offers a lightly chewy finish. Drink now through 2024. 3,300 cases imported.", 20m, 80, 0, 90, "2010", new Guid("63ecbf10-4581-4cb5-88a7-44b18da015b8") },
                    { new Guid("04ee286f-e581-46ad-aa91-244d3b4566dc"), 0, new DateTime(2014, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Dominio de Valdepusa", "This dense and harmonious red delivers plum, tobacco, cedar and mineral flavors that mingle over muscular but polished tannins. A bit reticent, but balanced and deep. Drink now through 2025. 3,000 cases made.", 40m, 79, 0, 93, "2010", new Guid("b21d1a93-9e9b-45b1-bc09-bc4f9f3c8c49") },
                    { new Guid("f7e48308-ad57-482f-8808-0b57877a7005"), 0, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Oregon", "The crisp tannins and sleek structure give the up-front blackberry, currant and floral spice flavors good lift, coming together smoothly on the persistent finish. Drink now through 2016. 38,000 cases made.", 20m, 78, 0, 90, "2012", new Guid("f6f83929-b5f9-40fa-8a40-d77d5e93f5d4") },
                    { new Guid("cbbf65db-3f72-4999-993c-8684a7de9d1e"), 0, new DateTime(1990, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hermitage", "Very firm and elegant, with a burst of raspberry and black pepper flavors that just go on forever on the finish. Soft tannins and a touch of new oak frame the wine beautifully, and with time it ought to emerge gorgeously. Drink starting 1993.  ", 34m, 84, 0, 92, "1986", new Guid("022f6f1e-8ade-4822-94a2-2eecf274b315") },
                    { new Guid("30bf2502-c2dc-4ed5-a892-a39939faf6e2"), 0, new DateTime(1990, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Côte-Rôtie La Turque", "A concentrated, powerful, flavorful wine, just oozing with plum, berry and spice aromas and flavors that are long and sweet on the finish. There 's lots of complexity here already, but it's so tight that it could keep developingwell into the next century 250 cases made.", 100m, 57, 0, 95, "1986", new Guid("022f6f1e-8ade-4822-94a2-2eecf274b315") },
                    { new Guid("e5e29e90-681a-4269-b675-3b625c6ae4e3"), 0, new DateTime(1989, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Côte-Rôtie Brune et Blonde", "Full and generous, a peppery, spicy wine that's sweet with the scents of vanilla and black cherry. Long, silky and rich, with the structure and tannic bite to age. Should improve even more in the bottle. Drink now to 2000.  ", 30m, 78, 0, 92, "1985", new Guid("022f6f1e-8ade-4822-94a2-2eecf274b315") },
                    { new Guid("98832c5b-0fac-4f56-9e67-7eaeedd6e909"), 0, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "CÃ´te-RÃ´tie ChÃ¢teau d'Ampuis", "Rock-solid, offering dark currant and blackberry paste flavors that race along, thanks to well-embedded graphite and charcoal notes. The finish lets warm fruitcake, plum skin and singed juniper details fill in, with plenty of grip. Mouthwatering acidity and a long echo of sweet tapenade keep this racy and defined. Best from 2015 through 2035. 2,200 cases made.", 206m, 77, 0, 97, "2010", new Guid("022f6f1e-8ade-4822-94a2-2eecf274b315") },
                    { new Guid("a914061d-c2af-48cd-90a8-49cb5b906b27"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbera d'Asti Tre Vigne", "A bright, flashy version, featuring black currant and blackberry fruit that shows notes of vanilla and spice. The oak adds tannins, lending this a tight feel on the otherwise fine finish. Needs time. Best from 2016 through 2020. 5,000 cases made.", 17m, 76, 0, 90, "2012", new Guid("d902f3f4-5561-4704-a350-c285a92bae0c") },
                    { new Guid("affceb88-e43e-44b5-b6ab-f6294f3ac1e3"), 4, new DateTime(2014, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tokaji AszÃº 5 Puttonyos", "Intense and elegant at once, this is smooth, harmonious and vibrant. The citrus pÃ¢te de fruit, apple and lemon candy flavors are long and permeating. Terrific focus. Drink now through 2018. 2,144 cases made.", 49m, 75, 0, 94, "2006", new Guid("870b1b6b-4b84-47de-8eb6-7c82b9bd7d8e") },
                    { new Guid("a64c221b-4d90-4ff4-926e-115a7bc35aff"), 0, new DateTime(2014, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Molise Ramitello", "The up-front mulberry and plum fruit is ripe and fleshy in this balanced red, with polished tannins. Notes of licorice string, graphite, tarry smoke and grilled mushroom push through midpalate and on the finish. Drink now through 2021. 8,500 cases made.", 18m, 74, 0, 90, "2011", new Guid("f71aede8-0c1c-4efc-a7b1-98e25eafe8f2") },
                    { new Guid("487bd404-8995-4864-922d-2e69b63e225e"), 0, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "St.-EstÃ¨phe", "This is generous and forward for a St.-EstÃ¨phe, with plum and kirsch notes lined with hints of blood orange and red licorice. Shows a juicy feel through the finish, balanced by honest grip. A modern rendition that maintains a tug of <i>terroir</i>. Drink now through 2019. 22,500 cases made.", 19m, 72, 0, 90, "2011", new Guid("7733d410-e1da-47a3-be03-11e895f1958c") },
                    { new Guid("c9861633-966e-44d5-9ebe-40afd5ca3720"), 0, new DateTime(2014, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Santa Lucia Highlands Rosella's Vineyard", "Alluring, offering a mix of supple, graceful plum and blackberry flavors, with pretty floral scents. This is a delightfully harmonious and elegant offering, presenting deep, rich flavors and solid length and persistence. Drink now through 2022. 563 cases made.", 52m, 71, 0, 93, "2012", new Guid("4397a25f-5eb7-4e38-bebd-88b3abdbffcf") },
                    { new Guid("eed59a80-5c57-4a56-8021-c8c127d4896a"), 0, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "MencÃ­a Bierzo", "Focused yet expressive, this balanced red offers cherry, boysenberry and currant fruit, with accents of toast, licorice and mineral. The flavors build through the long and spicy finish. Drink now through 2020. 6,660 cases made.", 21m, 68, 0, 92, "2010", new Guid("532cf792-68d4-4357-a58f-78145bb03b8f") },
                    { new Guid("a6eca475-88fa-4a1e-a580-b0b44a9ade07"), 1, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Marlborough Single Vineyard", "Offers a succulent mix of citrus and tropical fruit, with Meyer lemon, passion fruit and lemon verbena notes accented by a distinct sea salt hint. Generous and refreshing, with a long, persistent finish. Drink now. 16,000 cases made.", 13m, 67, 0, 90, "2013", new Guid("72807559-5b7a-40fc-8d51-c17b25dfb26f") },
                    { new Guid("0848919a-60e9-4ff8-add8-9f90f766afec"), 0, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shiraz Victoria Are You Game?", "Vivid, peppery and appealing, with cherry and blueberry fruit, revealing black pepper overtones and a polished texture. Lingers easily on the refined finish. Lively and graceful. Drink now through 2018. 5,000 cases made.", 17m, 66, 0, 91, "2012", new Guid("16d899ea-5d48-4ca7-99c6-d35978566bfd") },
                    { new Guid("c3acfa1c-9c56-4219-a709-a863e2953072"), 0, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bolgheri Superiore", "A dark and inky red, featuring violet, black currant, cedar, sandalwood and iron aromas and flavors. Nonetheless, this comes across as elegant, even as the tannins prove formidable on the finish. A terrific young wine in the making. Cabernet Sauvignon, Merlot, Cabernet Franc and Petit Verdot. Best from 2017 through 2035. 2,200 cases imported.", 240m, 65, 0, 96, "2011", new Guid("80d1c804-6a0e-4ec7-ac18-ab12b61c560a") },
                    { new Guid("ecb12cce-ac45-48da-bbfc-1893cdbfcaa8"), 1, new DateTime(2014, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Constantia Bayten", "Very solid, with a crunchy feel along the edges and pure white peach, flint and honeysuckle notes racing along. Drink now. 4,000 cases imported.", 15m, 63, 0, 90, "2013", new Guid("87049120-b133-41f2-a0a7-55bc94314cb5") },
                    { new Guid("87675521-6b0c-4d4a-a1f8-a7dfab79a2b1"), 0, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja ViÃ±a Cumbrero Crianza", "The polished texture carries crisp flavors of tart cherry, fresh herb, anise and mineral, supported by light, firm tannins and lively acidity. Graceful, with balanced fruity and savory notes that give way to a spicy, floral finish. Drink now through 2022. 103,700 cases made.", 10m, 62, 0, 90, "2010", new Guid("a9a8e7b4-34e8-43a5-8c1d-2b441dd7cf8a") },
                    { new Guid("36f58c7d-4ca2-4ebf-8c48-5ccf19922fbb"), 0, new DateTime(2014, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Maipo Valley Legado Reserva", "This complex red unfurls with a lithe minerality, flanking the red berry, plum and dark cherry flavors. Notes of cedar and cigar provide richness. Offers a crisp texture, with a firm finish that lingers with slate and dark chocolate details. Drink now through 2019. 8,000 cases made.", 17m, 61, 0, 92, "2011", new Guid("af19cf6a-24ff-45b6-8517-2f0d4253fd64") },
                    { new Guid("98b23cf2-f88f-41f3-83e7-24c404e7d3fb"), 1, new DateTime(2014, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling QbA Mosel Old Vines", "This version is richly spiced and filled with luscious flavors of glazed apricot, ripe melon and peach cobbler. Shows minerally notes, offering a finish of golden raisin and nutmeg. Drink now through 2016. 10,000 cases made.", 16m, 60, 0, 90, "2012", new Guid("10dd8987-ecee-4e6f-b4f4-f3600198e6c1") },
                    { new Guid("4c58283c-51b4-411b-9a31-d07108f182b4"), 0, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clancy's Barossa", "This red is supple, expressive and appealing, with pure blueberry and plum fruit, shading the finish with loamy earth and sweet spice hints. Shows presence and length. Cabernet Sauvignon, Shiraz and Merlot. Drink now through 2016. 15,000 cases imported.", 15m, 59, 0, 90, "2011", new Guid("e53710c3-c022-4828-805f-47e9755a2e67") },
                    { new Guid("0a9fe31b-f69c-4788-8ab9-d9ea102ed6de"), 0, new DateTime(2014, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Colchagua Valley La Joya Gran Reserva", "Open-knit, creamy and lush-tasting, with spiced cherry, dark plum and boysenberry flavors that ooze with rich, spicy notes. Fig and chocolate mousse details flood the finish. Drink now through 2016. 10,000 cases imported.", 13m, 57, 0, 90, "2012", new Guid("aa76164a-45ce-4c9d-847a-7363b44d761f") },
                    { new Guid("a4fb6334-4799-4d96-84e9-8d0719a8778c"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Alentejo Ramos Reserva", "Black olive, dark currant and dried plum flavors give this red plenty of power and lift. Quite minerally as well, featuring an intense and balanced finish that lingers with fig paste and raspberry ganache elements. Drink now through 2020. 41,800 cases made.", 13m, 56, 0, 90, "2012", new Guid("0f6a9966-c187-48e1-9c12-293fa1bfa56d") },
                    { new Guid("02de06ba-6658-4589-88c8-9b34a418bad8"), 0, new DateTime(2014, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Colchagua Valley El Caballero", "Firm and well-focused, with zesty red plum and wild berry flavors, supported by crisp acidity and chewy tannins. Green herb and spice notes appear on the finish. Drink now through 2018. 10,000 cases imported.", 12m, 55, 0, 90, "2011", new Guid("e228ad7c-86ca-408b-8669-0416baef92ea") },
                    { new Guid("2a115312-a246-47ca-8b0d-4769805dbbee"), 0, new DateTime(2014, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Mendocino County Wild Thing Old Vine", "Vibrant and zesty, offering smoky cherry aromas and complex briary raspberry, underbrush and cracked pepper flavors. Drink now through 2017. 3,500 cases made.", 19m, 89, 0, 90, "2011", new Guid("ba1b77f6-dec9-4181-9bfd-a7fbac89d96f") },
                    { new Guid("395aba46-3051-42ae-a485-e708b0ed9422"), 5, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Napa Valley Prestige", "Packs in a lot of complexity, with aromas of apple, fresh ginger and rubber that lead to crisp and layered flavors of raspberry and spice. Drink now. 173,000 cases made.", 22m, 54, 0, 91, "NV", new Guid("b2356673-7e56-4b08-afb2-9e17e1ab8f85") },
                    { new Guid("47aaed0f-78f9-4103-b555-998c8db8c00a"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "ChÃ¢teauneuf-du-Pape Pure", "Concentrated but remarkably refined, this features a large core of raspberry, red currant and black cherry fruit that is pure, silky and beautifully defined. Hints of shiso leaf, iron and black tea line the finish, which has serious length thanks to finely beaded acidity. A deft marriage of power and grace. Best from 2015 through 2030. 1,900 cases made.", 78m, 91, 0, 95, "2012", new Guid("0dbcc885-14b8-4b13-81a0-3c742cf1d7a0") },
                    { new Guid("fc44954e-4630-4e83-b29d-1e623477528d"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Galilee", "A rich red, showing good power to the mineral-infused dried blackberry, dark plum and currant flavors. Engaging dried herbal notes emerge on the focused finish. Kosher. Drink now through 2017. 14,000 cases made.", 17m, 93, 0, 90, "2012", new Guid("8083e95a-a2f1-47df-b5d9-cb1949b9b478") },
                    { new Guid("076ddc6b-f12a-43ae-9106-d6777f924361"), 0, new DateTime(1988, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero Pesquera Janus Reserva", "Deep, rich, ripe and powerful, with slightly earthy-herbal plum and cherry flavors, big and complex, tannic, with a touch of anise on the finish. Complex and fascinating. It will need a good 5-10 years to shed its tannin, but the concentration is superb.  ", 75m, 27, 0, 94, "1982", new Guid("2d7ee744-0da1-4e87-b739-4b147a21586a") },
                    { new Guid("63b42089-8b63-41f2-b12e-d83373171cb6"), 0, new DateTime(1988, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grange Hermitage South Australia Bin 95", "A masterpiece, loaded with rich, smoky, plum, bacon, herbs and anise flavors woven together in a stylish packege, offering depth, complexity and impeccible balance, finishing with chocolate vanilla. Has intensity for decades.  ", 49m, 26, 0, 93, "1981", new Guid("6e348a42-a621-47f4-8f99-84825c247608") },
                    { new Guid("2362c4b6-0910-4b3e-93ec-943bf7467235"), 0, new DateTime(1988, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Penedès Gran Sangre de Toro Reserva", "Rich and complex, with earthy, leathery aromas and flavors around a solid core of cherry and berry fruit, all of which comes together in a complex finish that lasts and lasts. There's enough to take it at least four or five years.  ", 9m, 74, 0, 91, "1983", new Guid("90da116a-f709-4c91-97df-696b07bbdd7a") },
                    { new Guid("bce589dc-7f92-473a-bf4c-0286fcef8392"), 1, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Penedès White Milmanda", "Stunning wine, beautifully balanced, smoothly knit, flavorful and long. It does a great impersonation of a Chevalier-Montrachet, with all the spice, toast and honey around a solid core of pear fruit. Will it age like it? Who knows, but it's pro.  ", 35m, 25, 0, 94, "1987", new Guid("90da116a-f709-4c91-97df-696b07bbdd7a") },
                    { new Guid("6967edd4-44c3-4d2d-9d9f-7c3ace5df18d"), 0, new DateTime(1988, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Oregon Bethel Heights Vineyard", "Very pretty aromas and flavors, featuring violet, blackberry and a touch of lime, crisp balance, long and intense. Very tannic, but the rest is lovely .  ", 18m, 29, 0, 90, "1985", new Guid("fb0e9aa8-4cc2-4c01-bf01-196415426779") },
                    { new Guid("b853870c-6b58-4487-92cc-432437774606"), 0, new DateTime(1988, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Le Cigare Volant California", "Big and rich, with incredibly deep cherry and blackberry fruit, massive concentration, long and turning spicy on the finish, but it's not at all heavy . Smooth and appealing now, but it can only get better with age. Drink now through 1995.  ", 14m, 22, 0, 92, "1986", new Guid("fb0e9aa8-4cc2-4c01-bf01-196415426779") },
                    { new Guid("61d8a82f-3982-430a-8461-d58c34c39dbf"), 0, new DateTime(1988, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pomino Tenuta di Pomino Red", "Densely concentrated, both color and aroma, but lean and elegant, almost delicate of structure, showing beautifully focused plum, anise and cassis, with a touch of chocolate and wee bit of herbs on the finish. Remarkable and distinctive.  ", 12m, 21, 0, 93, "1985", new Guid("340f67ce-ef53-4720-b438-4692c71fbc7d") },
                    { new Guid("0aa1ac5b-3b69-4632-bc89-d4387eb3efa7"), 1, new DateTime(1988, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chablis Les Clos", "Toasty and concentrated with rich pear, apple, spice and toasty spice flavo rs that explode on the palate. It's tart and vibrant with depth, complexity and a long full flinty finish that says Chablis.  ", 40m, 19, 0, 95, "1986", new Guid("3e7c9c22-c78e-4dd8-9980-d507ddba4e54") },
                    { new Guid("a9f5ebe1-9479-4888-bde1-ad53d314c7e7"), 0, new DateTime(1988, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pomerol", "A massive concentration of rich, intense plum, cherry, spice, smoke and cho colate flavors that are wrapped in thick, rich tannins and cedary oak. It g ains intensity and vibrancy on the palate, a powerful wine with a distinct personality that will stand 20 years of cellaring- and then some. A great Petrus.  ", 160m, 12, 0, 98, "1985", new Guid("6ea622dd-1a52-4658-84b0-cf19a6a400a5") },
                    { new Guid("e3da1b79-4ec9-44ac-a357-d3e82e2afabc"), 0, new DateTime(1988, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bonnes Mares", "From the dense color to the intense aroma and the rich, complex flavors of strawberry, plum, rose petal and toast, this powerful but beautifully balanced wine commands your attention and delivers everything it has, with fines se. At the price, it s still a good value.  ", 48m, 48, 0, 95, "1985", new Guid("2326d2f9-780d-4d50-864f-aff7fee4e4bc") },
                    { new Guid("0bfa4d5f-1ef0-4aab-9e00-d7ceb31f0155"), 0, new DateTime(1988, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nuits-St.-Georges Clos des Corvées", "Big, rich and deep, with incredible balance and concentration of ripe plum- cherry fruit and mahogany wood, velvety texture, sweet toast tea leaf on th e finish. Couldn't ask for better balance or length.  ", 46m, 42, 0, 96, "1985", new Guid("2326d2f9-780d-4d50-864f-aff7fee4e4bc") },
                    { new Guid("23c8be39-7324-48b0-8110-1e7a7303a5ab"), 0, new DateTime(1988, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beaune Clos des Ursules", "Ripe, rich and velvety, with gorgeous buttery cherry, chocolate, toast and spice flavors, firmly supported with just enough acidity and tannin, an exotic, sexy wine. Complexity, richness and grace in one package. One of the great values of this vintage.  ", 30m, 7, 0, 95, "1985", new Guid("2326d2f9-780d-4d50-864f-aff7fee4e4bc") },
                    { new Guid("d5d1a27f-5941-48c6-ace2-ee33b836aa30"), 0, new DateTime(1988, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Sodi di San Niccolò", "Loaded with rich, ripe, spicy, plummy fruit, hints of violet and vanilla, beautifully shaped and framed with oak. Smooth and elegant, but containing e nough soft tannin to carry it for years. One of the greatest of the new Italian reds.  ", 25m, 6, 0, 96, "1985", new Guid("a4f52586-6a67-47b9-8eeb-6e93434b63c7") },
                    { new Guid("212bcb5b-45c5-435d-9f89-f9d3722d41c5"), 0, new DateTime(1989, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Darmagi", "Dense and concentrated, starting out very firm and tannic but opening up magically on the finish with a burst of plum, berry, leather and toast flavors that echo forever. May be best around 1995 to 2000. Best Cabernet yet from Gaja, but whoa, the price.  ", 70m, 43, 0, 94, "1985", new Guid("008d2853-5a8a-4118-9551-7a1376132b12") },
                    { new Guid("77fa4789-1ada-4b37-ad34-9be7f9cd3d8c"), 0, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco", "Stunning, almost buttery in its richness, smooth, rich and complex, has power and finesse, plus chocolatey richness that can only become greater. Has the fruit of Barbaresco, the finesse and elegance of Bordeaux and the power and intensity of California.  ", 45m, 20, 0, 95, "1985", new Guid("008d2853-5a8a-4118-9551-7a1376132b12") },
                    { new Guid("26426952-94d1-43c3-a4fb-b31844690c2e"), 0, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco Sorì San Lorenzo", "A bit more austere than the others, but it hangs a lot of flavor on an elegant frame, showing toasty, spicy raspberry aromas and flavors, tightly wound and long.  ", 88m, 14, 0, 96, "1985", new Guid("008d2853-5a8a-4118-9551-7a1376132b12") },
                    { new Guid("61c617fc-7707-46b8-84f5-fdc0dc572e9a"), 0, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco Costa Russi", "Remarkable in its concentration and elegance, with marvelously focused raspberry and cherry flavors and hints of chocolate and anise. Muscular; without an ounce of excess weight and with just a touch of tannin to lose. Drink 1993-2005 .  ", 83m, 13, 0, 96, "1985", new Guid("008d2853-5a8a-4118-9551-7a1376132b12") },
                    { new Guid("34c91046-34ef-4478-8a0d-b86290d0be5f"), 0, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco Sorì Tildìn", "A majestic wine, beautifully harmonious, seamless and integrated, with magn ificent fruit, matchless complexity and stunning depth of flavor. Hints of violet, toast and nutmeg enrich the plummy raspberry fruit. Long and tight on the finish.  ", 94m, 5, 0, 97, "1985", new Guid("008d2853-5a8a-4118-9551-7a1376132b12") },
                    { new Guid("a5fa1aee-8b52-422a-90de-54e919219144"), 0, new DateTime(1988, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Corton", "Rich, rough and magnificently complex, a powerful wine with cascading plum, cedar, chocolate, decaying violets, smoke, and on and on. With a supple te xture underneath the tannin, this one is what Corton is all about.  ", 75m, 4, 0, 97, "1985", new Guid("e547d5cb-6938-4ebb-8fbd-a5fd6fd20562") },
                    { new Guid("a6f154b5-9fcc-4f55-a84b-f2d502b862f9"), 0, new DateTime(1989, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Romanée St.-Vivant", "Indescribably concentrated and elegant at the same time, starting off deceptively smooth and gentle, then building up the intensity and vibrancy until it climaxes to a sensational finish that echoes cherry, tobacco, berry and vanilla seemingly forever. Tannic enough to need until at least 1995 to soften.  ", 195m, 11, 0, 98, "1986", new Guid("3f78e3cf-d6e6-4b02-9a42-71188446fd67") },
                    { new Guid("8b2b3afb-60ed-4532-9ddd-164a781c3dcc"), 0, new DateTime(1988, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Tâche", "Impressive concentration and depth, the kind of intense flavor, firm tannin, grace and harmony that assures a great wine in 10 to12 years. Flavors are so complex and harmonious that it s hard to pick out the individual elements, but you can find plum, vanilla, lilac and nutmeg.  ", 225m, 37, 0, 98, "1985", new Guid("3f78e3cf-d6e6-4b02-9a42-71188446fd67") },
                    { new Guid("7a4def2c-8b82-40d3-999b-12400beec1fb"), 0, new DateTime(1988, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Richebourg", "A truly great wine. Amazing concentration, brimming with focused cherry, plum, smoke and cinnamon flavors, all tied together into a harmonious package that keeps echoing and changing with every sip. Beautfiully smooth but firm on the palate, it has the uncanny feeling of power with no weight, only mass.  ", 210m, 3, 0, 100, "1985", new Guid("3f78e3cf-d6e6-4b02-9a42-71188446fd67") },
                    { new Guid("68ddb2d5-3fb2-463c-8fe8-d50ad4a786f0"), 0, new DateTime(1988, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Margaux", "A beautifully structured and proportioned wine, soft yet rich with cascading flavors of ripe plum, cherry and cassis that are perfectly integrated with toasty oak, firm acidity and firm but polished tannins. Finish is long, full and deep.  ", 76m, 2, 0, 99, "1985", new Guid("b01ffe7f-f98a-445e-a0f8-21a13f1f3217") },
                    { new Guid("06c4b956-f253-4696-af89-d86a9ba7ee6f"), 0, new DateTime(1988, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pauillac", "Rich and massively concentrated, with layers of plum, anise, black cherry and tobacco, firm acidity and structure and thick, chewy, balanced tannins. Beautiful, elegant and stylish. One of the greatest Lynch Bages ever made; will improve with five or more years in the cellar.  ", 37m, 1, 0, 97, "1985", new Guid("80d10b8c-ec6c-4784-a166-46701ff20e8e") },
                    { new Guid("ed3312d0-1639-4c19-a06b-b57c49f9c672"), 0, new DateTime(2014, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Marlborough Pioneer Block 16 Awatere", "This offers a good mix of fresh, ripe raspberry and cherry flavors, with details of forest floor, black tea, cigar box and nutmeg, finishing with nuances of warm baking spices and a touch of firmness. Drink now through 2025. 1,000 cases made.", 31m, 100, 0, 92, "2012", new Guid("1bad991c-5abe-4951-8360-1a0ee3640558") },
                    { new Guid("7cb7b571-b008-459a-9129-dfdabbc7c93f"), 1, new DateTime(2014, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "GrÃ¼ner Veltliner QualitÃ¤tswein Trocken Kamptal", "A bright, crisp white, with savory hints to the laserlike flavors of Fuji apple, Meyer lemon and melon. Long and richly spiced midpalate, presenting hints of ginger and kiwifruit on the finish. Drink now through 2019. 5,416 cases made.", 22m, 99, 0, 91, "2012", new Guid("ebc7b060-2800-42e0-ad62-148c6b56af84") },
                    { new Guid("524dfba0-80db-4c17-9c41-cbab2f0d921d"), 1, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Epanomi White", "A vibrant white, with piercing acidity to the crunchy apple, pear and quince flavors, featuring loads of scallion and green herbal notes. Dried tarragon and creamy accents linger on the complex finish. Malagousia and Assyrtiko. Drink now through 2018. 8,333 cases made.", 22m, 96, 0, 90, "2013", new Guid("1cd46d36-c311-4e02-9de5-3ce176d76dad") },
                    { new Guid("bd250263-5f78-45e0-8d1d-efdb11ebb762"), 1, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Manzanilla SanlÃºcar de Barrameda Solear", "Very high-pitched, with bright chalk, chamomile, salt and lemon seed notes. The vigorous finish has serious cut. Drink now. 10,000 cases made.", 15m, 95, 0, 90, "NV", new Guid("79a9dcec-a3ea-4b1c-8245-609009246ec8") },
                    { new Guid("d558ad39-ab1f-4c20-bb4a-9a9c5bf337e9"), 0, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cahors", "There's a ripe plushness to the dried blackberry, fig and tobacco flavors that lengthen out on the spice-infused midpalate. Baker's chocolate, cream and vanilla notes power the finish. Malbec and Merlot. Drink now through 2019. 4,500 cases made.", 19m, 94, 0, 90, "2011", new Guid("58f2578b-617b-48d9-a722-6d2a0af246f1") },
                    { new Guid("cdc800a1-97ab-4043-a0c6-04256f578bd7"), 0, new DateTime(2014, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vino Nobile di Montepulciano Incanto", "Rich and rangy, this black cherryÂ, plum-, tar- and spice-infused red is backed by a base of beefy tannins. Balanced overall, with a long finish of earth and spice. Best from 2016 through 2027. 22,000 cases made.", 15m, 92, 0, 90, "2010", new Guid("992bb1c8-6ecc-4666-8860-e3ca85564e6c") },
                    { new Guid("61583516-2df2-458b-8dd3-788d79c9a4fd"), 0, new DateTime(1990, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Willamette Valley Reserve", "Deliciously rich and complex, with ripe, concentrated plum, cherry and spice notes that offer depth and grace. The finish follows through, showcasing the plummy richness. The toasty oak echoes on the finish. Drink now to 1995.  ", 20m, 81, 0, 91, "1987", new Guid("c7cd87fd-3e5a-47c8-9a63-9541b5d5af2e") },
                    { new Guid("5c7255ad-72ea-4faa-85de-3f436441c001"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Willamette Valley Tavola", "Fresh and inviting, with cherry and raspberry notes at the core, showing cinnamon and hibiscus hints around the edges. The flavors float easily into the long, expressive finish. Drink now through 2019. 12,000 cases made.", 25m, 53, 0, 91, "2012", new Guid("c7cd87fd-3e5a-47c8-9a63-9541b5d5af2e") },
                    { new Guid("04ae5c58-8993-4239-8065-add2659ed834"), 0, new DateTime(2014, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grenache California On the Road", "A robust style, brimming with rich, juicy blackberry, wild berry and boysenberry flavors. This is intense and vibrant, featuring a dense core of fruit complemented by black licorice, cedar and spice notes. Drink now through 2022. 682 cases made.", 42m, 52, 0, 93, "2011", new Guid("49651634-4c11-4fc1-b708-74ccf42b8e2d") },
                    { new Guid("626dc2eb-b371-47e8-ac54-780bf626ee2b"), 0, new DateTime(2015, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "CÃ´tes du Roussillon-Villages", "A rich and extracted style, with luscious dark fruit, blackberry and tar flavors that are well-structured. Features hints of licorice snap midpalate, leading to a long finish of dark chocolate and cream. Grenache, Syrah, MourvÃ¨dre and Carignan. Drink now through 2020. 700 cases imported.", 25m, 85, 0, 91, "2011", new Guid("7fa06fa2-caa7-4787-8fb5-b37977e4591a") },
                    { new Guid("9cb30dfd-ec40-4b52-aab1-341132d80a7d"), 0, new DateTime(2015, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Douro", "This has a delicate core of violet, plum and red berry flavors that are broad yet well-defined. Medium-grained tannins gain power midpalate, with mineral and shiso leaf notes on the taut finish. Drink now through 2020. 600 cases imported.", 20m, 84, 0, 91, "2013", new Guid("6fff6c20-b8a0-4b68-bf03-37431d18f148") },
                    { new Guid("63f27a0e-b7fd-478c-928c-47c8cda4d9cb"), 1, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Grigio Friuli Colli Orientali", "This creamy, medium-bodied version is framed by finely cut acidity that focuses the rich minerality and flavors of guava, star fruit, pickled ginger and oak spice. Lingering finish. Drink now through 2022. 3,500 cases made.", 20m, 83, 0, 90, "2014", new Guid("0ab3cd6b-5968-4759-84f4-11d6cdb3404b") },
                    { new Guid("ba981611-e441-48d4-a449-8c62aa0d9050"), 0, new DateTime(2015, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Marchigue", "A ripe, dense and rich red, with concentrated roasted plum and dark cherry flavors, flanked by notes of dried meat and Asian spice. Bittersweet chocolate details linger with hints of cream on the finish. Drink now through 2020. 3,500 cases made.", 23m, 82, 0, 91, "2011", new Guid("9b0b4415-75ba-424f-aa2e-c26c1cf89f78") },
                    { new Guid("354dc2ca-e2f3-412e-8d8b-aaa931ba00ee"), 0, new DateTime(2015, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec LujÃ¡n de Cuyo Single Vineyard", "Decadently spiced, with intense dark chocolate and roasted plum flavors that feature notes of paprika. Black pepper accents show on the lush, mineral-filled finish. Needs time to open up. Best from 2017 through 2021. 3,800 cases imported.", 27m, 81, 0, 91, "2013", new Guid("40363db9-5b89-412e-b522-b799c840c22f") },
                    { new Guid("3c4c2924-3978-4ad7-aae1-87fb13dc1969"), 0, new DateTime(2014, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja Castillo Ygay Gran Reserva Especial", "Bold and rich, this red fills the palate with blackberry, plum sauce, soy, chocolate and spice flavors. Broad and deep, in a modern style, with plenty of oak and enough backbone to stay focused. Drink now through 2020. Tasted twice, with consistent notes. 750 cases imported.", 89m, 84, 0, 94, "2005", new Guid("f7829d96-5aca-4e90-89f0-55f5330acd83") },
                    { new Guid("107051af-7e2c-4830-8548-c0cbb8c8d59c"), 1, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Viura Rioja CapellanÃ­a", "Aromatic notes of beeswax, chamomile and orange blossom frame the flavors of baked apple, coconut, ginger and tarragon in this generous white, whose fresh acidity and light tannins keep it structured, with the spicy accents lingering on the finish. A traditional style. Drink now through 2020. 3,244 cases made.", 28m, 80, 0, 92, "2010", new Guid("f7829d96-5aca-4e90-89f0-55f5330acd83") },
                    { new Guid("18b7c93d-6dbf-43d1-a534-73af5629975b"), 5, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Champagne RÃ©serve", "Racy acidity firms up this rich Champagne, with a honeyed overtone to the well-spiced palate of grilled nut, poached pear, lemon parfait and ripe raspberry. Lacy in texture, with a smoke-tinged finish. Disgorged January 2015. Drink now through 2020. 5,500 cases made.", 46m, 79, 0, 92, "NV", new Guid("ba54ee93-291e-4432-8554-c264a071f03b") },
                    { new Guid("6c34c665-4dce-486a-a4a5-46fc9868b1cb"), 1, new DateTime(1990, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Alexander Valley Robert Young Vineyard Reserve", "Beautifully ripe, fruity and gaining maturity, this is complex in aroma, full and pearlike in flavor and beginning to show the intriguing effects of age in the earthy, buttery notes and creamy, velvety texture. Stays crips and fruity on the finish. It can safely cellared through 1995.  ", 40m, 56, 0, 93, "1985", new Guid("65275b38-bf02-404b-8293-9f28f6d1ab54") },
                    { new Guid("76ddf033-cbc6-420b-890b-853e2e0e8c99"), 1, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Alexander Valley Belle Terre Vineyard", "  ", 17m, 94, 0, 92, "1986", new Guid("65275b38-bf02-404b-8293-9f28f6d1ab54") },
                    { new Guid("8bd4e1fc-19ae-42cd-87a1-98700a9e64e8"), 1, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Margaret River Art Series", "Amazingly focused, layered and expressive, with pear, lime, guava and floral flavors that meld harmoniously and linger on the creamy finish. Deftly pulls all the elements together into a cohesive whole, lingering effectively and precisely. Drink now through 2022. 3,000 cases made.", 89m, 76, 0, 94, "2012", new Guid("ccd89126-01da-4477-86bb-c17e7e42f3fe") },
                    { new Guid("37ccdfb5-0329-4af8-880c-918e4c59c496"), 6, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bandol RosÃ©", "Bright and high-pitched, this features a talc note that gives way to rosemary and white cherry hints, while the finish races along with sea salt and blood orange details. Long, chiseled and pure. A delicious rosÃ© that should unwind further with some cellaring. Drink now through 2016. 2,275 cases imported.", 40m, 75, 0, 92, "2014", new Guid("c81e302f-aab8-47d1-b3f9-6ad4cf8086d9") },
                    { new Guid("a086468b-b67b-44c1-8991-f737253f7d9f"), 0, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aglianico del Vulture", "The black cherry and fresh earth flavors are sweet and focused in this harmonious, medium-bodied red, accented by black olive, fig bread and dried herb notes, all framed by fine-grained tannins that firm up the finish. Drink now through 2027. 15,000 cases made.", 20m, 74, 0, 90, "2012", new Guid("edbe633f-fe54-4e29-a920-abcb016015fb") },
                    { new Guid("3b5e0b89-84de-4d76-a303-730f26abaf32"), 1, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malagouzia Florina Turtles Vineyard", "Rich and flush with fresh-cut green apple, honeydew melon and grapefruit flavors that feature a vibrant minerality. Delivers hints of savory herbs, leading to a lush finish of cream and spice. Drink now through 2018. 8,500 cases made.", 18m, 73, 0, 90, "2014", new Guid("84042ecc-9dac-4305-9e18-d09ceacafee9") },
                    { new Guid("8bcbffa3-6516-4e3f-8d3e-a3d34ab48cf2"), 1, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "GrÃ¼ner Veltliner QualitÃ¤tswein Trocken Kamptal Hasel Alte Reben Reserve", "Mouthfilling flavors of ripe citrus, baked apple and buttercream are loaded with luscious notes of custard and pastry. The ripe finish is long and rich-tasting.  Drink now through 2022. 1,000 cases made.", 37m, 70, 0, 92, "2014", new Guid("f36192b9-72de-4b24-972e-a87161417f83") },
                    { new Guid("faa78aef-fedf-4d26-919a-d74811e69585"), 0, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero Hacienda Monasterio", "This rich red delivers blueberry compote, dark chocolate, licorice and smoke flavors in a firm texture, supported by solid tannins. Ample acidity keeps this fresh through the floral, cola-accented finish. Drink now through 2026. 1,000 cases imported.", 51m, 69, 0, 93, "2011", new Guid("1232e925-576a-4cb3-af97-329ede5e27c6") },
                    { new Guid("b0622e42-0ae3-4d7b-aefa-fbc694f51445"), 0, new DateTime(2015, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Primitivo di Manduria LXXIV", "A rich red in a modern style, this offers supple, well-knit tannins and stylish hints of vanilla, mocha and graphite, accenting the ripe plum sauce and plump cherry fruit. Well-spiced, ending with a lingering, mineral-tinged finish. Drink now through 2025. 8,000 cases made.", 22m, 67, 0, 91, "2013", new Guid("5fff6c08-179d-48b1-9e9f-d0ec25520f89") },
                    { new Guid("c04e5bf4-15e2-4829-99da-95eb476f8feb"), 0, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shiraz-Viognier Victoria", "Fresh and expressive, medium-weight but vivid, with black cherry and floral notes, balanced by a stony minerality that glides into the long finish against fine tannins. Drink now through 2020. 4,500 cases made.", 18m, 66, 0, 91, "2013", new Guid("0291c72f-25d0-4510-8637-8fa6e155576d") },
                    { new Guid("ee93b4f4-c670-4f2a-8817-3a315785b1b8"), 0, new DateTime(2015, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Signature", "A classy and classic Napa Cabernet, dark-colored, with rich blackberry, black licorice, cedar, tobacco and dusty, loamy earth notes. The brightness and density of the red and dark berry fruit gives this an immediate and alluring charm. Ends with gutsy, chewy tannins. Drink now through 2030. 11,200 cases made.", 56m, 65, 0, 93, "2012", new Guid("e89e0047-ac2d-4de7-b907-f2e225a049da") },
                    { new Guid("6a1b596f-b616-4611-9742-101607a2cd1d"), 0, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Long Island", "A polished texture carries balanced flavors of tart cherry, pomegranate, toasted hazelnut and espresso in this expressive red. Features firm, well-integrated tannins and lively acidity. Elegant. Drink now through 2022. 2,592 cases made.", 44m, 64, 0, 92, "2010", new Guid("8b27221b-edc2-4d2a-b674-33e3b2e4d735") },
                    { new Guid("c7310c9c-71c1-43b4-953c-358a5bac9814"), 0, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Faithful Hound Stellenbosch", "Dark and muscular, with layers of fig, blackberry and black currant paste offset by espresso, bittersweet cocoa and smoldering tobacco notes. Fleshy and dense on the finish, but well-defined, with a backdrop of singed cedar and bay leaf. Cabernet Franc, Cabernet Sauvignon, Merlot, Malbec and Petit Verdot. Best from 2015 through 2020. Tasted twice, with consistent notes. 3,000 cases imported.", 25m, 82, 0, 91, "2011", new Guid("a160b8bf-1eba-4b3f-9509-0e786a9e5974") },
                    { new Guid("d7741a75-c3d7-4273-8f34-1bd663a81f18"), 1, new DateTime(2015, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chenin Blanc Stellenbosch W Block", "This distinctive white shows a wide range of yellow apple, white ginger and quince notes, with intriguing blanched almond, Brazil nut and dried citrus peel flavors slightly reminiscent of Sherry. Very fresh and energetic, showing no oxidation. A lovely combination of ripeness and cut. Only available in 3-pack with other Single Vineyard Series bottlings. Drink now through 2020.  ", 33m, 63, 0, 93, "2013", new Guid("a160b8bf-1eba-4b3f-9509-0e786a9e5974") },
                    { new Guid("2203cb83-8253-4546-8511-daab99650592"), 0, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grenache Clarendon Romas", "This has terrific presence, with dark berry, cherry and floral flavors on a taut frame, expanding on the finish against nubby tannins that linger expressively and intensely. Best from 2017 through 2021. 500 cases imported.", 75m, 61, 0, 95, "2009", new Guid("fb6c359e-bbbb-4ef6-b67c-c2c636308d93") },
                    { new Guid("c207353f-6bb7-4dda-afcd-3b2d35d0862b"), 0, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Alexander Valley Rockaway Single Vineyard", "A remarkable wine that exhibits powerful flavors of ripe currant, blackberry and cherry along with pleasing notes of cedary cigar box, dried herb, green olive and tea. Ends with firm, dusty tannins and fine length. Drink now through 2028. 1,808 cases made.", 75m, 59, 0, 94, "2012", new Guid("3e734088-99f7-46b8-804f-a2335f7c750a") },
                    { new Guid("006b5693-d6aa-4e78-b642-1253aa2e54fa"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja Finca San MartÃ­n Crianza", "This red is focused and polished, delivering harmonious flavors of black cherry, olive, smoke and mineral. The tannins are well-integrated, the acidity fresh. A bit reserved, but has depth. Drink now through 2022. 10,500 cases made.", 14m, 58, 0, 91, "2012", new Guid("caa504e7-7983-4c99-9115-b8c3e5beb764") },
                    { new Guid("ddd757dd-924d-43de-ab14-0ce0f5e314ae"), 1, new DateTime(1989, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Kumeu", "  ", 29m, 63, 0, 93, "1987", new Guid("bc3ed980-a51a-4e9e-91b2-bf16a21f5efb") },
                    { new Guid("d9ed8c0f-556a-4015-9dc7-bb8231984f65"), 1, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Kumeu Estate", "Sleek and generous, with peach, pear, spice and honey notes, supported by refreshing, vibrant acidity. The spice and toasted nut notes gain momentum on the long, lingering finish. Drink now through 2022. 5,500 cases made.", 34m, 54, 0, 93, "2012", new Guid("bc3ed980-a51a-4e9e-91b2-bf16a21f5efb") },
                    { new Guid("7db56c9d-cfb9-4b73-b7ed-985e8c4c51c1"), 0, new DateTime(2015, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bierzo PÃ©talos", "Expressive black cherry, currant, licorice, mineral and smoke flavors mingle in this focused red. The texture is gentle but firm, with well-integrated tannins and racy acidity providing structure. A compact wine that shows good intensity. Drink now through 2023. 30,000 cases made.", 23m, 53, 0, 91, "2013", new Guid("de7e8036-59dc-4872-acee-e203f7d21b2d") },
                    { new Guid("e82e4f91-4c98-4b0a-b30f-83e89a60c6bd"), 0, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toscana Ilatraia", "Dense and tightly wound, with a beam of black cherry and blueberry fruit. Cedar, smoke, tar and tobacco notes add nuance, giving this a complex impression overall. Balanced and long, with a compact finish that should expand as this integrates more fully. Cabernet Sauvignon, Petit Verdot and Cabernet Franc. Best from 2018 through 2032. 3,750 cases imported.", 60m, 52, 0, 94, "2012", new Guid("c7713c28-a5d5-4515-b2ab-a70b55767e44") },
                    { new Guid("2d45707d-fd9b-438a-afab-2cb4b0fbe76c"), 0, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Etna", "Elegant and well-knit, this tangy red is rich, with a baseline of smoke and grilled herb notes layered with flavors of wild strawberry, candied violet, dried cranberry and spice box, followed by a chewy finish. Drink now through 2023. 7,500 cases made.", 24m, 87, 0, 90, "2013", new Guid("59a9f472-bfeb-4fe4-a763-17f80fcd570c") },
                    { new Guid("4149f215-e669-42cb-b99e-c35a6cb6da10"), 0, new DateTime(2015, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Colchagua Valley Royale Los Lingues Vineyard", "A ripe and muscular red, offering dark plum, dark cherry and currant flavors, filled with notes of dried beef and Asian spice. Grippy midpalate, with a creamy allure. Mint and dark chocolate accents underlie the long, rich finish. Drink now through 2020. 4,160 cases made.", 26m, 88, 0, 91, "2012", new Guid("c9ecf2a1-9cde-4b62-948b-f9f3879f5fc3") },
                    { new Guid("4615e272-9c26-49b9-b9d8-af05127344e8"), 0, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sicilia", "A lovely, medium-bodied red, with a pure beam of ripe cherry and fresh acidity layered with supple tannins and accents of star anise, dried thyme, loamy earth and mocha. Drink now through 2023. 10,000 cases made.", 26m, 89, 0, 90, "2013", new Guid("8487208f-9d02-4c4f-9d1b-54cec7f6e4c9") },
                    { new Guid("9e3a8a7e-82ec-4da9-9ea2-4687ca430a20"), 1, new DateTime(2015, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling SpÃ¤tlese Rheingau", "A honeyed style, filled to the brim with rich minerality and luscious creaminess. Very lush, with flavors of baked pineapple and pear sauce. Fresh and juicy on the finish. Drink now through 2035. 1,500 cases made.", 25m, 91, 0, 91, "2013", new Guid("9c9f11ee-18e7-4f8c-847b-e1194560be32") },
                    { new Guid("f59acee1-d2ba-486e-af22-c497e851ff28"), 0, new DateTime(2014, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barolo Brunate", "Rose, peony, cherry and raspberry aromas and flavors are the main themes in this detailed red. Accents of tobacco and leather add depth, keeping this impeccably balanced and harmonious. The finish is long and echoes with notes of fruit, flowers and mineral. Best from 2017 through 2035. 700 cases made.", 129m, 51, 0, 97, "2010", new Guid("adca1171-37e9-4fb2-9ca1-fd75086b795b") },
                    { new Guid("7df35bbc-0f3a-4318-b909-e122b8687aeb"), 0, new DateTime(2014, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Mendoza Zolo Reserve", "A deeply colored and robust red, with a core of lusciously spiced dark plum, blackberry and dark currant flavors that are long and pure. Medium-grained tannins and firm acidity lend this a muscular structure. The rich finish is filled with dark chocolate and Asian spice notes. Drink now through 2020. 4,000 cases made.", 19m, 48, 0, 91, "2012", new Guid("bf190b95-35a8-4e02-bcfb-1d7a2b6ea42c") },
                    { new Guid("a4ff46b5-580f-4994-9bab-de3c613d840a"), 0, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toscana Luce", "Polished and complex, featuring ripe black cherry, plum, mint, vanilla, chocolate, leather and tobacco aromas and flavors. Dense and tannic, with concentrated sweet fruit for balance. Finishes long and harmonious. Merlot and Sangiovese. Best from 2017 through 2035. 1,600 cases imported.", 105m, 47, 0, 95, "2011", new Guid("2583cea7-932f-4aa4-a2b5-4991207361e2") },
                    { new Guid("e7f4f0c6-32cf-4a30-8288-b279c42ddecb"), 0, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Patriota Mendoza", "A rich red, packed with concentrated flavors of blackberry, dark plum and mocha, featuring plenty of dark chocolate notes. Offers a ripe texture, with creamy accents and hints of savory herb on the long finish. Drink now through 2020. 12,500 cases imported.", 23m, 45, 0, 91, "2012", new Guid("b56ecd23-6ded-4e9c-8b09-3e186e2b1af3") },
                    { new Guid("7fe336ae-3db1-47e2-8f02-bd18842a1f76"), 0, new DateTime(2014, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon-CarmenÃ¨re Colchagua Valley", "This suave version shows refined, mineral-infused flavors of dark currant, plum and dried blackberry. Anise and cocoa powder notes provide added complexity. Drink now through 2020. 8,000 cases imported.", 14m, 44, 0, 91, "2011", new Guid("b0744ab7-5d18-4a54-896d-1cc7f9d91e46") },
                    { new Guid("b1377705-6cf3-4e5a-8509-3a493c279c6c"), 0, new DateTime(2014, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clos Apalta Limited Release Colchagua Valley", "Big and rich, this red is filled with powerful flavors of blackberry, dark currant, black olive and dark chocolate that are built on an ironclad frame. Notes of cocoa powder and cream chime in as well, and the muscular finish lingers with hints of savory herb. CarmenÃ¨re, Cabernet Sauvignon and Merlot. Best from 2014 through 2022. 2,000 cases imported.", 89m, 42, 0, 94, "2010", new Guid("67b28282-495d-4ceb-8d95-bd5f0e79eab2") },
                    { new Guid("a43b2b28-3290-4c27-8408-3cd380a43957"), 1, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling QbA Mosel Dr. L", "This succulent white is filled with plush red peach, cherry and white currant flavors that are supported by zesty acidity. Long and creamy on the finish, offering plenty of spicy overtones. This is impressive for the category. Drink now through 2016. 100,000 cases made.", 12m, 40, 0, 91, "2012", new Guid("64981dfd-9fd6-4f51-aa38-a264b8dc200d") },
                    { new Guid("e8935368-2c53-490d-88cd-70115943ee95"), 1, new DateTime(2014, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Russian River Valley Eastside", "Delicious from start to lingering finish, this is rich, broad and exotic, with tiers of complexity built around smoke, fig, apricot, citrus peel and bubble gum flavors. Features a silky smooth texture and just the right amount of tannins. Drink now. 825 cases made.", 80m, 38, 0, 95, "2012", new Guid("a4f015a6-6591-46d4-ba10-4c0c419c80de") },
                    { new Guid("5a4855ea-8e52-414e-8c25-a42f9b7e9c4b"), 0, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco RabajÃ ", "Bright, with cherry, strawberry and floral aromas and flavors, this is backed by a firm yet integrated underlying structure. Beautifully poised for development, so hands off for now. Juicy and long, delivering a lingering aftertaste of cherry, spice and mineral. Best from 2015 through 2027. 1,420 cases made.", 55m, 37, 0, 94, "2010", new Guid("43ceab09-9911-4c23-a702-b879db6f4d5a") },
                    { new Guid("a143d5ec-abfa-490b-b52b-9235682f791d"), 0, new DateTime(2014, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Sonoma Coast Marcassin Vineyard", "Amazingly seductive, from the initial aromas of smoky, toasty, creamy vanillaÂscented oak to the richer mix of wild berry and raspberry fruit. Lifts midpalate and soars from there, finishing with a pleasing tannic grip and a long, persistent finish. Drink now through 2025. 1,800 cases made.", 125m, 36, 0, 97, "2009", new Guid("7740ea22-6d4b-4424-914c-cfc03b060379") },
                    { new Guid("fab505b9-a77b-4aa0-b127-208107f63c80"), 0, new DateTime(2014, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Walla Walla Valley", "This fresh and vibrant red is tightly wound around fine tannins, offering a generous burst of currant and plum fruit, hinting at clove and pepper as the finish lingers harmoniously. Drink now through 2021. 5,244 cases made.", 29m, 35, 0, 92, "2011", new Guid("8c3e56ac-5387-4b59-83c6-1f61ce38f3a2") },
                    { new Guid("d91298e0-9222-4c31-9773-e07692349d00"), 0, new DateTime(2014, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Sonoma County 55% Slope", "Dark, rich and layered, with tiers of dense dark berry, graphite-crushed rock, cedar, mocha and brownie flavors, ending with dried herb and tobacco accents. The fruit density stands out. Drink now through 2024. 3,385 cases made.", 45m, 32, 0, 93, "2009", new Guid("31c48727-0641-4e2d-9efd-f98b497f0a34") },
                    { new Guid("6dea074a-0823-4d49-b9b0-1096d24e4e40"), 0, new DateTime(2014, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sangiovese-Cabernet Sauvignon Toscana Poggio al Tufo Rompicollo", "Presents a whiff of blackberry, bacon and ink, followed by dark berry, black pepper and spice notes. Rich and supple, with ample structure for support and a long, fruit-, spice- and mineral-filled aftertaste. Sangiovese and Cabernet Sauvignon. Best from 2015 through 2022. 3,000 cases imported.", 18m, 31, 0, 92, "2011", new Guid("7e73008e-f8c5-4e14-b5f8-3939e47fd084") },
                    { new Guid("36c04893-ad0b-49da-8c36-e01fe09ecfff"), 0, new DateTime(2014, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Douro Colheita", "Mocha, hot spice and chocolate notes fill this decadent red to the brim. Very long midpalate, with accents of slate and spice. Finishes with smoke, cream and cedar details. An exotic red from Portugal. Drink now through 2019. 8,160 cases made.", 15m, 27, 0, 92, "2011", new Guid("72535236-b866-42f3-9fe9-48af339e3a13") },
                    { new Guid("7fc2e465-1dbd-4d76-a34a-9576c5fb8724"), 0, new DateTime(1989, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero Pesquera Crianza", "Jam-packed with concentrated rapsberry and plum aromas and flavors, plus plenty of tannin to earmark this for the cellar, perhaps until 1993-95. Beautifully balanced and focused.  ", 20m, 94, 0, 91, "1986", new Guid("2d7ee744-0da1-4e87-b739-4b147a21586a") },
                    { new Guid("91a37415-bf72-4738-8a66-23a947bb299b"), 0, new DateTime(2014, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Russian River Valley Hallberg Ranch", "Impressive, offering richness, vibrancy and subtle charm, marked by snappy blackberry, red berry, spice, sage and underbrush notes. Ends with a minerally edge that holds the flavors. Drink now through 2021. 11,100 cases made.", 42m, 26, 0, 93, "2011", new Guid("1feba723-c676-4595-a41d-fd13ebbb139f") },
                    { new Guid("e11525b4-42cd-4022-b4fb-d655c4587861"), 0, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Uco Valley", "Very suave and polished, with ripe, pure flavors of blackberry, hoisin sauce and black pepper. Finely textured, this is packed with tar and roasted plum notes, showing plenty of licorice snap and dark chocolate accents on the powerful finish. Best after 2020. 7,000 cases imported.", 32m, 19, 0, 93, "2012", new Guid("c8e41c2d-2a76-4222-b475-72d685aa7caa") },
                    { new Guid("1b30c428-f7f8-4157-906d-1dfd4a7227a2"), 0, new DateTime(2014, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Yamhill-Carlton District Mineral Springs Ranch", "Vibrant, expressive and multi layered, offering black cherry, red plum, sassafras and dead leaf flavors on a long and silky frame. The tannins are submerged, allowing the gorgeous flavors to float through the finish. Drink now through 2022. 1,500 cases made.", 60m, 17, 0, 95, "2012", new Guid("b6203a0f-4e3e-4d98-9a78-61313e83b2d1") },
                    { new Guid("77cfc652-3d5f-41df-b446-81e609f8e0a0"), 0, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Colli della Toscana Centrale Flaccianello", "Aromas and flavors of violet, black currant, raspberry and spice gain intensity as this red builds to its lengthy conclusion. Vibrant and harmonious, this needs some time to shed its well-proportioned tannins. Sangiovese. Best from 2017 through 2030. 4,000 cases made.", 120m, 14, 0, 95, "2011", new Guid("ebba9888-00b9-4fad-8754-f144568e8d9b") },
                    { new Guid("7007c013-0e9a-4bdc-b093-f7e43a285965"), 4, new DateTime(2014, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauternes", "A large-scale version, with seamlessly layered notes of almond cream, apricot, ginger, mango, piecrust, papaya and toasted hazelnut. The long, spice-infused finish shows ample depth, echoing with an enticing tarte Tatin note. Best from 2016 through 2035. 7,000 cases made.", 50m, 12, 0, 97, "2011", new Guid("3dbe4b3b-60b1-4e20-946e-3222e8104e65") },
                    { new Guid("455ede63-907c-4516-80e7-b730ad2e426c"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Sta. Rita Hills", "Pure, rich and vivid, with snappy wild berry, pomegranate, lavender, black tea and mint notes, ending with firm tannins and a stemmy edge, lending traction to the palate. Drink now through 2023. 1,226 cases made.", 40m, 8, 0, 94, "2012", new Guid("915d492c-e748-463d-b468-39f5c3b4cf59") },
                    { new Guid("6f0cde76-70b7-43be-acfe-0ef337cce965"), 0, new DateTime(1989, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chianti Classico Bellavista", "Very spicy, opulent and ripe, almost exotic in its heady fruit intensity both in aroma and flavor, round and rich on the palate, firmly supported by fine tannins. The fruit flavors seem to echo for hours. A great cellar candidate, perhaps best around 1996. 1,000 cases made.", 30m, 37, 0, 94, "1985", new Guid("5be5ba2f-3076-4879-be86-a0ad1dbb9583") },
                    { new Guid("f3c5e39e-9ad7-472c-9399-aa1c7964fa16"), 0, new DateTime(2014, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chianti Classico San Lorenzo Gran Selezione", "Offers a combination of power and elegance, with a racy feel. Notes of wild cherry, strawberry and rose, with leafy, woodsy flavors, permeate this driving red. The finish is long, but this needs time to shed the tannins. Well-defined from start to finish. Sangiovese, Malvasia Nera and Merlot. Best from 2017 through 2030. 8,000 cases made.", 52m, 6, 0, 95, "2010", new Guid("5be5ba2f-3076-4879-be86-a0ad1dbb9583") },
                    { new Guid("bebb9335-2c30-4786-bd5e-cccc0a2bd740"), 4, new DateTime(2014, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vintage Port", "Powerful, refined and luscious, with a surplus of dark plum, kirsch and cassis flavors that are unctuous and long. Shows plenty of grip, presenting a long, full finish, filled with Asian spice and raspberry tart accents. Rich and chocolaty. One for the ages. Best from 2030 through 2060. 5,000 cases made.", 82m, 1, 0, 99, "2011", new Guid("efa37162-16d4-4c72-9584-054661f69609") },
                    { new Guid("da4e4c9e-707b-4bdc-9154-f2fe0ec34230"), 1, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "CÃ´tes du Jura Les Chamois du Paradis", "This is lovely, with verbena, citrus oil, white peach and Jonagold apple fruit flavors seamlessly layered, offset with a lovely quinine hint and carrying through a long, floral finish. Still a bit tightly coiled, this should unfurl nicely with a bit more cellaring. Chardonnay. Best from 2017 through 2023. 167 cases made.", 53m, 99, 0, 93, "2011", new Guid("917a5c23-4503-451a-9763-f4c7e05d50fd") },
                    { new Guid("380fd1c7-85ae-46c5-8735-fea2137a681a"), 0, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beaune Teurons Domaine", "Vibrant and juicy, this red offers black cherry flavors, with accents of licorice, spice and floral. Silky and rich, with fine balance and a lingering aftertaste of fruit and spice. Drink now through 2024. 200 cases imported.", 55m, 96, 0, 92, "2012", new Guid("f313d31e-2ca5-49a8-b265-cda46c726571") },
                    { new Guid("6ca22a7c-4262-4ceb-bd9d-7062de58db51"), 1, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Clare Valley Springvale", "Lithe, vibrant and light-footed, but explosive, with flavors of pear, honeysuckle, apple and cinnamon, glowing brightly on the long and expressive finish. Drink now through 2024. 2,800 cases made.", 42m, 95, 0, 93, "2014", new Guid("25578ddb-fc99-466f-ac22-8dd274aadf40") },
                    { new Guid("693fd6ff-9ca4-4ee3-9ee2-2df3cbd59f2c"), 0, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bandol", "This has a dark leathery frame but remains sleek and pure overall, with a dense core of currant preserves, steeped plum and lightly mulled blackberry fruit, studded with dried anise and singed juniper notes. A bolt of iron is buried deeply on the finish. Best from 2017 through 2025. 420 cases imported.", 39m, 94, 0, 93, "2012", new Guid("4bd004cc-8541-469f-a8e1-b0210e90ec7b") },
                    { new Guid("d56c74eb-2289-4b02-871c-7dd65e44e1f3"), 0, new DateTime(2015, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "NardÃ² NerÃ¬o Riserva", "A silky red, with sweet, ripe flavors of sun-dried black cherry and date, underscored by rich hints of wood smoke and mineral. This is well-knit, featuring sinewy tannins and accents of &lt;i&gt;garrigue&lt;/i&gt; and graphite. Drink now through 2025. 3,200 cases made.", 22m, 93, 0, 90, "2012", new Guid("b0b472b9-174a-42cf-9f00-d8ae18ecbe8b") },
                    { new Guid("aa1e61b9-a031-4215-83bd-e892a365bf63"), 0, new DateTime(2015, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "ChÃ¢teauneuf-du-Pape Omnia", "Beguiling wood spice, Lapsang souchong tea and warmed raspberry and blackberry coulis aromas and flavors glide along in this gorgeous red, enhanced by a shiso leaf note and backed by a silky, iron-edged finish that is deceptively long. A very distinctive style. Best from 2017 through 2030. 1,000 cases made.", 116m, 92, 0, 95, "2012", new Guid("47c63057-fcc6-464b-b91a-a70d89ffcdae") },
                    { new Guid("b86e7b7d-60a3-4776-8657-2b2b600973c9"), 0, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Uco Valley Alfa Crux", "Plush and rich, with concentrated flavors of dark plum, porcino, baker's chocolate and blackberry. This has a core of dried beef and Asian spice notes that linger on the powerfully creamy finish. Drink now through 2018. 1,250 cases made.", 54m, 25, 0, 94, "2010", new Guid("d4d5bdf3-5b15-45a0-a3af-328740179adc") },
                    { new Guid("d4e13525-58a7-4fd8-8aca-6bcfd87d9228"), 0, new DateTime(1990, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero Pesquera Reserva", "This tight, concentrated and complex Spanish red oozes with fruit flavor and has very firm tannins and acidity. Blackberry and raspberry flavors linger on the finish, joined by hints of butter and spice. Tempting to drink now, but better to cellar throug 2,500 cases made.", 25m, 75, 0, 92, "1986", new Guid("2d7ee744-0da1-4e87-b739-4b147a21586a") },
                    { new Guid("72dae04c-18dd-41f4-b5af-83ca50ba20c0"), 0, new DateTime(1988, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Arte", "The distinctive raspberry tang of Nebbiolo is the beautiful core around which this elegant, full-bodied wine is built. So artfully balanced it's drinkable now, but the tightly wound flavors need 3-4 years to unfold.  ", 22m, 30, 0, 91, "1985", new Guid("a9affaed-19d6-4d23-b0ae-bd3aec72ec66") },
                    { new Guid("494b19fb-39a1-490f-94e3-91fc6d1735ad"), 0, new DateTime(1990, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barolo Ciabot Mentin Ginestra", "Smells like anise-flavored grappa at first, turning tannic and powerful on the palate, but the raspberry and vanilla flavors emerge forcefully from the grip of tannin. Big enough to need until the turn of the century, but it has the power and complexity to win in the end. Needs cellaring until 1998 to 2000. 800 cases made.", 27m, 74, 0, 92, "1985", new Guid("a9affaed-19d6-4d23-b0ae-bd3aec72ec66") },
                    { new Guid("4ea383b5-8b62-4f00-afb0-8377879b7b1c"), 1, new DateTime(1990, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Sonoma County", "A polished, distinctive wine that's crisp and flavorful, with ripe, spicy, concentrated flavors of rich, honeyed quince and fig. Has hints of grassiness and impressive length. Drinkable now. 10,000 cases made.", 8m, 87, 0, 90, "1988", new Guid("1e1eccc2-ecbc-4762-adc2-a3312d82ec01") },
                    { new Guid("a31068d5-eb50-437b-be3f-3525f8a5155d"), 0, new DateTime(1990, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Alexander Valley Reserve", "Dense, rich and complex, this wine keeps unfolding with every sip, offering coffee, cherry, nutmeg, plum, and then herb and currant flavors and a velvety texture. Drink from 1995. 2,300 cases made.", 30m, 28, 0, 94, "1985", new Guid("1e1eccc2-ecbc-4762-adc2-a3312d82ec01") },
                    { new Guid("18b08be9-6b3d-4b70-9a23-37ebcc5bce83"), 4, new DateTime(1990, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Johannisberg Riesling Napa Valley Edelwein Gold", "With its golden color and honey, apricot and subtle spice aromas and flavors, this is a knockout from the first whiff to the last echo of the long finish. A rich, sweet wine that is drinkable and seductive now and should continue to develop through 2000. 1,000 cases made.", 22m, 71, 0, 92, "1989", new Guid("ccabb60d-7c98-4ef8-b578-a32d4d240cb3") },
                    { new Guid("5434a771-5579-4a2f-bf4e-6b4d31568693"), 1, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fumé Blanc Napa Valley", "Rich and opulent, with sharply focused sweet pea, fig, melon and herb notes that are intense and lively. Has fine depth, elegant balance and flavors that linger long and full on the finish. Drink now through 1993. 8,000 cases made.", 10m, 92, 0, 90, "1988", new Guid("7573d265-556a-41ff-b6c5-26f3a02834f0") },
                    { new Guid("a62586a1-2b79-4730-acc5-581fa340acf8"), 1, new DateTime(1989, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Johannisberg Riesling Napa Valley", "Distinctive for its earthy, slate-like aromas and juicy, crisp, nectarine, peach, spice, pine and pear flavors that are complex and very attractive. Exceptionally well-made Riesling. 4,500 cases made.", 8m, 95, 0, 90, "1987", new Guid("7573d265-556a-41ff-b6c5-26f3a02834f0") },
                    { new Guid("4cca67ab-d6e9-451a-bc70-0a333e64dd1e"), 0, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Yakima Valley Otis Vineyard", "  ", 18m, 93, 0, 91, "1986", new Guid("ebd16385-bd6e-4c1e-94cf-c3ee646e2352") },
                    { new Guid("a3a4be26-d530-4aca-9dc8-94fb26c0475c"), 0, new DateTime(1989, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pessac-Léognan", "Rich and elegant with a firm, tannic structure, but the fruit comes rolling through on the finish. The Cabernet flavor is matched with more austere earth, cedar, mineral and plum flavors. Drink now or cellar until 1996.  ", 30m, 91, 0, 91, "1986", new Guid("3673ec8a-a15b-419a-80a9-caf127e360c2") },
                    { new Guid("22a447e9-43be-461a-9b31-f23ceae48060"), 0, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Washington Limited Bottling", "A deep color and dense, concentrated raspberry and spice aromas mark this as something special even before the elegant plummy richness hits the palate. A velvety texture and sense of harmony make it deceptively drinkable today, but it can age, at least through 1993 to '95.  ", 10m, 86, 0, 90, "1987", new Guid("f2bbd503-4b0a-491c-8a80-716c8b9b32d3") },
                    { new Guid("c347e7bc-dd86-4a08-a968-6f0bc90b009d"), 5, new DateTime(1989, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Monterey County", "Rich and ripe, showing lovely Pinot Noir cherry flavors in the nose, with an herbal hint in the aromas. Nutty on the palate and complex, with a long, terrific finish that really makes this one stand out from the crowd. Full flavored and impressive.  ", 13m, 82, 0, 91, "1985", new Guid("da7244ee-a9e6-4e1c-b64d-143adf29c424") },
                    { new Guid("9786b0ff-e21c-4ddc-8d83-b0a88327caec"), 0, new DateTime(1989, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Napa Valley Orion", "Dark, dense and remarkably supple, with gorgeous plum, peach and cherry flavor graced with hints of mint and spice, rounded out with delicious oak. Comes off like a Bordeaux with Rhône flavors, very seductive. Drinkable now if you don't mind some velvety tannins. Not cheap.  ", 30m, 81, 0, 92, "1987", new Guid("ac425ba7-d3ea-40c5-bb75-9c43eae5345a") },
                    { new Guid("565d11f8-0a03-4b79-abc2-da9e5e7ed8fa"), 0, new DateTime(1990, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Les Fleurs du Chaparral Napa Valley", "A terrific California novelty. With earthy flavors and aromas reminiscent of a good northern Rhône, it's big and luscious, with a core of plum and blackberry flavors and attractive accents of game and smoke. This is a well-balanced, beautifully structured wine. The tannins are firm but fine. It's tempting now, but should improve through 1993. 105 cases made.", 15m, 69, 0, 91, "1987", new Guid("a66372a3-61cf-4777-aae3-df5d4e695448") },
                    { new Guid("ab62c5bc-9ae1-4d08-af09-8b703a934ece"), 0, new DateTime(1989, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Sonoma County", "Beautifully concentrated and long, with enough fine tannin to hold it for years in the cellar. After a touch of earthiness on the nose, blueberry, plum and anise aromas and flavors burst over the palate. Should be an elegant wine by 1992-93.  ", 12m, 80, 0, 91, "1986", new Guid("a66372a3-61cf-4777-aae3-df5d4e695448") },
                    { new Guid("9cc5209b-a1e0-40c7-86ac-7387698ac0e6"), 0, new DateTime(1989, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beaune Clos des Fèves", "Rich, almost chocolaty on the nose, turning bright, berryish and satiny on the palate, with a lean texture but deep flavors; it's focused and long. Drink now through 1994.  ", 25m, 77, 0, 92, "1985", new Guid("8141b32e-1bd2-4d60-a2c1-c3105ed2e9f1") },
                    { new Guid("047d0d47-b864-43c7-9191-88bd474a8f57"), 0, new DateTime(1989, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Sonoma County", "Enormously rich, tannic and complex, with layers of concentrated cedar, plum, cherry and herb flavors framed by firm tannins and oak. Gets better with every sip. Drink now.  ", 20m, 75, 0, 92, "1986", new Guid("bb7f8019-230b-489f-bfa1-f8e1e53efc96") },
                    { new Guid("67279278-462d-482f-89fa-7bf9f21d4583"), 1, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Yakima Valley Barrel Fermented", "With its lovely peach-vanilla aromas and flavors, this strikes an extraordinary balance between fruit and oak, all of which is supported firmly and harmoniously. Beautiful to drink now.  ", 10m, 73, 0, 91, "1987", new Guid("cbda38be-74e1-483b-be60-cf1de1b8e557") },
                    { new Guid("2bfbc5bb-5446-40c4-b739-b46982e29aed"), 0, new DateTime(1989, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Vintage Selection", "After showing minty, spicy aromas this settles into rich, mouthfilling currant and cherry flavors, smooth, supple and generous right through the finish. Delicious and drinkable.  ", 24m, 72, 0, 92, "1985", new Guid("85ef4cd1-810f-4ffd-bfdc-8eec7449aa69") },
                    { new Guid("8dafcc8a-60fd-42de-880b-93b9264fe87c"), 1, new DateTime(1989, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay California Select", "Lean, rich, crisp and flavorful with ripe fruit, layers of pear, spice, clove and nectarine notes that keep you coming back for another sip-and finding more complexity. Elegant and subtle, with a lingering finish. A new line for Hess. Drink now through 1994. 7,700 cases made.", 9m, 69, 0, 90, "1988", new Guid("b87c2f7c-69e9-4360-b2e5-b75f17538fbd") },
                    { new Guid("5e82356b-da7d-498f-9b8a-ad24c4d4cd9d"), 0, new DateTime(1989, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Insignia Napa Valley", "Extremely herbal and earthy, very rich, supple and almost unctuous, but loaded with olive, spice, currant and plum flavors. Long and complex, but so distinctive that not everyone will love it. 4,700 cases made.", 52m, 66, 0, 93, "1985", new Guid("331c771f-2507-4e5a-84c7-beba4fc2b2e1") },
                    { new Guid("c701c3c7-ab80-4dcb-9af7-b29f02e3531a"), 1, new DateTime(1990, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Puligny-Montrachet", "Incredibly rich and toasty, with butterscotch and oak, but has the fruit integrity to stand up to the flavors imparted by heavily toasted barrels. It's big and full-bodied, with pear and tangerine notes and generous acidity. Drink now through 1994. 3,000 cases made.", 33m, 53, 0, 93, "1987", new Guid("66fee4ad-9399-4fe7-8631-1f08aab58546") },
                    { new Guid("8d2b52c6-b321-4eab-b663-98f995ca98e7"), 1, new DateTime(1989, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Puligny-Montrachet Les Chalumaux", "Gorgeous Puligny with richness and complexity, well-honed honey, toast, pear and spicy nutmeg flavors and a silky-smooth texture and a pretty aftertaste that lingers.  ", 36m, 65, 0, 93, "1986", new Guid("66fee4ad-9399-4fe7-8631-1f08aab58546") },
                    { new Guid("bf7817ca-c81c-492d-bdae-6f79c9df1881"), 0, new DateTime(1989, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Côte-Rôtie", "Great concentration and firm structure carry the beautiful violet-tinged bl ack cherry and plum fruit, which turns spicy and bit leathery on the finish . Tannic and dense but not heavy-handed. Drink now through 2000.  ", 31m, 64, 0, 93, "1986", new Guid("647cc5f0-6da7-4438-8ace-816b4a4ecd51") },
                    { new Guid("b0264d13-722a-4fda-87ba-04140760f896"), 0, new DateTime(1989, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Russian River Valley Allen Vineyard", "A remarkably rich and complex wine, with layers of black cherry, raspberry, chocolate and vanilla flavors that are very harmonious and elegant, finishing with subtley and delicacy. Has the tannin to age three to five years, but it's hard to wait.  ", 20m, 62, 0, 92, "1987", new Guid("51255556-0072-4136-a3fc-64f8d510b467") },
                    { new Guid("c50b6749-c619-4466-af67-9ddef07666f5"), 0, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ornellaia", "An outstanding discovery. Ripe and tannic, with lots of tobacco flavor to add depth to the raisin and cherry flavors. Supple, harmonious and complex, a bit tough, built like a claret for long-term aging. Try it in 1993 to see how it is developing. 1,000 cases made.", 25m, 58, 0, 93, "1986", new Guid("40b1ba51-634e-4d13-97d9-d3857bbf6b07") },
                    { new Guid("ae39347b-b6f3-467f-82a1-c9f23c70672b"), 1, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chablis Vaillons", "Ripe and generous, oozing butterscotch aromas and flavors to go with a core of lemon and pear flavor, all of it resting on a firm texture that allows some lovely honey and toast nuances to emerge on the finish. Drinkable now, but this one has a long future. Try 1993 to '96.  ", 20m, 57, 0, 93, "1988", new Guid("84614096-28ea-44a9-a35f-14c6f2414c5a") },
                    { new Guid("05c9283c-d394-44bb-83a0-9a3ce4dbc6b5"), 5, new DateTime(1989, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Blanc de Blancs Champagne Dom Ruinart", "Extremely rich and toasty, deep and concentrated; intriguing, with layers of tightly wound vanilla, pear and spicy smoke notes in a very deliberate style. Its deep concentration of fruit makes it a good bet to improve until 1994. A fine, if pricey, Champagne for the cellar.  ", 61m, 54, 0, 94, "1982", new Guid("74bf90a3-4ed0-43e7-8fd1-4724d70f505f") },
                    { new Guid("865b6222-67dd-49b1-8d54-d7b044488ac7"), 0, new DateTime(1989, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Stags Leap District", "Elegant and polished, but plenty of tannin to carry the cedary, tobacco-tinged Cabernet flavors of currant and plum through to a long finish. Great depth and finesse now, so imagine what it will be like in 1995. 5,000 cases made.", 20m, 53, 0, 93, "1986", new Guid("60815fa9-1b5e-4f6c-9335-17650cc675f6") },
                    { new Guid("9e4e9de1-ec53-4d5b-b524-01e6d755f17b"), 0, new DateTime(1989, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Sonoma Valley Rhinefarm Vineyards", "Defines Merlot character. Concentrated, intense and supple, with integrated plum, cherry, tobacco and cedar aromas and flavors and a lush, chocolaty finish. Delicious now but should develop until 1994. 5,320 cases made.", 18m, 49, 0, 93, "1987", new Guid("5b61cfec-fac9-47ca-8c59-2fb91885048e") },
                    { new Guid("473090a5-3eae-49c9-9a9d-533df1ed8b4c"), 1, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Johannisberg Riesling Yakima Valley", "Firm and flavorful with beautifully defined peach aromas and flavors and hints of the typical piney character as well; just a bit off-dry, balanced and very appealing.  ", 6m, 46, 0, 90, "1988", new Guid("e4664cd1-3bcd-4a80-97f3-b8e4b95bf18d") },
                    { new Guid("07d8e77c-0268-4be2-bb8d-b68e74433983"), 0, new DateTime(1989, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Alexander Valley", "A classic claret-style Zinfandel at a great price showing elegant berry, cassis and pepper aromas and flavors, a gentle touch of toasty oak, long on the finish. A faultless Zin. Best around 1990 to 1992.  ", 7m, 45, 0, 90, "1986", new Guid("8535330c-7bc0-4c68-8e74-b1e2ef296cdc") },
                    { new Guid("4b5a02c7-665d-4a8d-bc0b-372084c258fd"), 1, new DateTime(1989, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Spätlese Mosel-Saar-Ruwer Wehlener Sonnenuhr (AP 2)", "  ", 24m, 8, 0, 98, "1988", new Guid("eb521616-8ed3-4fc2-9f4f-777461eb0973") },
                    { new Guid("545f5c04-1893-40b6-87d7-645a6380e658"), 1, new DateTime(1989, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Spätlese Mosel-Saar-Ruwer Maximin Grünhäuser Abstberg", "  ", 18m, 12, 0, 96, "1988", new Guid("694c24f1-71f8-4957-97da-f35fe326dced") },
                    { new Guid("279d4175-721c-43a6-8f96-bc9840ca36ce"), 1, new DateTime(1989, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Spätlese Mosel-Saar-Ruwer Saarburger Rausch", "  ", 17m, 14, 0, 95, "1988", new Guid("0082dafa-af4a-4ed0-bfa8-63172b1b64ed") },
                    { new Guid("73bbf404-09ea-4c6a-b596-a9c438b2b82f"), 0, new DateTime(1990, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Howell Mountain", "A beautifully defined wine, with deep, rich, intense and supple black currant flavors. It's pure and complex, with a pretty overlay of toasty oak flavors that blend together, creating a wine of great harmony and finesse. Has enough tannin to last a decade or more. Best after 1993. 2,700 cases made.", 25m, 16, 0, 95, "1987", new Guid("8d335276-df61-479c-a353-855b45161275") },
                    { new Guid("40584771-5514-4bd1-a2ef-958209391b2f"), 0, new DateTime(1990, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Sonoma County", "Ripe and jammy, with beautifully defined raspberry aromas and flavors and hints of plum, nutmeg, vanilla and toast to make it more interesting. Claret-style in structure and well balanced. Lovely now but should continue to develop. Drink now through 1994. 6,500 cases made.", 12m, 96, 0, 90, "1988", new Guid("fc6d4669-0378-403d-849e-446ab560c469") },
                    { new Guid("d9d14c97-d03e-47e3-a7ec-a16620be3462"), 0, new DateTime(1990, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco Maria di Brun", "Very firm, tannic and austere, with hints of spice and earthiness on the reined-in raspberry and anise aromas and flavors that grow more complex on the finish. Drink now.  ", 37m, 86, 0, 92, "1985", new Guid("600fc319-a062-4d78-a0a0-d6211e889352") },
                    { new Guid("644d8d92-50f9-4f7c-9216-cbae9ede6893"), 5, new DateTime(1990, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Napa Valley Carneros Winery Lake", "Elegant, complex and toasty, with tart lemon, honey and spice flavors extending into a long finish. It's a mouthful of flavor but not full-bodied. It's balanced, creamy and strikes a middle chord between lightness and richness. 2,000 cases made.", 22m, 83, 0, 91, "1987", new Guid("4c3fc258-c53e-41db-9f78-97cd31229d77") },
                    { new Guid("6111b008-9622-45b5-9833-46beb4c5cad5"), 0, new DateTime(1990, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Washington", "Loaded with layers of fresh currant, plum and cherry flavors framed by toasty, cedary oak that echoes vanilla and chocolate notes. Rich and concentrated, with flavors that linger on the finish. Elegantly balanced and tannic enough to cellar. Best after 1994. 605 cases made.", 22m, 82, 0, 91, "1987", new Guid("7abac7d2-602a-471d-858e-f5c86ac63777") },
                    { new Guid("bb837a1b-8f1e-494b-bd88-02cfa372b6bc"), 0, new DateTime(1990, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chianti Rufina Bucerchiale Riserva", "A great wine. It's beautifully focused, complex and deep in flavor, with notes of cherry, spice and chocolate and tannins that are firm but soft. The fruit complexity lingers a long time on the finish. Drink now to 1994. 500 cases made.", 19m, 80, 0, 91, "1985", new Guid("e9850da6-6e09-4c46-8fa6-a6f30a2878f6") },
                    { new Guid("a7ec9135-0fb5-4f36-a9f7-c0f71de1b837"), 0, new DateTime(1990, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Oakley Cuvée Contra Costa County", "Well knit, supple and beautifully flavored with vivid black cherry, spice and blackberry. Elegant in texture and nicely balanced with good acidity and moderate tannins. Drink soon. 3,100 cases made.", 12m, 78, 0, 90, "1988", new Guid("e2caf473-e116-4cfe-b15a-6a006fc667de") },
                    { new Guid("c3ff011b-954f-4563-8140-43e9bb59f788"), 1, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Long Island Grand Vineyard Selection", "Very smooth, harmonious and balanced, offering well-defined pear, orange and vanilla aromas and flavors, hinting at butterscotch and honey on the long finish. A delicious wine for current drinking, and probably worth aging. Drink now through 1993. 400 cases made.", 18m, 77, 0, 91, "1988", new Guid("b2474f32-a5d9-4039-9e31-e083957e4cbb") },
                    { new Guid("fceb35d6-5d06-4b39-9b64-2f552be9d997"), 0, new DateTime(1990, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barolo Cannubi Boschis", "Ripe, round and generous and smooth and spicy from aging in new oak barrels, but bursting with Barolo flavors that echo forever on the finish. With its layers of berry, cherry and anise flavors, it can only devlop more depth with cellaring through at least 1995.  ", 30m, 72, 0, 92, "1985", new Guid("2d85e685-6df6-416d-aa77-32177603d6c6") },
                    { new Guid("04882235-eef2-4f4f-9837-6f6986167bb4"), 1, new DateTime(1990, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay King Valley Reserve", "A Chardonnay that's rich, complex, delicious and beautifully balanced, with everything you could ask for. Flavors of fig, pear, butter and spice last from the aroma to the lingering finish. 35,000 cases made.", 16m, 70, 0, 91, "1987", new Guid("20c4870a-3b91-4192-9c7e-45030688ecbe") },
                    { new Guid("0c32c323-ba21-4659-bd10-78aff6b8b6f0"), 0, new DateTime(1990, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghiaie della Furba", "Ripe and deep, with tightly furled raspberry, plum and cassis flavors beneath a veneer of minerally, earthy character. Not very tannic, but tight enough and powerful enough to require cellaring until it opens up. Best after 1993. 1,295 cases made.", 20m, 64, 0, 91, "1985", new Guid("2f39d5c4-1672-4ef1-97bb-b17ec24573e5") },
                    { new Guid("295ebc66-b0dd-4ac9-9288-a6d79537699a"), 0, new DateTime(1990, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Columbia Valley Reserve", "This unusually concentrated youthful wine is not yet elegant or complex, but it has vivid, focused black cherry and grape flavors in a lush texture, with stiff, young tannins that will need till 1993 or beyond to loosen up. 1,140 cases made.", 12m, 63, 0, 91, "1987", new Guid("9ddb336a-b336-498a-9e43-44ecfb0dc437") },
                    { new Guid("26b11833-08d8-42ff-a4b2-4544e191f4dc"), 0, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Prunaio", "A Sangiovese blend with lots of complexity on a tight, elegant frame. Shows anise and smoke aromas and cherry, strawberry and blackberry flavors wrapped in a veil of tannin that will need until 1993 to '95 to soften. Offers plenty of style and finesse. 2,820 cases made.", 19m, 62, 0, 92, "1986", new Guid("15ac71b4-f448-4599-9d7a-ee93cb5bd2b3") },
                    { new Guid("c5b7373e-a962-4af1-a0b4-b7158453c152"), 1, new DateTime(1990, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Meursault Genevrières", "It's wound up tight, but this is a very polished and elegant wine underneath. A toasty, nutty, oaky quality accents the intense, tight grapefruit, apple and pineapple flavors that linger beautifully on the tangy finish. Won't show its best until 1993 to 400 cases made.", 37m, 55, 0, 93, "1988", new Guid("381bfc8e-34fd-4aaa-b93e-42871dad7826") },
                    { new Guid("72aea3bb-7e0f-4e11-9d93-9beebb3398be"), 0, new DateTime(1990, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brunello di Montalcino Il Poggiolo", "Spicy, elegant and plush in texture, with supple tannins supporting beautifully focused raspberry, anise and toast aromas and flavors. A hint of tamarind adds an exotic note to this A-1 wine that ought to keep improving through at least the rest of the century. 480 cases made.", 34m, 54, 0, 93, "1985", new Guid("848396a6-9610-4dd0-beb9-d4a7a1dcf553") },
                    { new Guid("80e267ec-9bdb-40bb-bec6-9d2993f9454f"), 0, new DateTime(1989, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbera Piemonte", "  ", 6m, 44, 0, 90, "1986", new Guid("110f8d33-b531-4cbe-a640-b5e7d67fa61a") },
                    { new Guid("7ad4a829-9a19-41ce-b969-ca5ba60557ab"), 1, new DateTime(1990, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Alexander Valley Winemaker's Reserve", "A rich, smooth, creamy style that offers a broad array of pretty honey, melon, butterscotch and apple flavors along with a subtle touch of nutmeg and spice. Satiny smooth texture, and a long full finish. Better than previously reviewed. Drink now through 1993. 3,500 cases made.", 24m, 52, 0, 93, "1987", new Guid("ab0b61ac-acd1-47be-a8e6-d9be95f4db2c") },
                    { new Guid("f209fcf6-8c03-42d9-8954-699ddc64faf3"), 0, new DateTime(1990, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Alexander Valley Claret Style", "Delicious layers of complex, concentrated and rich cassis, currant, vanilla and plum flavors abound in this sharply focused, beautifully structured style. It's long and elegant, with just the right balance of tannin, oak and acidity. 1,200 cases made.", 20m, 48, 0, 93, "1987", new Guid("567fd379-3d18-4d6a-8440-adf55e7c56b1") },
                    { new Guid("45d7b26b-379a-455c-9b54-fc1d5ce929cb"), 0, new DateTime(1990, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Sonoma Valley Monte Rosso", "Very ripe and rich, with aromas of cedar and fruit and well-integrated currant, cherry, berry, oak and toast flavors. The tannins are firm, but not overbearing on the finish. The best Martini Cabernet since the sensational 1970. Best from 1995 through 2000. 1,450 cases made.", 20m, 47, 0, 93, "1987", new Guid("a55892ed-d4d1-4b86-ab09-db6281888fb2") },
                    { new Guid("f2260f69-575a-429d-8631-607f29735134"), 1, new DateTime(1990, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Santa Barbara County", "An outstanding wine that's reasonably priced. Rich, intense and concentrated, with sharply focused honey, apple and pineapple flavors that dance on the palate, framed by just the right amount of oak. Complex and intriguing. Drink now. 6,538 cases made.", 12m, 45, 0, 92, "1988", new Guid("cbb7c1a1-0a1c-44ba-a2f8-4cb83205ea50") },
                    { new Guid("533d9231-6998-4ad9-9829-1a2ff744aacf"), 1, new DateTime(1990, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Oregon Barrel Fermented", "Best Oregon Chardonnay we've ever tasted.Full-bodied and rich but graceful, with plenty offruit flavor and complex accents of honey, spiceand vanilla. Its elegant, supple style supportsclassic pear, apple and melon notes. Drink now. 1,000 cases made.", 19m, 42, 0, 93, "1987", new Guid("4b9b140b-7804-4427-9373-e4271530116f") },
                    { new Guid("7969ff03-2044-4549-a14a-5d0e4ab56c30"), 0, new DateTime(1990, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tierra de Barros Lar de Barros Reserva", "Earthy, ripe, complex and distinctive, with toast, cherry, prune and chocolate flavors intertwined in a soft, velvety package that firms up and gets a little tannic on the finish. Long and concentrated, this complex wine is unlike any other we have tasted. 12,500 cases made.", 8m, 38, 0, 91, "1986", new Guid("827976da-ebf5-4f84-ba13-3ceb806b433a") },
                    { new Guid("388ddfce-499d-410d-84a8-0970b6036194"), 1, new DateTime(1990, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Napa Valley Reserve", "Big, rich and creamy, with buttery pear and subtle oak shadings that offer complexity and finesse and a rich toasty-smoky aftertaste that lingers. Elegant and stylish. Drink now. 600 cases made.", 15m, 37, 0, 92, "1987", new Guid("cb7940e9-1eeb-412d-a79f-faef516fc13b") },
                    { new Guid("08eb4269-ccff-4b3b-9541-749323915e38"), 5, new DateTime(1990, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Champagne Gold Label", "A super Champagne. Wonderfully focused and well balanced, with focused lemon and apple aromas, sweet, ripe lemon flavor and hints of dough. Medium-bodied, with a creamy mouth-feel. 40,000 cases made.", 37m, 35, 0, 93, "1985", new Guid("41cd42f3-bd21-4467-b50b-47b59f57d632") }
                });

            migrationBuilder.InsertData(
                table: "Wines",
                columns: new[] { "Id", "Color", "IssueDate", "Name", "Note", "Price", "Rank", "RankYear", "Score", "Vintage", "WineryId" },
                values: new object[,]
                {
                    { new Guid("265583ff-64ea-46a1-b0fc-00f483642d18"), 1, new DateTime(1990, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pessac-Léognan White", "One of the best Bordeaux whites we've tasted in a while, deliciously rich and complex with tiers of citric, earth, stone and fig flavors that are intense and lively. The finish goes on and on. Definitive style. Drink now through 1995. 3,500 cases made.", 15m, 30, 0, 93, "1987", new Guid("4a438e8f-b0c2-4853-8709-42d91f2156d1") },
                    { new Guid("8360a073-8d4e-4838-9fae-5ff34135584d"), 0, new DateTime(1990, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barolo Santo Stefano di Perno", "Powerful, complex and elegant, with blackberry, plum, cedar, smoke and gamy aromas and flavors that carry through the long finish. Tannic but balanced. Cellar until 2000. A better showing than two previous tastings. 800 cases made.", 35m, 27, 0, 94, "1985", new Guid("3990a5d9-ad9a-4580-96b1-bb669e513c3d") },
                    { new Guid("69116254-4d33-400a-b8ce-18eace2779dd"), 1, new DateTime(1990, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Santa Barbara County Barrel Select", "A real hummer. Rich, lush and fruity without being heavy, it shows tons of fruit and a long, lingering aftertaste. Has bold, complex aromas and flavors of pineapple, butter, pear, cream and honey, full-bodied with firm acidity. 1,000 cases made.", 25m, 25, 0, 94, "1988", new Guid("0573903d-5140-45ee-87c2-bba8c5bacb75") },
                    { new Guid("2b567c16-6280-45b5-9455-efbce472f53d"), 0, new DateTime(1990, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Sonoma Valley Reserve", "Haul out the thesaurus. This one deserves all the adjectives you can find. Rich, opulent, supple and complex, with generous plum and vanilla aromas and flavors, magnificent depth and concentration. Drinkable now. 1,042 cases made.", 28m, 23, 0, 94, "1986", new Guid("721299a2-4547-44bf-b6bb-da75b40413b3") },
                    { new Guid("1d70b453-9287-4ba6-afdf-123561704371"), 1, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Alsace Grand Cru Schoenenbourg", "  ", 19m, 22, 0, 95, "1988", new Guid("166ff772-088c-40f4-a38b-3c27cda4ddf9") },
                    { new Guid("2052af9a-4542-4a7d-9ce0-146d2de579a1"), 0, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero Valbuena 3.° Reserva", "A vivid, vibrant Spanish wine, with focused, concentrated wild berry and plum aromas and flavors framed by sweet oak and a touch of anise. There is so much fruit it is tempting to drink it now, but it has the structure to last through at least 1994 or 1995. 1,000 cases made.", 55m, 67, 0, 92, "1985", new Guid("9cd03f8d-822e-4a32-b311-0c8b119a780c") },
                    { new Guid("6f67142f-7da5-4cf9-96ee-dcadae277dbf"), 0, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero Unico Gran Reserva", "Sappy aromas and flavors detract from an otherwise nicely built, smooth and buttery wine. Drinkable now, but don't wait. 1,000 cases made.", 75m, 21, 0, 95, "1979", new Guid("9cd03f8d-822e-4a32-b311-0c8b119a780c") },
                    { new Guid("3b127d88-fdbd-4f43-9a22-2d71ef062e80"), 0, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gevrey-Chambertin Clos Prieur", "Beautifully concentrated, focused, harmonious, artfully balanced between the generous blackberry and cherry flavors and the vanilla, toast and spice of oak. Full-bodied, bursting with fruit and already graceful. Has the stuffing to age well into the late '90s. 150 cases made.", 29m, 50, 0, 93, "1987", new Guid("80694a95-7bc7-48c0-bafd-283fa374597a") },
                    { new Guid("0511c13f-1e00-48e2-b0f5-327e11118197"), 0, new DateTime(2015, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Madiran ChÃ¢teau BouscassÃ©", "Bright, tangy acidity and firm tannins provide solid structure to the dried raspberry, red currant and black tea flavors. Layers of new leather and tobacco leaf echo through the mouthwatering finish of sweet spice and mineral. Drink now. 20,000 cases made.", 20m, 51, 0, 91, "2009", new Guid("f6242063-2989-4f25-9f6d-e70728c4a130") },
                    { new Guid("df844b62-7ccb-4630-b180-c2ea62b75d0a"), 0, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sassicaia", "Remarkably flavorful and complex for such a lean wine. It's beautifully balanced, harmonious, seamless. Hints of plum, spice, anise, tobacco and toasty oak compete for attention, but the wholeis greater than the sum of its parts. Drink now through 2005.  ", 50m, 41, 0, 95, "1986", new Guid("4bdd680f-20d7-46e7-8fa2-4819a12dcafe") },
                    { new Guid("f21add05-d556-43dc-b0cb-742868f9f99b"), 0, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Volcanic Hill", "Incredibly intense and concentrated, deep and perfumed, firm and tannic, but with a rich core of currant, herb and cherry scented Cabernet flavors that promises a long life in the bottle. Best from 1998 through 2002. 726 cases made.", 40m, 39, 0, 95, "1987", new Guid("9e5c5543-9629-4e68-a727-f7ec5a922e4a") },
                    { new Guid("ba425cf0-2479-4be0-adac-6e75f7309c97"), 1, new DateTime(1990, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Puligny-Montrachet Les Folatières Domaine Jean Chartron", "Pear, honey and spice aromas and flavors merge effortlessly on an elegant, supple structure, becoming smooth and harmonious. A classy wine from first whiff to last echo of the aftertaste. Drink now. 1,000 cases made.", 38m, 33, 0, 94, "1988", new Guid("03376154-ddb2-45b9-befd-8919c8f57acc") },
                    { new Guid("fb707dfa-bc85-4aaa-8f5c-07110020eee6"), 1, new DateTime(1990, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chassagne-Montrachet Morgeot", "Incredible depth and concentration with layers of fresh, ripe, rich honey, pear, spice and toasty vanilla flavors on the finish that echo on and on. You rarely see wines of this kind of depth, concentration and complexity anywhere. Drink now through 1995 200 cases made.", 34m, 3, 0, 96, "1988", new Guid("03376154-ddb2-45b9-befd-8919c8f57acc") },
                    { new Guid("417f7081-3bb6-4e0f-9adc-e0ce391a6638"), 1, new DateTime(1988, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Puligny-Montrachet Clos de la Pucelle Domaine Jean Chartron", "Hums with intensity, yet it sits lightly on the palate, beautifully focused with pear, apple, toast and honey in exquisite balance. The flavors seem t o get even more concentrated on the finish.  ", 50m, 72, 0, 94, "1986", new Guid("03376154-ddb2-45b9-befd-8919c8f57acc") },
                    { new Guid("6b934e49-fa29-491c-9c69-65381c341503"), 0, new DateTime(1988, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Echézeaux", "Rich in flavor, highly polished and concentrated, with black cherry, plum, currant, spice, and a lovely touch of oak, put together with subtlety and g race. Power with elegance.  ", 47m, 71, 0, 94, "1985", new Guid("ba3503ca-e492-4d25-867c-5139440b84ba") },
                    { new Guid("80bb23cb-711a-4fc7-8f08-ab9cde1303da"), 0, new DateTime(1990, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Corton Les Renardes", "Earthy, woody and tannic red Burgundy in a reined-in style, with a beautifu l core of rich, supple, concentrated strawberry, cherry and spice flavors. Wonderfully balanced; should age a decade with ease. Begin drinking in '92. 250 cases made.", 36m, 85, 0, 92, "1987", new Guid("260ff0ef-2b3f-4e7d-85fc-f31347c30a87") },
                    { new Guid("a676b5ed-073a-47b5-bab6-37ca855ce111"), 0, new DateTime(1988, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pommard Clos de la Platière", "Unexpectedly deep and rich, big and mouthwatering, with ripe, sweet cherry, blackberry, raspberry fruit, a distinctive cedary character from oak, all in magnificent balance. A muscular wine with grace.  ", 45m, 70, 0, 94, "1985", new Guid("260ff0ef-2b3f-4e7d-85fc-f31347c30a87") },
                    { new Guid("fcffb41f-6d51-499b-a928-4f334e988345"), 5, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Champagne Grande Année", "Rich, toasty and very assertive, high in extract and intensity with a heavy toasty flavor that compliments the pear and cherry flavors. Smoky flavors carry the finish. It's a rich style that may be to powerful for some. Drink now.  ", 30m, 68, 0, 93, "1982", new Guid("d9ba2f98-cdff-4f84-b794-0e803b65b606") },
                    { new Guid("3a1aeb57-b571-45ac-a512-fd832b3f0a36"), 1, new DateTime(1988, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Il Marzocco", "One of the greatest Italian whites ever. Rich and aromatic with apricot, nutmeg and honey on the nose, and full, concentrated fruit and a touch of oak on the palate, with moderate tannins and good extract. Has great complexity and weight.  ", 16m, 63, 0, 92, "1986", new Guid("1de96cf2-c4e2-4d7f-93e7-1758b840681c") },
                    { new Guid("2994ef2c-8395-44af-8f57-31ef195c7566"), 0, new DateTime(1988, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "St.-Estèphe", "Hard-edged St. Estephe with enough of a finish of smooth vanilla and fruit to suggest that it will be more likeable as it ages and the tough, tannic structure and tobacco-herbal flavors resolve. Has the stuff you'd expect from a classed growth.  ", 16m, 62, 0, 92, "1985", new Guid("b573aed9-fc94-4076-879e-d77d04d2956e") },
                    { new Guid("9b29d1b8-6468-4ad9-a409-2bae92ae5bbf"), 0, new DateTime(1987, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hermitage La Chapelle", "  ", 30m, 97, 0, 90, "1985", new Guid("53e321eb-0748-4c6f-8622-7959123d0d7b") },
                    { new Guid("aae11356-d168-4626-aa0b-b97432e905d3"), 0, new DateTime(1988, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Côte-Rôtie Les Jumelles", "Full throttle Côte-Rôtie with gorgeous fruit, plums, cherries and berries, soft and sikly on the palate but with a firm tannic backbone that bodes wil l for the future. A massive but elegant offering. A great bottling of Les Jumelles.  ", 35m, 61, 0, 93, "1985", new Guid("53e321eb-0748-4c6f-8622-7959123d0d7b") },
                    { new Guid("27a56af2-9925-4446-9f3d-15840f01c645"), 0, new DateTime(1988, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gevrey-Chambertin", "Firm and tannic, with concentrated raspberry, black cherry and red currant fruit, overtones of sweet oak and flowers, a many-faceted wine with mouthwa tering flavors, structure and texture. A lot of Burgundy for the price.  ", 25m, 60, 0, 93, "1985", new Guid("aff1025f-7678-4d78-b178-da7779779b32") },
                    { new Guid("1d4aa3cd-27e4-4d3e-9625-c864cac5727f"), 5, new DateTime(1988, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Champagne", "Delicate style with plenty of charm and complexity. It's very toasty and creamy with rich honey and very delicate nuances. The finish is long and smooth with plenty of complexity. At the price a relative bargain.  ", 24m, 59, 0, 93, "1982", new Guid("005dce3e-37b1-42bb-a786-ec24de6dc6aa") },
                    { new Guid("71d44ee7-e807-4665-85fe-3094acea13c1"), 1, new DateTime(1989, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay California Reserve", "Beautifully defined Chardonnay, rich, intense and concentrated with layers of pear, spice, apple and pineapple with a touch of earthiness on the finish. Drink now.  ", 28m, 85, 0, 92, "1986", new Guid("95344422-a561-4785-b43f-7553790354ad") },
                    { new Guid("48a402a2-2ad1-4605-a495-4a57e5001246"), 1, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Alexander Valley", "Well defined apple, pear and spicy flavors in a crisp, elegant, concentrated style that bodes well for drinking now or for cellaring three or more years. Smoky pear aftertaste lingers.  ", 13m, 55, 0, 93, "1986", new Guid("95344422-a561-4785-b43f-7553790354ad") },
                    { new Guid("f074fe0d-1a95-4ef7-a86f-cfcddf5c4c4b"), 0, new DateTime(1988, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Napa Valley", "Broad, rich and deep with layers of black cherry, mint and cassis flavors and a toasty, cedary overlay. Very nicely integrated, ample tannins that are firm but not rough, and a long full finish. Give this one at least five years. Best Opus One to date. 10,000 cases made.", 50m, 53, 0, 94, "1984", new Guid("e085377b-4ac4-470b-8e64-36792a17bd0a") },
                    { new Guid("6a9f5a9b-384f-440d-9399-72b6f6e83feb"), 0, new DateTime(1990, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nuits-St.-Georges Les Vignes Rondes", "Immediately attractive, with opulent cherry and plum flavors framed by sweet, toasty oak. The flavors unfold with complexity on the long finish. Intense and concentrated, but elegant enough to keep you coming back for another sip. Drink now through 1995. 300 cases made.", 35m, 7, 0, 95, "1987", new Guid("412ffdf0-4aa3-484c-bd89-7303ac8bb48b") },
                    { new Guid("50fbff9c-3f44-4415-afb0-e47e9befb966"), 0, new DateTime(1989, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vosne-Romanée Les Chaumes", "Generous and sweet on the nose, rich and velvety on the palate, bristling with chocolate, vanilla and cherry flavors, harmonious, elegant and long. Should develop at least through 1993. One of the few '86 red Burgundies worth time in your cellar.  ", 47m, 67, 0, 93, "1986", new Guid("412ffdf0-4aa3-484c-bd89-7303ac8bb48b") },
                    { new Guid("340edd6f-6ec1-4695-aa34-b42de8289606"), 0, new DateTime(1988, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vosne-Romanée Les Beaux-Monts", "Tightly focused and concentrated, sending a current of flavor right down th pepper and vanilla, elegant and firm, gaining complexity on the finish. Even at the price, it s a deal.  ", 55m, 49, 0, 95, "1985", new Guid("412ffdf0-4aa3-484c-bd89-7303ac8bb48b") },
                    { new Guid("fe49b55b-1362-4479-b772-cd3445a014b7"), 0, new DateTime(1989, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Napa Valley Reserve", "Remarkably complex with toasty oak, fresh cherry, leather and spicy flavors that are rich and elegant, displaying uncommon complexity, depth and finesse. The spicy cinnamon finish lingers on and on. Best Mondavi Pinot yet.  ", 31m, 74, 0, 92, "1985", new Guid("4dc4fee9-6e71-4cba-b0a1-0cb815b5ccb9") },
                    { new Guid("c757ce7e-2b14-4de9-85d2-f12ba6512a20"), 0, new DateTime(1989, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Reserve", "Firm, intense and lively, with rich, elegant and concentrated plum, currant and spice flavors. A remarkably complex and tasty wine. Released at the same time as the '85 Reserve. Best after 1992.  ", 35m, 23, 0, 95, "1986", new Guid("4dc4fee9-6e71-4cba-b0a1-0cb815b5ccb9") },
                    { new Guid("f3bedd42-de1b-44da-ac48-79692dfc1237"), 0, new DateTime(1988, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clos de Vougeot", "Intense of flavor but delicate of structure, offering cranberry, violet, ci nnamon and caramel aromas and flavors folded neatly into a lean package tha t just seems to keep expanding on the finish. Defines finesse and elegance.  ", 49m, 43, 0, 96, "1985", new Guid("ccbe79b3-89b3-4e34-a6b7-1b4314c511f9") },
                    { new Guid("71ccd90b-5c79-4501-94b6-9d9fd68a0c1a"), 0, new DateTime(1988, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maurizio Zanella", "Smooth and supple, with rich berry, cherry and smoky flavors, velvety and expansive on the palate, yet elegant and balanced with acidity. Blends the best of Sangiovese and Cabernet, plus a nice touch of oak, and it feels like it can only get better. Drink now through 1992.  ", 38m, 40, 0, 92, "1985", new Guid("8ee85914-57f0-4ecd-afb8-06009d9e0f36") },
                    { new Guid("39ffdd13-1903-4e12-a049-dff1cbc2aa4a"), 0, new DateTime(1988, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lebanon", "An intriguing wine with great complexity. Leathery and smoky aromas and mature, ripe fruit flavors of spice and plum. The color and aromas seem mature but it is still tart and somewhat tannic and should age graciously.  ", 17m, 39, 0, 91, "1980", new Guid("7ccd5908-69d3-4525-9e48-269b2650ee03") },
                    { new Guid("c19990f9-c1ec-41ac-baeb-434d0922178a"), 0, new DateTime(1988, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Graves", "Firm and concentrated with flavors that spread out on the palate. It's rich and woody, very structured and firm, packed with cassis and black cherry fruit and cedary tobacco. Offers an abundance of flavors in an elegant package. One of the finest Haut-Brions we've tasted.  ", 70m, 36, 0, 96, "1985", new Guid("3710c692-e31f-4c71-8040-0c994ea6eac7") },
                    { new Guid("17dfe1d5-1772-4341-8cb3-be6cb7085d65"), 0, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vosne-Romanée Au Cros Parantoux", "A powerful Burgundy with a raw edge that needs cellaring to smooth the bristly texture, but it has gorgeous cherry, spice and chocolate-toast flavors that become deeper and deeper with every sip. Drink now through 2000.  ", 63m, 17, 0, 95, "1987", new Guid("bcfebc42-ff72-4464-8bb9-bd8390f1ed5d") },
                    { new Guid("7cb94621-edf0-4e5e-b4fe-c5957517b72e"), 0, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vosne-Romanée Aux Brûlées", "Stunningly beautiful berry and spice aromas and flavors capture your attention from the first sniff right through to the velvety finish, growing richer and more elegant with every sip. Has a bit of tannin to lose on the finish, so cellaring until 1994 is indicated. Delicious already.  ", 63m, 16, 0, 95, "1987", new Guid("bcfebc42-ff72-4464-8bb9-bd8390f1ed5d") },
                    { new Guid("619b6ae0-8c5c-4b94-9cd0-60c34034d331"), 0, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Sonoma County", "A luscious Cabernet, supple and silky, elegant and stylish, loaded with str awberry, cherry and spicy plum flavors, supple tannins that are tightly reigned in. Graceful and attractive. Long full finish. Drink now, but it should only get better.  ", 19m, 32, 0, 94, "1985", new Guid("af626019-62e3-4524-823b-f643eca84e93") },
                    { new Guid("22ea9eab-a0c6-489b-95b1-6020485ebe82"), 0, new DateTime(1988, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Sonoma Valley Olive Hill Vineyard", "Gorgeous fruit, rich, supple, satiny with beautiful structure, amazing intensity and depth, rich cassis, butter, toasty oak and spicy flavors, plenty of tannin, but impeccibly balanced. Distinct and exciting. Drink 1994 to 2000.  ", 16m, 31, 0, 94, "1985", new Guid("4f7caecb-b29b-42a4-abc6-3545b824f72f") },
                    { new Guid("11f2c4ba-113f-4261-b21e-4c638267a620"), 0, new DateTime(1988, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Châteauneuf-du-Pape Réservé", "Deliciously rich, ripe and jammy with effusively ripe plum, cherry and raspberry fruit that's soft, smooth and silky. Opulent style, crisp acidity and enough tannin for a decade or more. A real mouthful of wine from a great producer. Drink now through 2000.  ", 41m, 73, 0, 93, "1985", new Guid("17f25485-0600-4d91-b547-4ddce58bbb9d") },
                    { new Guid("e2fefbba-d165-4114-8fbb-8762cfecb53f"), 0, new DateTime(1988, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Palms Vineyard Napa Valley", "Loaded with fruit and concentrated flavors that are rich and tannins, filled with pretty currant, black cherry and plum flavors, along with buttery oak that offers depth and dimension. Has tannin for aging. Drink 1993.  ", 22m, 76, 0, 93, "1985", new Guid("cba2c970-34ee-4ce3-8120-4fa597899ef5") },
                    { new Guid("01bba64e-08c0-41c5-af6a-2336cd2336aa"), 0, new DateTime(1989, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Reserve Napa Valley", "Textbook Cabernet aromas and flavors packed into a firm, elegant package, powerful, smooth and supple, finely focused, glowing with plum, cherry and cassis flavors, extremely long. Drink now.  ", 42m, 14, 0, 96, "1985", new Guid("cba2c970-34ee-4ce3-8120-4fa597899ef5") },
                    { new Guid("9916b262-b16d-437f-b158-2df0fc8d93da"), 1, new DateTime(1988, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bâtard-Montrachet", "Rich and lushly layered, with cascading flavors of pear, buttery, vanilla a nd more, concentrated, powerful, yet elegant and smooth. Absolutely delicio us now, but given time in the cellar it should be devastating.  ", 93m, 77, 0, 95, "1986", new Guid("58592aae-97fd-4a78-aca9-dc249f7c0246") },
                    { new Guid("fb35ba99-24f8-4e07-a89e-5edb0f5c2c7c"), 0, new DateTime(1989, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Carneros Fleur de Carneros", "An elegant, precisely balanced wine for current drinking. Beautifully aromatic with spicy plum, cranberry and toast flavors and uncommon intensity. Has finesse and subtlety, finishing with spicy cinnamon and flavor complexities that linger on the finish.  ", 9m, 29, 0, 92, "1987", new Guid("60f40469-7b0d-407b-9721-b772501b02f7") },
                    { new Guid("4b10c032-4bc1-4cfb-9a7f-fb24e3e1b857"), 0, new DateTime(1989, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Hunter Valley", "Concentrated and generous, a classically-structured wine with beautiful spice-tinged cassis and cherry aromas and flavors, supple texture, powerful and elegant at the same time. A terrific Cabernet at a reasonable price. Drink Now-1997.  ", 11m, 48, 0, 93, "1986", new Guid("70c2a6cc-945a-40c7-8a3c-44e1ee50144c") },
                    { new Guid("120cdd77-0538-44da-900f-50b8a32b7ed4"), 0, new DateTime(1989, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shiraz Hunter Valley", "Amazingly rich and complex already, and it's just a baby. Firm, fine tannins support a classic structure and a panoply of aromas and flavors. Built around a solid core of plum fruit, it also hints at cedar, leather, cinnamon and sandalwood. Almost drinkable now, but best 1994 to 1998.  ", 9m, 28, 0, 92, "1986", new Guid("70c2a6cc-945a-40c7-8a3c-44e1ee50144c") },
                    { new Guid("2c0e586d-ac15-4744-95a2-954e89b1d5ab"), 0, new DateTime(1989, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Sonoma Mountain Counterpoint", "Deeply colored and aromatically pleasing. Young, ripe and concentrated with layers of cedar, currant, spice and cherry that linger on the finish. Drink now to 2000.  ", 13m, 24, 0, 94, "1987", new Guid("120afd52-fbad-46a5-a2aa-ece97801f425") },
                    { new Guid("0223670c-29db-4154-aa42-286b85ccf6f5"), 0, new DateTime(1989, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Sonoma Valley Artist Series", "Rich and concentrated, with plenty of elegance and finesse to the currant, plum and tobacco flavors, which are long and harmonious on the finish. The tannins are present without being overwhelming. Drinkable now and well into the 21st century. 4,000 cases made.", 30m, 21, 0, 95, "1986", new Guid("2645e21f-c203-4805-a7d4-824ee330c615") },
                    { new Guid("7ac00067-dccf-426c-bae3-1ef55e42343d"), 4, new DateTime(1989, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tawny Port Australia Old Trafford", "Sensationally complex and rich, a dessert in a glass with sweet flavors of caramel, coffee and many spices, extraordinarily long and dynamic. It just stays with you forever.  ", 15m, 15, 0, 95, "NV", new Guid("993e4794-07bd-4bbd-83f4-30a1a3b0581f") },
                    { new Guid("c8aacdbe-fcd6-4845-b513-d981ccb657f4"), 0, new DateTime(1989, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Vineyard Selection 82", "Incredibly intense and concentrated, with tart black cherry, currant, spice and cedar flavors that are sharply focused and framed by firm tannins and toasty oak. Drink now through 1996. 1,540 cases made.", 25m, 13, 0, 95, "1986", new Guid("cfd542a1-1e82-45ba-a7dc-a35b3041ec14") },
                    { new Guid("3f408a1c-647e-4f74-a6b0-f7d61f3a2afa"), 0, new DateTime(1989, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Martha's Vineyard", "A beautiful wine, one of the great Martha's ever, rich, elegant, loaded with refreshing black cherry, mint, and chocolate flavors that are the hallmark of Martha's Vineyard. Smooth and supple yet with the stuffing and tannins for long aging. 4,421 cases made.", 40m, 3, 0, 97, "1984", new Guid("240fbd6a-943c-465d-9413-6ce24cdebb06") },
                    { new Guid("9a925d3b-1aa2-4e54-ab03-eb67eaf8139e"), 5, new DateTime(1988, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Champagne Cuvée Dom Pérignon", "Defines the richness and elegance of Champagne, delicate and concentrated w ith spicy pear, toasty vanilla, subtle and fine with a touch of hazelnut on the finish.  ", 150m, 100, 0, 93, "1982", new Guid("518c9fc7-3f0e-4663-9e22-16ae73d9b65d") },
                    { new Guid("d3addbb0-9bb9-4426-bcf7-193a64800b53"), 0, new DateTime(1988, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Santa Barbara County Reserve", "Very toasty and spicy, yet smooth as silk on the palate. Aromas and flavors of cinnamon, strawberry and raspberry are nicely supported by the right frame of oak. Superb balance.  ", 15m, 99, 0, 91, "1986", new Guid("f4fa4108-4731-431b-845d-240fcaa9003e") },
                    { new Guid("f9b96bc4-c123-4a51-94b5-68e5d7f409f4"), 0, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Private Reserve", "Enormously deep, rich and concentrated with layers of currant, cherry, plum, coffee and spice notes set off by toasty oak. A remarkably complex wine that echoes fruit flavors on the finish. Drink now. 8,000 cases made.", 57m, 22, 0, 95, "1985", new Guid("85de23cd-e829-4dd7-8223-6bfe28323b82") },
                    { new Guid("42574365-86a0-4eef-ba7d-a076aff95f0d"), 1, new DateTime(1988, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Napa Valley Private Reserve", "Firm and concentrated, a tightly wound wine with toasty aromas and ripe but reined-in flavors of pear and butterscotch. Silky texture, beautifully foc used and long. Shows a great deal of subtlety and plenty of room to grow.  ", 16m, 96, 0, 91, "1986", new Guid("85de23cd-e829-4dd7-8223-6bfe28323b82") },
                    { new Guid("9900c7b5-33f6-4406-8b72-70019ba8e6ce"), 4, new DateTime(1989, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gewürztraminer Anderson Valley Late Harvest Vineyard Selection", "Very ripe and honeyed, with rich apricot, honey and slightly floral flavors that are smooth and carefully balanced. Shows restraint, but is plenty tasty. Give it some time to open up.  ", 19m, 56, 0, 93, "1986", new Guid("1fbfde0f-f761-402a-8e78-0fc34aaffb2c") },
                    { new Guid("87229ce5-894a-4e35-b3f9-9ae1dc54604d"), 1, new DateTime(1988, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Riesling Anderson Valley", "A bit sweet, firmly balanced with crisp acidity, packed with juicy grapefruit and green apple flavors. There's a lovely hint of apricot on the nose. Very fine structure, vivid flavors and impressive length.  ", 7m, 91, 0, 90, "1987", new Guid("1fbfde0f-f761-402a-8e78-0fc34aaffb2c") },
                    { new Guid("100738a7-297f-4dd7-88fd-84d3c66108fe"), 0, new DateTime(1989, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cask 23 Napa Valley", "A big, powerful, distinctive wine that balances its intense currant and cherry flavor against an onslaught of earthy, tobacco aromas and flavors. It will not appeal to everyone. Enormously complex, deep and long, this is a wine whose flavors should keep developing. Best from 1995 through 2000. 1,018 cases made.", 75m, 40, 0, 96, "1985", new Guid("bed3eaf1-0683-4f5a-bb86-a807f8cfc9fb") },
                    { new Guid("caa3d8bd-4a2b-474f-9295-b6673ec9da65"), 0, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Carneros", "Distinct for its richness and complexity, the tart cherry, currant and berry flavors are young and lively but quite enticing. Has smoke, vanilla and chocolate flavors on the finish. Tempting now but capable of aging. Best now through 1998. 9,865 cases made.", 11m, 88, 0, 91, "1986", new Guid("01673cee-5e3c-4aae-8405-28ea1b2be784") },
                    { new Guid("c741d306-c15f-4fd0-80c1-5df62d3f993a"), 1, new DateTime(1988, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Lake County", "Juicy, ripe, fruity and complex, distinctive, with very pretty grapefruit, melon, apple, and herb flavors. Soft, delicate and broad in structure, this is the second great Sauvignon Blanc in a row from this winery.  ", 7m, 90, 0, 90, "1987", new Guid("01673cee-5e3c-4aae-8405-28ea1b2be784") },
                    { new Guid("4b9e1d36-8b17-4efa-93bc-830ff1f060f1"), 1, new DateTime(1988, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gewürztraminer Anderson Valley", "Nearly identical to a fine Alsace Gewürz. Lovely rose petal and grapefruit aromas, with crisp, concentrated flavors of apple and grapefruit.  ", 7m, 89, 0, 90, "1987", new Guid("2862407d-6221-4e4a-b3bb-b7f869396fc0") },
                    { new Guid("08c5459d-0cc0-45ab-8eae-0e0da31d0347"), 0, new DateTime(1988, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Franc North Coast", "Rich, lush and elegant with ripe fruit, spicy, concentrated raspberry, cherry, herb and chocolate flavors that spread out on the palate. Impeccibly well balanced, seducitive now, but it should only get better.  ", 14m, 87, 0, 92, "1986", new Guid("d3ff89ff-1231-4e0d-9c8a-20412d338ffc") },
                    { new Guid("1ce920ae-9e75-4a6b-8409-1a854424ee48"), 0, new DateTime(1988, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Carneros", "Distinct and well proportioned, rich and tasty with ripe strawberry, cherry, spice and oaky flavors that add up to complexity and dimension. The flavors stay with you from start to finish. Has enough tannin for three to five years in the cellar.  ", 14m, 86, 0, 92, "1986", new Guid("6bf5ae43-d14e-4c96-8b1a-3e984f2c4640") },
                    { new Guid("fd4f97e4-2ef3-494d-8d5e-c8c86067783b"), 1, new DateTime(1990, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Napa Valley", "Hard to imagine a better California Sauvignon Blanc. Rich, intense and loaded with rip fig, lemon, herb, and spice flavors, it has a very enticing, fine structure with lively flavors that build to the finish and carry on. Best from 1990 through 1992. 15,500 cases made.", 8m, 88, 0, 90, "1988", new Guid("38eabb64-763b-459d-9cf6-2bbc44ce45ff") },
                    { new Guid("c7b689c8-45de-420c-953d-2ae5aa8df170"), 0, new DateTime(1990, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Stags Leap District", "Big and firm, with plenty of generous raspberry and plum aromas and flavors, opening up beautifully on the palate to a long finish. The tannins are tough enough to indicate cellaring until 1993 or '94. A harmonious wine that just needs time. 1,941 cases made.", 14m, 36, 0, 92, "1987", new Guid("38eabb64-763b-459d-9cf6-2bbc44ce45ff") },
                    { new Guid("6834cdce-1b73-4644-8ddb-bbfd5002e0e7"), 0, new DateTime(1990, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley Limited Reserve", "The first reserve from Silverado is a classic for the cellar. Plush and generous aromas, with rich and sharply focused flavors, and delicious cherry, plum, currant, oak and spice notes stay with you from start to finish. Tight and concentrated, with supple texture and firm tannins. Best from 1996 through 2005. 1,400 cases made.", 35m, 15, 0, 96, "1986", new Guid("38eabb64-763b-459d-9cf6-2bbc44ce45ff") },
                    { new Guid("eb9f5432-88e9-4c7f-988e-b6e3730b6564"), 1, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gewürztraminer Alsace", "A serious but eminently likeable Gewürz. Has clearly defined, concentrated peach, spice and grapefruit flavors backed by good acidity. Fruity, round in the mouth and well-balanced. Honey and more fruit come through on the finish.  ", 11m, 84, 0, 91, "1985", new Guid("1e0bfc97-4abe-492b-8bcf-4d399aa9fd15") },
                    { new Guid("34a99e98-0df9-45c1-82ee-e3f2f8858a87"), 0, new DateTime(1988, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah-Sirah Dry Creek Valley", "Bursting with fresh, lively fruit. Lots of black cherry, blackberry and raspberry flavors in spades, It's fleshy and jammy with enough tannin and acidity to clean off your palate.  ", 10m, 82, 0, 91, "1985", new Guid("7523c184-8b3c-4d5d-8fe2-b4598d7aa64a") },
                    { new Guid("0b47c971-8e24-4679-bb23-d82bed289e45"), 0, new DateTime(1988, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Napa Valley Reserve", "Deep in color and fairly tannic with deep berry fruit and oaky aromas. On the palate it's concentrated with rich, elegant, black cherry flavors. Has intensity but it's not overblown.  ", 14m, 83, 0, 91, "1985", new Guid("dc75bd26-e80a-46f8-b017-52ca1df4990a") },
                    { new Guid("94614ee7-c6fd-4bd0-a14c-a99042d2afe8"), 1, new DateTime(1988, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gravion Napa Valley", "Vivid and stylish, with crisp structure and sharply defined aromas and flavors. Full-bodied, with delicious oak, vanilla, orange peel and lemon flavors that are well-intergrated and deep; long, spicy finish. Sémillon and Sauvignon Blanc.  ", 9m, 81, 0, 91, "1986", new Guid("dc75bd26-e80a-46f8-b017-52ca1df4990a") },
                    { new Guid("ca6ab14f-abaa-4bb4-92f8-b609f8342b9a"), 1, new DateTime(1988, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Marlborough", "Full of sweet-seeming honey, butter and vanilla flavors with a hint of nutm eg and pineapple. A forward, gorgeous wine that's nicely oily in texture, w ell structured with acid and lasts a long time on the finish.  ", 10m, 80, 0, 92, "1986", new Guid("8929ec53-fb3a-4112-9658-112237f5bb10") },
                    { new Guid("21d03c52-79a6-48b8-bfc5-82d0ccc921eb"), 0, new DateTime(1989, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Dry Creek Valley", "Marvelously concentrated, with cassis and cherry aromas and flavors framed by toasty vanilla overtones that make it harmonious and balanced. Should develop through 2000, but worth trying now. Great price, too. 1,100 cases made.", 9m, 68, 0, 91, "1986", new Guid("685f6b6f-be85-45f8-b89b-19b2f2ace917") },
                    { new Guid("654b49d1-6afe-4f61-a6b6-7a854a6214f5"), 0, new DateTime(1988, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Dry Creek Valley", "Very firm and concentrated and focused, amazingly layered with blackberry, cassis and plum fruit, cedary overtones from spicy oak and a bracing touch of acidity and tannin to wrap it up and keep it from showing everything it has for 2-3 years.  ", 7m, 78, 0, 91, "1986", new Guid("685f6b6f-be85-45f8-b89b-19b2f2ace917") },
                    { new Guid("e70de174-438c-42c9-88a7-a64cf34aca53"), 0, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Carneros Private Reserve", "Intense yet elegant with firm tannins and lively ripe currant, black cherry and cranberry flavors that are tart and sharply focused. Finishes with a mouthful of berries. Drink now to 2002. 2,900 cases made.", 18m, 33, 0, 94, "1985", new Guid("01673cee-5e3c-4aae-8405-28ea1b2be784") },
                    { new Guid("4d061270-abed-46c7-b433-e5226298274c"), 1, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Alsace Grand Cru Kitterlé", "  ", 14m, 99, 0, 90, "1988", new Guid("724c5551-f435-4140-ac3f-0c3d13791998") },
                    { new Guid("29db7273-1817-468a-ab9e-cffd234e749d"), 0, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barolo", "A floral-, cherry- and berry-laced version, delicate and lively, with mineral and spice accents. The texture is supple, with a glycerol feel. Borders on racy, with woodsy and mineral notes emerging on the pleasantly long finish. Best from 2017 through 2035. 1,250 cases made.", 138m, 50, 0, 97, "2010", new Guid("3f1100b4-6a47-4321-84ce-97b24899be96") },
                    { new Guid("7a162e8b-c025-421d-a0e0-2e8c3366cd27"), 1, new DateTime(2015, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Central Coast", "Clean, pure and juicy, offering a refreshing mix of ripe pear, apple and melon flavors, shaded by a chalky minerality and followed by a long lingering finish. Drink now. 13,929 cases made.", 20m, 48, 0, 90, "2013", new Guid("8570a3a6-49b2-4320-9d8e-70ce74a1e956") },
                    { new Guid("5456e7bc-fdd0-464f-9169-0e11f507a402"), 0, new DateTime(2017, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Willamette Valley", "Supple and elegantly structured, with expressive raspberry and orange zest aromas and polished flavors that pick up depth and momentum toward a spicy finish framed by refined tannins. Drink now through 2023. 4,000 cases made.", 45m, 75, 0, 93, "2015", new Guid("b316cb0b-8477-4683-afe4-3e5c9eacd9f6") },
                    { new Guid("8eda9ee8-64b3-4239-9137-b6246f348169"), 1, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Châteauneuf-du-Pape White", "This is dreamy, with creamed melon, pear and green fig flavors gliding along, framed by light brioche and meringue notes. The long finish lets the fruit hang beautifully. Offers refined opulence. Drink now through 2022. 800 cases made.", 50m, 74, 0, 95, "2016", new Guid("c4285b81-b1dd-4482-a9bb-274843dec86b") },
                    { new Guid("5f127d98-7bb4-4f8e-8dcf-caef939588ad"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riverside Barossa", "A supple, seamless mix of cherry and raspberry flavors, with dried violet, savory and smoky details, accented by hints of sarsaparilla. Polished and refined, especially on the effortless finish. Grenache, Mataro and Shiraz. Drink now through 2030. 2,000 cases made.", 20m, 73, 0, 93, "2015", new Guid("69a721cb-8706-4629-9142-896c1f5d875e") },
                    { new Guid("5222e519-fac1-448d-9d2b-bd4c5524cdba"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Corse", "Lightly rustic, with bramble and dried anise notes weaving throughout. The core of violet plum sauce and raspberry coulis is pure and vibrant, extending through a lengthy finish. A fun, character-filled wine. Niellucciu, Syrah and Grenache. Drink now through 2019. 6,500 cases made.", 20m, 72, 0, 90, "2015", new Guid("921f2c92-22bc-42b9-9742-69e050ace058") },
                    { new Guid("b03ba8af-d174-43d8-9668-89e31f11152c"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aglianico Irpinia", "This is elegant and well-meshed, with fine tannins and a fragrant skein of ground spice layered with flavors of baked black currant, herbes de Provence, smoke and fig cake. The fresh finish is chewy and lingering. Drink now through 2022. 2,083 cases made.", 18m, 71, 0, 90, "2015", new Guid("ca2b2920-5ea9-4a48-9626-a48063482b3c") },
                    { new Guid("94ef6e9c-69a4-40d9-99c8-4995415e192f"), 0, new DateTime(2017, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Eola-Amity Hills Tongue 'N Cheek", "Lithe and delicately complex, offering rose petal and tart blueberry aromas, with effortlessly balanced raspberry, river rock and spice flavors that finish with refined tannins. Drink now through 2022. 594 cases made.", 60m, 70, 0, 94, "2015", new Guid("c7c9e55b-9561-46bb-9fb7-155d7ecf5f10") },
                    { new Guid("27776b01-22f2-4fba-bd66-309c1932ef08"), 1, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Soave Classico", "A lithe, light-bodied white, with racy acidity and a subtle streak of mineral, layered with nectarine, melon and pink grapefruit pith flavors. This is well-knit, with a lingering, lightly spiced finish. Drink now through 2020. 9,000 cases made.", 21m, 69, 0, 90, "2016", new Guid("436138b7-f923-43bd-a074-7c5b4f475860") },
                    { new Guid("7db36e73-fea7-49cc-a18d-74d36934f77f"), 0, new DateTime(2017, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zachary's Ladder Red Mountain", "Rich yet densely structured, with expressive black cherry and blueberry fruit, accented by smoky licorice and finishing with big but refined tannins. Cabernet Sauvignon, Syrah and Petit Verdot. Best from 2019 through 2025. 600 cases made.", 30m, 68, 0, 92, "2014", new Guid("a627a447-4991-4a96-b6da-3db061fb7577") },
                    { new Guid("e1f62188-d672-42ec-a143-25b25311ada5"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Russian River Valley Dutton Ranch", "Ultrarich and extracted, offering a firm core of pear, apple, melon and spice flavors. A truly impressive effort, with depth and dimension. Drink now through 2022. 7,000 cases made.", 32m, 67, 0, 91, "2015", new Guid("6226fdd0-bf91-499c-be25-19e780b6dfbf") },
                    { new Guid("a25c9d97-9328-4aa9-802a-07947ec2aab1"), 0, new DateTime(2017, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Montefalco Sagrantino", "This finely balanced Sagrantino layers creamy tannins with a pretty array of raspberry ganache, fig cake and dried sage flavors, accented by aromatic hints of rose petal and spice. Elegant and lightly juicy, with a subtle mineral streak that gains momentum on the finish. Drink now through 2027. 4,000 cases made.", 40m, 66, 0, 92, "2011", new Guid("195ac02a-8209-45da-bb83-de2f3556bd8a") },
                    { new Guid("37c81a68-9fd9-40ff-a57a-e1aeb5917637"), 0, new DateTime(2017, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Marlborough", "Detailed, with notes of dried lavender, white pepper, fresh loamy earth and black tea set against a core of strawberry and raspberry flavors. Smooth and plush, this becomes even more expressive on the finish, where spice details fan out. Drink now through 2025. 750 cases imported.", 39m, 65, 0, 93, "2014", new Guid("dad79daa-a63f-4643-8846-ecef4a6e65be") },
                    { new Guid("e1133b95-c385-491b-960f-461863b73643"), 0, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cornas Terres Brûlées", "Plush in feel, with layers of dark fig, blueberry and blackberry reduction leading the way, inlaid with light charcoal and bay leaf accents that emerge steadily through the finish. Ends with a tug of tar. Best from 2020 through 2035. 1,300 cases made.", 58m, 64, 0, 94, "2015", new Guid("5ed8c018-d84b-48bc-a5b3-a3037a96970e") },
                    { new Guid("f5077602-9541-47a3-99a4-0fb6b7c0c2bf"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Dundee Hills Latchkey Vineyard", "Silky and harmonious, with an elegantly precise structure and black cherry, fresh violet and spice notes that glide expressively toward the long finish. Drink now through 2022. 600 cases made.", 50m, 63, 0, 94, "2015", new Guid("32f29281-5ddd-4109-b976-d0031732fe60") },
                    { new Guid("52d3c20f-3499-4bee-b631-9193ea30c1e1"), 0, new DateTime(2017, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco Ovello", "This pretty red offers delicate flavors and subtle power, evoking flowers, red berry, mineral, tobacco and tar on the nose and palate. Firmly structured, this remains harmonious and long on the mineral- and tobacco-tinged finish.  Best from 2020 through 2036. 500 cases made.", 62m, 61, 0, 97, "2013", new Guid("068c1763-1446-4cb5-920b-7a12d5264f53") },
                    { new Guid("634eee6d-d73d-4a53-88fb-d03e6a733dcd"), 0, new DateTime(2017, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lisboa Colossal Reserva", "Plum and boysenberry notes weave together with dried herb and smoky mineral accents in this sleek red. Savory spice details chime in on the finish. Offers moderate, grippy tannins. Drink now through 2020. 55,000 cases made.", 25m, 60, 0, 90, "2015", new Guid("8c430fd5-df60-4d8e-b49b-db230ae68ef1") },
                    { new Guid("a590842d-a175-49a7-a013-37b3aed1eb6d"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tempranillo Ribera del Duero", "Black cherry, red plum and currant flavors are fresh and lively in this firm red, backed by dark chocolate, licorice and toasty notes. Light, firm tannins and citrusy acidity keep this focused. Drink now through 2023. 58,333 cases made.", 24m, 59, 0, 90, "2015", new Guid("ea4a14c0-e51c-48dc-aaec-97bfa846d6fb") },
                    { new Guid("b69be3ec-063e-4752-8dbf-63ddeeb0e349"), 1, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Napa Valley Yount Mill Vineyard", "Clean, smooth and crisp, offering a lip-smacking mix of pear, melon and Key lime flavors, with plenty of intensity on the finish. Drink now. 4,900 cases made.", 19m, 57, 0, 90, "2016", new Guid("b23453ad-fa4d-4375-a8cd-9f11d86dfb81") },
                    { new Guid("bbc36cc3-444a-471a-bf3c-1338a7a4dd18"), 0, new DateTime(2017, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Morgon La Chanaise", "This ripe, light- to medium-bodied red sports layers of pure blackberry, cassis and damson plum, edged with licorice, floral and apricot details. Tangy, mouthwatering acidity highlights the mineral and spice details on the long, lightly grippy finish. Drink now through 2020. 13,000 cases made.", 20m, 56, 0, 91, "2015", new Guid("04d49177-c085-4596-81d3-69cfa990b5d4") },
                    { new Guid("7cc33a97-1435-4508-ad51-68b96de792c5"), 1, new DateTime(1989, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Alsace Cuvée Frédéric Émile", "  ", 15m, 79, 0, 91, "1988", new Guid("5b60b01a-2b01-491c-9bf9-8a11028abaa0") },
                    { new Guid("759c6181-9046-4792-9400-0d4bd91c14f3"), 1, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Alsace", "The piercing acidity and pronounced minerality weave a fine tapestry in this lovely Riesling, supporting flavors of white peach, slivered almond, lemon confit and oyster shell with a long, mouthwatering finish. Drink now through 2024. 6,000 cases imported.", 25m, 49, 0, 91, "2012", new Guid("5b60b01a-2b01-491c-9bf9-8a11028abaa0") },
                    { new Guid("a854edd0-0000-41cb-b887-f45e02858c09"), 1, new DateTime(2017, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Gris Alsace Réserve Personnelle", "A mouthwatering Pinot Gris, with exotic notes of papaya and grated coconut accenting the peach, anise and almond blossom flavors. Sleek acidity focuses this through to the spicy, mineral-tinged finish. Drink now through 2029. 1,500 cases imported.", 38m, 55, 0, 92, "2015", new Guid("5b60b01a-2b01-491c-9bf9-8a11028abaa0") },
                    { new Guid("69d46810-2ec7-4c8a-9340-425bddb9878c"), 0, new DateTime(2017, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Yarra Valley", "Plush and elegant, with raspberry, cherry and fresh sage notes that are harmonious, juicy and intense on the finish. Drink now through 2027. 1,900 cases imported.", 20m, 54, 0, 90, "2016", new Guid("db6093db-be79-49a4-9ffe-105e43e854d6") },
                    { new Guid("6349fadc-d268-4fc7-930b-260773142ec0"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Napa Valley", "Polished and impeccably structured, with blackberry and smoky meat aromas and layered, rich flavors of licorice and espresso that linger toward big but firm tannins. Drink now through 2027. 1,124 cases made.", 60m, 53, 0, 94, "2014", new Guid("90642efd-9dde-4b67-8954-2f8f8c31c2b8") },
                    { new Guid("a84e2463-7602-4dd4-935e-132ec5c8fcc9"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Côtes du Rhône-Villages Séguret Tradition", "A good bolt of graphite drives underneath while lightly mulled plum and blackberry fruit form the core. Singed mesquite and tobacco fill in on the finish. Grenache, Syrah and Carignan. Drink now through 2020. 3,500 cases made.", 20m, 52, 0, 90, "2014", new Guid("2e8cca64-8c56-40eb-a7cb-40bac4a2595d") },
                    { new Guid("de5aab39-9455-438d-9b34-07e474da084f"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mencía Bierzo Ultreia St.-Jacques", "Smoke, forest floor and mineral notes mingle in this savory red. Lively acidity and light, firm tannins give grip to the polished texture. Cherry and floral accents sing through the finish. Energetic. Drink now through 2023. 1,200 cases imported.", 20m, 51, 0, 91, "2015", new Guid("bde4a975-bb42-4a39-a359-a74459aae2d5") },
                    { new Guid("7c0a9995-9a15-40d9-8c57-d2b9e488a7ec"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Touriga Nacional Douro", "Supple but tightly knit, this focused red offers blackberry and currant fruit woven together with black olive, anise and grilled herb accents. Black tea and mineral notes chime in on the firm finish. Drink now through 2022. 7,500 cases made.", 22m, 50, 0, 90, "2014", new Guid("a047cf7d-fbe8-4295-a9e1-b58188dddf76") },
                    { new Guid("9a91588d-397a-4a20-b66f-90dc13b7cb99"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Stellenbosch", "This is well-rendered, with a core of bramble-edged boysenberry, blackberry and raspberry fruit laced with mouthwatering savory and anise notes. Shows judicious toast through the finish, as roasted apple wood details dance through, letting the fruit win out in the end. Drink now through 2024. 3,540 cases made.", 29m, 49, 0, 92, "2014", new Guid("c98e90db-fe32-4e0e-a8a4-c4652265cf87") },
                    { new Guid("44c150f9-dcc5-40af-aecc-7eb739b7543f"), 0, new DateTime(2017, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Coonawarra Phoenix", "Dense tannins and flavors are packed into this wine, with briny Kalamata olive and black licorice nuances to the core of plum, cassis, sage, tobacco and cedar flavors, which fan out on the finish. Drink now through 2030. 4,300 cases imported.", 20m, 48, 0, 90, "2015", new Guid("322b8687-9094-488c-944c-f2e4e8b39862") },
                    { new Guid("a3742f05-50a3-4a98-b5d6-0114ab8f600a"), 0, new DateTime(2016, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja La Montesa Crianza", "A thick texture carries plum tart, orange peel, toasted vanilla and anise flavors in this ripe version, balanced by juicy acidity. The spicy, berry-scented finish is long and pure. Drink now through 2023. 10,800 cases imported.", 20m, 52, 0, 91, "2013", new Guid("60450967-0c81-4739-868b-630f723a5840") },
                    { new Guid("4718765b-0f0f-4816-87c1-6f556539ee3f"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Condrieu Pagus Luminis", "This has power, with a large core of creamed peach, nectarine and yellow apple fruit. Lengthy, pure and vibrant, with a mineral streak running underneath and chamomile and honeysuckle notes gilding the finish. Dreamy wine. Drink now through 2022. 1,200 cases made.", 69m, 76, 0, 96, "2015", new Guid("74186bd8-c2af-4f5b-a5f5-8b05af015430") },
                    { new Guid("563015dc-c6b5-44e8-a71f-def248b7b0e0"), 0, new DateTime(2017, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja La Vendimia", "This red shows good density, with black cherry, plum, espresso and black olive flavors mingling over firm tannins and balsamic acidity. Stays balanced and focused through the smoky finish. Drink now through 2027. 3,552 cases imported.", 17m, 47, 0, 90, "2015", new Guid("60450967-0c81-4739-868b-630f723a5840") },
                    { new Guid("36317dbe-18fc-473b-8372-e79a6c0de6df"), 0, new DateTime(2017, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Napa Valley", "A robust style, with inky notes to the dark currant, dried sage and fig flavors that glide across the palate. The sanguine finish is richly spiced. Drink now through 2020. 4,000 cases made.", 23m, 77, 0, 90, "2015", new Guid("21ba1b99-c800-4d7b-bb9f-e727fda9fd81") },
                    { new Guid("2c34274c-f8a6-47cb-b81e-2d6d92d3341c"), 0, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Edna Valley Reva Alban Estate", "Refined yet dynamic, with a structured and balanced core of acidity and tannins framed by formidable black raspberry, smoky meat, licorice and orange zest flavors that build momentum toward polished tannins. Drink now through 2026. 2,000 cases made.", 98m, 79, 0, 94, "2013", new Guid("82d50405-e451-463a-97ea-453da31c028c") },
                    { new Guid("2bb3d732-00fe-4a5b-8bb0-54ed63d64840"), 0, new DateTime(1989, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Sonoma County Lytton Springs", "Enormously ripe, fruity and complex, teeming with jammy flavors and finishing with richness and finesse. Drink now to 1994. A blend: 82 percent Zinfandel, 13 percent Carignane, 5 percent Grenache. 3,448 cases made.", 18m, 79, 0, 91, "1987", new Guid("b10d41fa-5b9a-4ef3-893a-c6f866ce955c") },
                    { new Guid("7e1b8967-8875-47df-b74e-5ac915a904ba"), 0, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Santa Cruz Mountains Monte Bello", "Rich, tannic, intense and young, but it's packed with concentrated plum, currant, mint, toast and chocolate flavors that unfold with elegance and finesse. Will only get better and more complex with time. Built to last. Drink now through 2000. 2,220 cases made.", 35m, 15, 0, 95, "1985", new Guid("b10d41fa-5b9a-4ef3-893a-c6f866ce955c") },
                    { new Guid("f6dbc807-e13f-465c-ab2e-10c982d04f71"), 0, new DateTime(2016, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Monte Bello Santa Cruz Mountains", "A beautifully structured wine, with firm acidity and tannins that show grip and grit amid a core of dense, tense currant and blackberry fruit, turning juicy. Those seeking classic old-school Cabernet will embrace this. Cellaring for five to seven years is the right approach. Cabernet Sauvignon, Merlot, Cabernet Franc and Petit Verdot. Best from 2020 through 2035. 5,243 cases made.", 175m, 7, 0, 94, "2012", new Guid("b10d41fa-5b9a-4ef3-893a-c6f866ce955c") },
                    { new Guid("527eaab0-22b8-4706-b656-304b259067b2"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Machete California", "Generous and expressive, big and brawny, this offers a mouthful of tannins but also brims with flavors and aromas, including Earl Grey tea, dark chocolate, dried violet and toasted gingerbread. Rich notes of plum and black cherry are balanced by forest floor and earth accents, which linger on the long finish. Petite Sirah, Syrah and Grenache. Drink now through 2030. 15,500 cases made.", 48m, 6, 0, 94, "2014", new Guid("29df1ddd-cb3d-4e19-8d6a-e38b2aa00f36") },
                    { new Guid("5e49b09f-6100-4293-aad3-01ead07b7d8f"), 0, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbaresco Asili Riserva", "Intense aromas of cherry, rose, licorice and tar pick up tobacco, spice and mineral elements on the palate. Concentrated, yet elegant and expressive, with more to give. Ends with a long aftertaste of fruit, underbrush and mineral. Best from 2018 through 2032. 1,110 cases made.", 59m, 5, 0, 96, "2011", new Guid("979f1783-ffdd-48ee-ac6a-5f586454b210") },
                    { new Guid("e92c9429-e4ed-4b8f-8384-5a02702039d8"), 0, new DateTime(2016, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Ribbon Ridge The Beaux FrÃ¨res Vineyard", "Supple, expressive and multilayered, exhibiting flavors of plum, currant, pomegranate and violet that come together harmoniously, persisting into the long and exceptionally well-balanced finish. Drink now through 2024. 2,405 cases made.", 90m, 3, 0, 95, "2014", new Guid("6b99905d-61ad-4783-b563-61baa9aeaddc") },
                    { new Guid("7982464e-a3f8-4d29-9f0f-68cabaab5527"), 1, new DateTime(2016, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Dundee Hills Evenstad Reserve", "Focused and expressive, this is layered with wet stone, tangy citrus, pear and green guava flavors that swirl through an expansive finish, gaining momentum and extra dimensions with each sip. Drink now through 2024. 2,000 cases made.", 55m, 2, 0, 95, "2014", new Guid("f04608e9-66c3-4686-8d68-5acb32a48750") },
                    { new Guid("c9053b2f-fe52-48f5-b1a2-27cbfd69ae34"), 1, new DateTime(2015, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Palladius Swartland", "Intense, with ripe, lush layers of creamed Jonagold apple, Cavaillon melon and glazed peach fruit, enlivened by dried chamomile, quinine and bitter citrus oil notes. The long finish flows beautifully, with the fruit and floral elements draped over a well-embedded mineral edge. This has depth and energy, and should cellar well. Chenin Blanc, Roussanne, Grenache Blanc, SÃ©millon, SÃ©millon Gris, Palomino, Viognier, Clairette Blanche and Verdelho. Drink now through 2022. 750 cases made.", 113m, 100, 0, 94, "2012", new Guid("19adab22-7dd2-4b36-bf52-fde7be9f48c0") },
                    { new Guid("d14b3e6a-5512-46f4-adc7-f7ee55580b33"), 1, new DateTime(2017, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "'T Voetpad Swartland", "Dried lemon peel, fennel seed and honeysuckle notes give this a high-pitched entry, but the core offers up Jonagold apple and melon fruit while the finish pulls in fresh salted butter and verbena details, imparting remarkable range and length. Chenin Blanc, Sémillon, Palomino and Muscat. Drink now through 2024. 280 cases made.", 67m, 100, 0, 95, "2015", new Guid("19adab22-7dd2-4b36-bf52-fde7be9f48c0") },
                    { new Guid("0273423f-c6e7-49cd-aa08-b0ec7b49a956"), 1, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Qualitätswein Trocken Rheingau Kiedricher Gräfenberg GG", "Very rich and complex, with enveloping flavors of baked apple, ripe citrus, nectarine and dried pear supported by a powerful structure. Lush midpalate, with a notes of dried guava, followed by unctuous spiciness on the finish, with accents of white chocolate, chamomile and dried herbs. Best from 2018 through 2026. 2,500 cases made.", 92m, 99, 0, 95, "2015", new Guid("02d556eb-71e9-4383-8c5c-2300f359bdcd") },
                    { new Guid("5a6438fc-19ee-4e7c-83a1-76f91d5921e7"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Douro Chryseia", "A powerful and concentrated red, featuring kirsch, red plum and baker's chocolate notes, balanced by tarragon, slate and violet details. Elegant, with supple tannins framing the long finish, which is laced with hot stone, olive and licorice accents. Drink now through 2023. 2,000 cases made.", 75m, 98, 0, 94, "2014", new Guid("217b8186-42e0-46c4-82d1-b092ce9c8bad") },
                    { new Guid("9c09b737-b9d8-4c52-b1ac-5e070b7c274f"), 0, new DateTime(2017, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Calabria GB", "Finely balanced and creamy, this bold red offers a rich range of black cherry coulis, fig cake, dried marjoram and oak spice flavors, layered with sculpted tannins. Long on the palate, with a lasting spicy mineral note. Gaglioppo, Magliocco Canino, Nerello Cappuccio and Greco Nero. Drink now through 2027. 3,500 cases made.", 45m, 97, 0, 92, "2014", new Guid("aef2d7c3-5942-4465-aa0a-0264c8320af5") },
                    { new Guid("eeb38920-07e4-49a0-a7e6-205233bf23b3"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nero d'Avola Terre Siciliane Versace", "A well-focused, rich red in a balanced, medium-bodied frame, this offers a subtle underpinning of tarry mineral notes layered over light, sculpted tannins and flavors of mulberry and dried fig, with hints of herbes de Provence and mocha. Drink now through 2025. 1,166 cases made.", 33m, 96, 0, 91, "2015", new Guid("b064cfd1-76b4-4616-857f-3720b69a8411") },
                    { new Guid("6324f65d-e470-4e19-aa36-3fcc70702ff0"), 1, new DateTime(2017, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Kabinett Halbtrocken Mosel Zeltinger Himmelreich", "Pungent, with aromas of slate and ripe orchard fruit, this sleek white displays complex flavors of flowers, peach, quince and slate. A hint of chive works into the mix as this remains persistent on the finish. Drink now through 2024. 140 cases imported.", 20m, 95, 0, 93, "2015", new Guid("6c47bf36-298a-466f-97af-34d543559bf1") },
                    { new Guid("3dccf234-1af9-4b85-a775-1b6dfd98d2ce"), 1, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Greco di Tufo G", "Tarragon and thyme notes lace flavors of green melon and lime granita in this juicy, light- to medium-bodied white. Fresh, balanced and minerally, with a spiced finish. Drink now through 2020. 5,500 cases made.", 27m, 94, 0, 90, "2016", new Guid("1dff7961-369c-4e8b-8aa6-36844903d21b") },
                    { new Guid("7349529e-b4ae-4f37-b5eb-0151ab4879ac"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Verdicchio dei Castelli di Jesi Podium", "An elegant, creamy white, backed by sleek, citrusy acidity, this shows a subtle mix of poached pear, grated ginger and stony mineral flavors, accented by hints of crushed almond. Drink now through 2020. 3,500 cases made.", 25m, 92, 0, 90, "2014", new Guid("718a907a-de49-4e66-a8be-a4eee4c96966") },
                    { new Guid("65c46164-2462-478c-8a7e-f7db509bd46f"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "St.-Julien", "Densely packed, with cassis, steeped plum and blackberry coulis notes that are compressed with layers of cold charcoal and graphite. Very pure, giving this a long, sleek and racy feel, while an iron underpinning drives the finish. Best from 2020 through 2040. 12,500 cases made.", 135m, 91, 0, 95, "2014", new Guid("b8e707cb-26d8-4d81-a620-848d89d41bd5") },
                    { new Guid("1bf7d732-0e0c-4cf2-a028-bb61e9f4f9b8"), 0, new DateTime(2017, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Puente Alto Don Melchor", "A ripe, rich and full-bodied red, with powerful flavors of dark cherry, plum pudding and currant that feature a lush creaminess. Firm and savory midpalate, ending with a long and refined finish that shows mineral and cocoa butter accents, supported by dusty tannins. Drink now through 2024. 7,850 cases made.", 120m, 90, 0, 96, "2014", new Guid("57ef02d6-4ae7-4d6e-a8e7-aac39ffb805e") },
                    { new Guid("f172aead-f41a-4fe8-bbd2-ebaddd561b46"), 0, new DateTime(2017, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Adelaida District Estate", "Combines rich, deep flavors with a measure of finesse and refinement, allowing the earth-laced red berry and spicy herb notes to shine. Ripe, sturdy tannins lend this structure and traction. Best from 2020 through 2034. 1,000 cases made.", 85m, 89, 0, 94, "2014", new Guid("5575fd15-d614-4078-9d47-d5dc14407e95") },
                    { new Guid("5a05672f-e6da-415c-9ee4-1750723f63d4"), 4, new DateTime(2017, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vintage Port Guimaraens", "This is warm and lush in feel, and really well-built, with layers of blueberry, açaí berry and plum reduction flavors rolling through, laced with hints of ganache and fruitcake. Lots of graphite-edged grip lines the finish.  Best from 2027 through 2040. 4,500 cases made.", 58m, 88, 0, 93, "2015", new Guid("6ca395e3-b602-45fe-a653-b1b4800983b8") },
                    { new Guid("32b1c926-53ac-438f-af6c-1151706ba814"), 5, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Champagne Cuvée Ste.-Anne", "A bright, finely meshed version that shows beautiful harmony throughout, offering flavors of Gala apple, spring forest, almond pastry and lemon curd riding the creamy mousse. Lasting, spiced finish. Disgorged February 2016. Drink now through 2022. 1,300 cases imported.", 50m, 87, 0, 92, "NV", new Guid("42a30712-019f-48ae-9428-7d1acc8dc534") },
                    { new Guid("92e943f4-ef8a-4e5b-a9b8-f3d7b07b931e"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Alexander Valley", "A big, rich Cabernet, with firm, structured tannins that are powerful and edgy, framing the core of blackberry, black cherry, plum and espresso flavors. An impressive effort. Best from 2019 through 2029. 4,075 cases made.", 75m, 86, 0, 94, "2014", new Guid("9a0c5a7f-1608-4757-87cf-c6a238106c73") },
                    { new Guid("69198db9-4987-49bd-b46a-b66df168daee"), 5, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Nature Vino Espumoso de la Finca", "A minerally version, with up-front petrol and spice notes lacing the poached cherry, salted almond and lemon peel flavors that ride the delicate mousse. Elegant and harmonious. Disgorged February 2017. Drink now through 2020. 4,100 cases made.", 33m, 85, 0, 90, "2013", new Guid("650d82a8-4d17-4e6d-9736-1a26abcc9694") },
                    { new Guid("5a5d303d-5635-458c-81ce-bec34dc367fb"), 1, new DateTime(2017, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vernaccia di San Gimignano Tenuta Le Calcinaie", "A bright, juicy version, boasting floral, peach, grapefruit and honey aromas and flavors. Pure and elegant, finishing with a characteristic hint of bitterness. Drink now. 2,350 cases made.", 18m, 84, 0, 90, "2015", new Guid("aed64bbe-491e-4539-ab40-520f06e0f108") },
                    { new Guid("ee84f555-b8a0-4405-aafb-4bd3a19bdad0"), 0, new DateTime(2017, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mercurey Clos des Myglands", "Ripe and pure, featuring cherry, blackberry, raspberry, mineral and light toast notes. Balanced and intense, playing out on the long, mouthwatering finish. Best from 2019 through 2032. 1,400 cases imported.", 53m, 83, 0, 93, "2015", new Guid("fc4aa8ba-32d1-4070-9e25-f418595bf304") },
                    { new Guid("93fccfa9-90d6-4ce7-bbc1-b841773bb2f5"), 0, new DateTime(2014, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Santa Barbara County Huntington", "Notably floral and spicy, with firm tannins amid the dark berry, mocha, roasted herb and fresh-turned earth flavors. This is complex, dense and persistent, gaining depth and length. Drink now through 2022. 9,218 cases made.", 23m, 86, 0, 90, "2012", new Guid("69ebc517-19db-4e83-a469-201033573921") },
                    { new Guid("2990d025-ad4d-45ac-9547-bd31c123e0dc"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Sonoma Coast Riviera", "Juicy and generous, featuring a rich, smooth core of plum and raspberry flavors, highlighted by zesty floral scents that accentuate the aroma and fruitiness. Agreeably supple, with easygoing tannins. Drink now through 2022. 3,200 cases made.", 22m, 82, 0, 90, "2015", new Guid("69ebc517-19db-4e83-a469-201033573921") },
                    { new Guid("268c97a1-003d-46de-b6d5-3d93092cd4a3"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Russian River Valley Dutton Ranch", "Well-centered on a mix of cherry, plum and raspberry flavors, elegant and refined, with sufficient tannins to hold attention. Ends with a clean, mouthwatering aftertaste that echoes the fruit and spice notes. Drink now through 2024. 5,880 cases made.", 44m, 81, 0, 92, "2015", new Guid("3c232ea0-5523-4953-951c-9fff0fe66db0") },
                    { new Guid("4e410452-23a5-4d86-915d-dfd31577be29"), 0, new DateTime(2017, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Valpolicella Classico Superiore San Michele Ripasso", "This mouthwatering red is medium-bodied and expressive, offering lightly chewy tannins and flavors of sun-dried cherry, strawberry preserves and star anise, with pleasing hints of herb and mineral on the finish. Drink now through 2022. 5,000 cases made.", 28m, 80, 0, 90, "2015", new Guid("ad543268-c770-48be-a9aa-a713b84a2d91") },
                    { new Guid("15a4f6af-f0c3-4e4b-9b88-391fedc58fc3"), 1, new DateTime(2017, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Federspiel Trocken Wachau Steinriegl", "A fruity style, boasting apricot, ripe apple, white pepper, mineral and floral notes, this is harmonious and fresh, leaving a sapid, mineral aftertaste.  Drink now. 2,083 cases made.", 35m, 78, 0, 92, "2015", new Guid("0767813a-9fbe-4a3b-ab26-a4efa9a1d5cd") },
                    { new Guid("5557f39d-3d51-4558-ba6b-c4d33abb7cef"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rosso di Montalcino", "Bright, delicate and vibrant, with berry and floral flavors. Accents of earth, tobacco and spice add interest as they linger on the finish. Well-rounded and long. Drink now through 2023. 16,666 cases made.", 27m, 46, 0, 91, "2015", new Guid("cb324948-c95b-4e74-a5f0-7d784fb57ecf") },
                    { new Guid("5f6e5c21-60b8-4b61-8fc7-491be4b213bc"), 0, new DateTime(2017, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Mendoza Ultra Las Rocas", "Dense and rich-tasting, with a muscular mix of dark currant and black olive flavors that are supported by firm tannins. Cocoa powder and slate notes fill the finish, along with peppery hints. Drink now through 2022. 10,000 cases made.", 20m, 45, 0, 90, "2015", new Guid("ec099457-10aa-4826-9535-06a13ee3f664") },
                    { new Guid("12b15c64-cc84-46e1-8a32-8343c8b06bc3"), 0, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Châteauneuf-du-Pape Auguste Favier Réserve", "Vibrant and captivating, with exuberant fruitcake, cinnamon and black tea aromas leading the way for a fleshy core of raspberry pâte de fruit, plum sauce and cassis, all allied to a lovely velvety texture. Maintains intensity through the finish, showing a long echo of pastis. Best from 2020 through 2040. 1,300 cases made.", 55m, 44, 0, 97, "2015", new Guid("5dc8363a-f6fd-40b3-b88a-e53030d8af83") },
                    { new Guid("219ef346-b270-44d4-bed0-26080864159d"), 0, new DateTime(2017, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Salta", "Refined and rich-tasting, with effusive minerality to the red berry and cherry flavors, lathered with plenty of creamy accents. Pepper and cigar box notes show on the long and complex finish. Drink now through 2022. 27,300 cases made.", 25m, 18, 0, 92, "2015", new Guid("3409cbfb-3b24-471e-8eba-c944565f7069") },
                    { new Guid("ba749146-87a9-48eb-910e-edea280ffedc"), 0, new DateTime(2017, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Alicante Tarima Hill Old Vines", "This red shows grace and depth. Black cherry, plum, mineral and smoke flavors mingle harmoniously over well-integrated tannins, while lively acidity keeps this focused. Not showy, but all the pieces fit together. Balanced, in the modern style. Drink now through 2025. 10,000 cases made.", 17m, 17, 0, 92, "2015", new Guid("0bcac9bd-89bc-406e-a2f5-96052ef15f94") },
                    { new Guid("aedb586d-a99e-4c6a-a55f-1b394a315f66"), 0, new DateTime(2014, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel California Juvenile", "Sleek, ripe and youthful, offering jammy raspberry aromas and flavors, with zesty notes of smoky spice and grilled anise. Drink now through 2019. 10,000 cases made.", 20m, 46, 0, 91, "2012", new Guid("a4bf2a32-ae1b-4e21-9bf0-c22779d863d4") },
                    { new Guid("a7bb82d3-a931-4a7d-af89-c36bcd9b9cbf"), 0, new DateTime(2015, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Petite Syrah Howell Mountain Rattlesnake Ridge", "Bright, vivid and extremely aromatic, with lavender, white pepper and cinnamon notes up front, backed by a core of huckleberry, blackberry and blueberry flavors. The fleshy tannins have a rustic appeal, but never get in the way of the details on the long finish, accented by mineral, toasted herb and black tea elements. Drink now through 2030. 475 cases made.", 44m, 17, 0, 95, "2013", new Guid("a4bf2a32-ae1b-4e21-9bf0-c22779d863d4") },
                    { new Guid("aeaced73-1ddf-4fc1-987f-584ac9c8fb5c"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Paso Robles Ueberroth Vineyard", "An impressive combo of refinement and torque. This features ripe, rich fruit backed by great minerality and structure, with notes of raspberry and blackberry plus licorice, sage and pepper. Drink now through 2028. 1,380 cases made.", 48m, 16, 0, 95, "2014", new Guid("a4bf2a32-ae1b-4e21-9bf0-c22779d863d4") },
                    { new Guid("55335b8f-5fc5-4011-9271-93f200d215d2"), 1, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Savennières", "Alluring, with quince, creamed pear, verbena and green almond flavors allied to a creamy texture, all offset beautifully through the finish by light quinine and mineral hints. Approachable, but this seems built for the cellar. Best from 2018 through 2030. 1,500 cases imported.", 30m, 15, 0, 94, "2015", new Guid("1af76129-1dec-4439-a88d-760194568b3b") },
                    { new Guid("de4c1316-c7ec-4910-9498-df6776e77b88"), 0, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "ChÃ¢teauneuf-du-Pape", "A stunner, with a gorgeous cassis aroma that soars from the glass, reinforced by a core of cherry and plum pÃ¢te de fruit, hoisin sauce, warm ganache and well-roasted apple wood notes. Hefty, but suave and seamless. The finish lets graphite and licorice elements glide through. The structure is dense, polished and perfectly integrated, resulting in lovely length. Should be a beauty after cellaring. Best from 2017 through 2032. 6,000 cases made.", 135m, 7, 0, 97, "2012", new Guid("64e600f3-5077-4fdc-b043-2bd73ec7845a") },
                    { new Guid("98eb6b72-f5ff-4d27-8c31-281dae8c722a"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Châteauneuf-du-Pape", "This offers a drop-dead gorgeous core of cassis and raspberry pâte de fruit flavors that hold center stage but still allow notes of Lapsang souchong tea, anise, incense and shiso leaf to chime in. Very long, with a sublime feel through the mineral-tinged finish. So seductive already, but this should cruise in the cellar. Drink now through 2040. 6,000 cases made.", 109m, 14, 0, 98, "2015", new Guid("64e600f3-5077-4fdc-b043-2bd73ec7845a") },
                    { new Guid("54ab7bf5-c93b-4113-a7db-f6c5b3d6cc33"), 1, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Washington Uncovered", "Dynamic, yet sleek and refined, driven by a core of minerally acidity that meshes with the delicately complex apple, Meyer lemon and spicy yeast accents that linger long on the finish. Drink now through 2021. 1,835 cases made.", 35m, 13, 0, 94, "2014", new Guid("0ed86922-ca99-4b09-ab3a-1a55e910d389") },
                    { new Guid("80dcb5ee-f0c1-40b2-b213-3fe456b66cc1"), 0, new DateTime(2014, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bedrock Heritage Sonoma Valley", "An exceptional red that recalls the hearty old California field blends with style. Exotic aromas of cracked pepper, smoky beef and blackberry lead to plum, Asian spice and licorice flavors, lingering toward briary tannins. A blend of Zinfandel, Carignane and 20 other field-blended varieties. Drink now through 2022. 500 cases made.", 42m, 15, 0, 95, "2012", new Guid("9c14e014-7527-4983-9e6d-3ee5c1638944") },
                    { new Guid("63ec3bbf-e4d8-4025-b4ef-abd3cfb1cd7d"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel California Old Vine", "Rich and supple, this is an explosion of pure, decadent fruit. Floral huckleberry and Chinese five-spice powder aromas open to layered blackberry, dark chocolate and licorice flavors that linger. Drink now through 2026. 4,500 cases made.", 25m, 12, 0, 93, "2015", new Guid("9c14e014-7527-4983-9e6d-3ee5c1638944") },
                    { new Guid("49f26ae1-4c14-427c-b37a-a70cc36f59a1"), 0, new DateTime(2015, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brunello di Montalcino Montosoli", "A stunning red, delivering peony, strawberry, cherry and mineral flavors, accented by notes of wild herbs. Intense and deep, with great purity and elegance, a firmly wrought structure and a long finish. The harmony between fruit, tannins and acidity should allow this to age beautifully. Best from 2019 through 2036. 1,300 cases made.", 125m, 18, 0, 98, "2010", new Guid("b8fb4d50-17bf-4b78-921b-2007571cfa0d") },
                    { new Guid("1a0bb674-be80-4335-9b67-88389c7c19ca"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brunello di Montalcino Our 40th Harvest", "Cherry, leather and iron notes mark this suave, elegant red. A bit reticent now, but the fruit is fresh and long on the finish. The dense tannins leave a mouthcoating impression, but this opens up beautifully over a few hours. Best from 2021 through 2035. 10,000 cases made.", 65m, 11, 0, 96, "2012", new Guid("b8fb4d50-17bf-4b78-921b-2007571cfa0d") },
                    { new Guid("6c9141f5-2160-41dd-aa94-a6ec0b827e27"), 0, new DateTime(2015, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Paso Robles Fracture", "Bold and downright flamboyant, this manages to stay balanced and focused. Floral aromas of boysenberry, raspberry and roasted coffee open to rich, complex flavors that focus on licorice, smoky pepper beef and loamy mineral. Drink now through 2026. 1,000 cases made.", 85m, 68, 0, 94, "2013", new Guid("26693132-2dcc-41e8-803c-37c7bf34f45f") },
                    { new Guid("9240d5a4-cea1-4f71-9247-5a2204eca5ed"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Oublié Paso Robles", "Expressive and impressively structured, with savory blackberry aromas and accents of rosemary, thyme and crushed stone, opening to complex, densely layered flavors of currant, pepper and espresso. Grenache, Mourvèdre and Counoise. Best from 2018 through 2028. 1,500 cases made.", 80m, 10, 0, 95, "2014", new Guid("26693132-2dcc-41e8-803c-37c7bf34f45f") },
                    { new Guid("98edd469-1182-41e3-9c7b-5fa132a669d7"), 1, new DateTime(2017, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Napa Valley", "This offers a gorgeous mouthful of rich, buttery Chardonnay, loaded with exotic tropical fruit, pear, melon and pineapple flavors. Impressive for its opulence and silkiness, a nice combination. Drink now through 2022. 2,500 cases made.", 75m, 9, 0, 95, "2015", new Guid("26c55f8d-133e-4103-b2fb-8c4278ed5e4b") },
                    { new Guid("4e87a047-3643-4f86-858d-2c0da2cd3c55"), 0, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Napa Valley", "Strikingly complex and detailed, with supple, harmonious blackberry, currant, anise, licorice and crushed rock flavors. Gains depth while holding focus and persistence. Drink now through 2032. 1,200 cases made.", 70m, 8, 0, 95, "2014", new Guid("f6b92a4a-5e98-425f-a939-3d71c622a3bb") },
                    { new Guid("dc8a6298-eded-4581-adb4-b68adca19eb4"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "St.-Emilion", "This cuts a wide swath, with mouthwatering tobacco and warm ganache notes leading the way, followed by a wave of fig, blackberry and black currant preserves. Shows remarkable definition already, even though the structure is strident. Tempting now, but just put this in the back of the cellar. Best from 2020 through 2035. 4,083 cases made.", 61m, 7, 0, 95, "2014", new Guid("3f21cc0d-46e5-4d77-bfc1-596761fd8462") },
                    { new Guid("04e41e6c-ce64-48b5-839e-3f14afafb9b6"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vouvray Demi-Sec Le Mont", "This tilts toward the flattering side of off-dry, showing a plump feel to the core of creamed pear, white peach and yellow apple fruit. Lovely verbena, honeysuckle and mineral accents keep this balanced and driven, with a long finish that lets the fruit echo. Drink now through 2032. 2,000 cases made.", 44m, 6, 0, 95, "2016", new Guid("a3072737-7dac-4083-9e43-acec41c6edc7") },
                    { new Guid("38fd22af-9d5e-48f7-b4c8-83dacfcff0c5"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gigondas", "A textbook version of the brawny side of Gigondas, this offers a grippy alder bass line underneath layers of dark currant and fig fruit, while lots of tobacco, rosemary and bay leaf fill in throughout. Muscular and energetic, this is built for the cellar. Best from 2019 through 2030. 4,000 cases made.", 43m, 5, 0, 95, "2015", new Guid("b097e8a0-97d7-458f-a340-233202af78a9") },
                    { new Guid("0a706431-9a66-460f-a21f-4faa149b156b"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brunello di Montalcino", "Effusive aromas and flavors of raspberry, cherry, floral, mineral and tobacco are at the center of this linear, vibrant red. Well-structured, this offers terrific length on the sinewy finish. Best from 2020 through 2035. 6,054 cases made.", 65m, 4, 0, 95, "2012", new Guid("e2f51d5f-ff12-42c7-9125-2be039c9ede9") },
                    { new Guid("4f603536-3e8f-4817-999e-9a18caae7efa"), 4, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barsac", "This shows the vivid, racy side of Barsac, with streaming flavors of pineapple, yellow apple, green plum and white ginger, displaying lovely energy from start to finish. Ends with enough honeysuckle and orange blossom notes to balance the richness. Best from 2020 through 2035. 4,000 cases made.", 37m, 3, 0, 96, "2014", new Guid("d56d3b8a-75f6-4337-a249-61260fc2b307") },
                    { new Guid("2243aad5-10bf-41b1-a299-0e8669262232"), 0, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Creator Walla Walla Valley", "Supple, expressive, polished and generous, with layers of dark berry, cherry, black olive and spice flavors that merge harmoniously on the long and refined finish. Cabernet Sauvignon and Syrah. Drink now through 2022. 1,301 cases made.", 55m, 31, 0, 94, "2012", new Guid("92475b4a-cb25-4736-8768-ce14d5bb08c7") },
                    { new Guid("eee27a1f-a4fc-41b9-9dea-2efbc952e83d"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Walla Walla Valley Powerline Estate", "A knockout Syrah, precise and impeccably built but explosive with personality. Smoky roasted meat and floral blackberry aromas combine with bold, supple flavors of dark plum, pepper and licorice. The tannins are big but polished. Drink now through 2024. 1,319 cases made.", 45m, 2, 0, 95, "2014", new Guid("92475b4a-cb25-4736-8768-ce14d5bb08c7") },
                    { new Guid("029e7623-9ec2-4c81-8391-47f71b39fedc"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Napa Valley Three Palms Vineyard", "A powerful red, with concentrated flavors of red plum, cherry and boysenberry that are layered with plenty of rich spice and mineral accents. Touches of slate and cardamom make for a complex finish. Drink now through 2023. 3,170 cases made.", 98m, 1, 0, 95, "2014", new Guid("dcf53af6-1b87-47c1-93d4-bc7513e4079f") },
                    { new Guid("9fb0680a-582c-4aa8-ae7f-21464b5bc5ca"), 4, new DateTime(2019, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Late Harvest Chenin Blanc", "Abounding with aromas of mango, honey and tropical fruit, our award winning Late Harvest Chenin Blanc is the perfect close to a delicious meal, but is also an elegant aperiti", 15m, 5, 0, 91, "2019", new Guid("d2835e85-89ab-4b23-a5d5-48db93f778dd") },
                    { new Guid("d9272018-dae4-4f1a-badf-b195c27bb057"), 5, new DateTime(2019, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut", "A complex blend of Chenin Blanc, Chardonnay, Viognier, Pinot Noir, Riesling and Shiraz. This is one of the few “Méthode Champenoise” wines in the world to be crafted from six different grapes, resulting in something remarkable", 41m, 12, 0, 91, "2017", new Guid("d2835e85-89ab-4b23-a5d5-48db93f778dd") },
                    { new Guid("8610c9aa-704e-4a10-99f3-086b980a8c4f"), 2, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Rosé", "Zinfandel Rose is ripe, fresh and fruity, with abundant aromas of cranberries and fresh strawberries. A versatile “anytime” wine great for picnics, parties and hot summer days. Lovely with poultry and spicy dishes. Serve well chilled.", 16m, 100, 0, 91, "2015", new Guid("d2835e85-89ab-4b23-a5d5-48db93f778dd") },
                    { new Guid("60e79b55-b2e8-45f7-9b89-6f9de315d12e"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dindori Reserve Viognier", "Dindori Reserve Viognier is an exotic elixir of peach and lychee flavours. Floral, spicy, stunning. Great as an aperitif and terrific with spicy food. Serve well chilled.", 20m, 75, 0, 91, "2014", new Guid("d2835e85-89ab-4b23-a5d5-48db93f778dd") },
                    { new Guid("23297d79-4680-4c1e-ba4e-03635f3d732a"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja Reserva", "Black cherry, currant and floral notes are expressive and alluring, balanced by loamy earth, tobacco and mineral elements that add a savory quality. Firm, well-integrated tannins give support to the polished texture, while orange peel acidity fuels the fresh finish. Drink now through 2027. 10,000 cases imported.", 31m, 19, 0, 93, "2012", new Guid("2fab4fa2-7919-4b40-8c73-2e163b28bb4a") },
                    { new Guid("48315d77-eb65-4b31-bbdf-8d2b3476e8fc"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brunello di Montalcino Campogiovanni", "In a traditional style, featuring beefy tannins and savory earth notes, with a core of leather and cherry flavors. Shows some sweetness midpalate and picks up energy on the long finish. Hangs together, ending in an uplifting, resonant manner. Best from 2021 through 2036. 5,833 cases made.", 60m, 20, 0, 96, "2012", new Guid("79c5bc74-f968-46e2-9821-46383fe788f2") },
                    { new Guid("ed2659c3-6db1-4e4e-95b7-5c9d67777881"), 0, new DateTime(1988, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Predicato di Bitùrica", "Dark, dense and ripe, with concentrated cherry, berry and plum on the nose and palate, silky smooth, chocolatey, beautifully balanced. Drinkable already, but it has the stuff to grow.  ", 19m, 28, 0, 92, "1982", new Guid("79c5bc74-f968-46e2-9821-46383fe788f2") },
                    { new Guid("5aca82e0-e7cb-442b-99e1-12f30da574a5"), 0, new DateTime(1988, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chianti Classico Il Grigio Riserva", "Remarkably youthful color and lovely violet-tinged fruit on the nose only hints at the rich, raspberry, cherry and plum fruit on the palate. Hints of toast and chocolate chime in on the velvety finish.  ", 11m, 93, 0, 90, "1982", new Guid("79c5bc74-f968-46e2-9821-46383fe788f2") },
                    { new Guid("d60b9a2e-5bb9-464d-86bb-fd4664e2c104"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pouilly-Fuissé", "A sleek, stony version, this white exhibits lime blossom, apple, mineral and subtle spice flavors. Energetic, resonating on the long, citrus- and mineral-infused aftertaste. Drink now through 2024. 4,500 cases made.", 35m, 43, 0, 92, "2015", new Guid("3e59ba39-67b5-472f-b7a6-eb7fd4d13321") },
                    { new Guid("11cf43a2-1a37-4019-a2bd-b529d5f7171a"), 0, new DateTime(2015, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Chehalem Mountains Margo", "Lithe and expressive, shading black cherry fruit with glints of mint, loamy earth and walnut. Fine tannins underline a long, dancing finish. Best from 2016 through 2022. 1,711 cases made.", 36m, 45, 0, 93, "2012", new Guid("9fd4612a-f954-4716-9feb-afab921ea483") },
                    { new Guid("1efd5944-a6d6-42f7-a2b1-4c88df8fd858"), 0, new DateTime(2017, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Chehalem Mountains Dopp Creek", "Firm and focused, with cinnamon notes floating around red berry and floral flavors, finishing with gentle persistence against lively acidity and fine tannins. Best from 2018 through 2022. 3,100 cases made.", 26m, 42, 0, 91, "2014", new Guid("9fd4612a-f954-4716-9feb-afab921ea483") },
                    { new Guid("50eb8484-b451-42f7-b7ef-f25727d19961"), 0, new DateTime(2017, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tannat Uruguay Reserva", "Well-sculpted, with dense, rich flavors of dark plum, dried blackberry and dark currant that are supported by firm tannins. Christmas pudding and rich savory notes show on the finish. Drink now through 2022. 12,000 cases made.", 17m, 41, 0, 90, "2015", new Guid("0388c818-13c8-4718-991f-a7ef46d9f5cb") },
                    { new Guid("fe58a426-f487-4495-80b2-7b89435f0dcd"), 1, new DateTime(2017, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Marlborough", "Succulent, fleshy peach and nectarine flavors are accented by Key lime, mango and ruby grapefruit notes. Shows nice intensity on the long, expressive finish. Drink now. 589,000 cases made.", 12m, 40, 0, 90, "2016", new Guid("c60c50bb-0448-4c18-bd4a-184832f63013") },
                    { new Guid("2383203a-69e0-46be-800a-8cbdad6ba9be"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frederick Walla Walla Valley", "Refined and impeccably structured, with floral black cherry and dusty dried spice aromas, and complex plum, olive and mocha flavors that glide toward polished tannins. Cabernet Sauvignon, Cabernet Franc, Merlot, Petit Verdot and Malbec. Drink now through 2023. 2,966 cases made.", 50m, 39, 0, 94, "2014", new Guid("93084c1a-29b8-44c2-91f9-e424404c8ee3") },
                    { new Guid("1312977f-7da9-44ed-9c13-0a495d91d1d2"), 0, new DateTime(2017, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dogliani", "A beam of bracing acidity at the core of this intense, saturated red helps delineate the blackberry, boysenberry, blueberry and graphite flavors. This has grip and complexity, but just needs a little time. Best from 2018 through 2024. 9,000 cases made.", 16m, 38, 0, 92, "2015", new Guid("5615ad15-2e51-4f5b-9ae3-554f51053547") },
                    { new Guid("44a090e3-d3ec-48d0-8ad1-e8372d3215e2"), 1, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sancerre", "Crunchy, with lots of gooseberry and thyme notes bouncing around, while flint and fleur de sel accents drive the mouthwatering finish. Drink now through 2020. 3,125 cases imported.", 23m, 37, 0, 91, "2016", new Guid("94452aa3-51ad-40d7-8cfa-fb5037731c80") },
                    { new Guid("438b2c01-7ccc-4b8d-abd1-d580df809f0c"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Ball Buster Barossa Valley", "Bold, with dense notes of dark chocolate-covered coffee bean, plum paste, wild blackberry, cigar box and date bread. Expressive and generous. The velvety tannins linger. Shiraz, Cabernet Sauvignon and Merlot. Drink now through 2027. 8,500 cases made.", 23m, 36, 0, 91, "2014", new Guid("56821bbd-b745-4abe-9f78-c8621c087974") },
                    { new Guid("736d8f8f-1808-4a1f-9ebe-8dc74d64f7a0"), 1, new DateTime(2017, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Albariño Rias Baixas", "This big white is round and polished, with good weight and solid acidity behind the pear, blanched almond and white tea flavors. Ginger and briny notes give this a savory character. A muscular style. Drink now through 2022. 3,000 cases imported.", 21m, 35, 0, 91, "2016", new Guid("a529bf37-95bc-4f4b-967a-06faae4874c3") },
                    { new Guid("cd496815-0f1d-4393-ba2f-75db6a54d620"), 0, new DateTime(2017, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Agrelo Remolinos Vineyard", "An elegant style, with a core of vibrant cherry, plum and currant flavors that are supported by fresh acidity. This is supple midpalate, with a finish that lingers with dried ginger and white pepper details. Drink now through 2022. 18,000 cases imported.", 22m, 34, 0, 91, "2015", new Guid("72c977b2-cb6a-48b0-864e-8f911b1348ac") },
                    { new Guid("1d3fabd0-fd60-4960-a9e8-aa97da1d3a04"), 1, new DateTime(2017, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Clare Valley The Lodge Hill Dry", "A taut and linear white, with a lip-smacking blend of peach, lime and green apple flavors, finishing on a refreshing note. Drink now. 3,000 cases imported.", 20m, 33, 0, 91, "2016", new Guid("536f3369-2ace-4610-ba0f-7cdc95865064") },
                    { new Guid("a6f481a5-5aaa-4c85-b1fe-b6c0e4bec7e3"), 1, new DateTime(2017, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc High Valley", "Focused and precise, with detailed lemon meringue, orange blossom and lime zest flavors that are intense, fragrant and harmonious on the long, crisp finish. Drink now. 2,198 cases made.", 20m, 32, 0, 91, "2015", new Guid("607ee529-0c37-4844-9ee1-a9f2070d9d14") }
                });

            migrationBuilder.InsertData(
                table: "Wines",
                columns: new[] { "Id", "Color", "IssueDate", "Name", "Note", "Price", "Rank", "RankYear", "Score", "Vintage", "WineryId" },
                values: new object[,]
                {
                    { new Guid("bbdb3c5f-f1fa-403e-b40e-fb4ae943b310"), 1, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Finger Lakes Classique", "Weighty for a Riesling, with a rounded feel and layers of creamed yellow apple, white peach and persimmon flavors. Delivers energy and cut throughout, with lemon pith, citrus oil and chamomile accents filling in. Shows length and range through the finish. Drink now through 2021. 1,800 cases made.", 19m, 31, 0, 92, "2015", new Guid("3d8f407d-a501-45cb-a78b-60d86f56d46d") },
                    { new Guid("234daf4a-8d3e-4ab6-9a36-5c70633b59cc"), 0, new DateTime(1989, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Sonoma County Geyserville", "  ", 15m, 83, 0, 90, "1987", new Guid("b10d41fa-5b9a-4ef3-893a-c6f866ce955c") },
                    { new Guid("72b37463-873d-440e-bb71-4bfe7f608975"), 1, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Manzanilla Sanlúcar de Barrameda La Guita", "Distinctive, with verbena and tarragon notes leading the way, followed by lemon pith and jicama flavors. Flashes of gooseberry and talc run through the finish. Bottled June 2016. Drink now. 200,000 cases made.", 15m, 30, 0, 91, "NV", new Guid("cbaf8aa6-8739-4cc2-9e14-0d7f5e2acfa7") },
                    { new Guid("47b22d1e-6e41-4ad5-bc50-925c87c721cc"), 1, new DateTime(1990, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Lake County Vintner's Reserve", "With powerful grassy, fruity aromas, full, crisp flavors and a lingering, light finish, this is unmistakably Sauvignon Blanc. Herbs, vanilla and tasty peach flavors fill out the profile. 80,000 cases made.", 9m, 89, 0, 90, "1989", new Guid("9a6fc135-7aac-43da-93d0-8e6d328af7c7") },
                    { new Guid("5b49d67d-8978-4ffa-a86b-c44d170f2a4f"), 0, new DateTime(1989, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon California Cardinale", "You'd have to travel far to find a more complex and concentrated wine, from the first taste of currant, cherry and plum to the last waft of buttery oak and plum on the long finish. The extraordinary structure and integrated tannins should last beyond 2000. 1,000 cases made.", 45m, 5, 0, 97, "1985", new Guid("9a6fc135-7aac-43da-93d0-8e6d328af7c7") },
                    { new Guid("d549c516-d0f2-4348-9f9c-d76dca909ef1"), 0, new DateTime(1988, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merlot Alexander Valley", "Effusively fruity, bursting with cherry aroma and flavor, complicated by other berries and the right touch of oak, beautifully structured, firm, tight and long. Needs time to lose the tannic toughness on the finish. Best after 1991.  ", 16m, 57, 0, 93, "1986", new Guid("9a6fc135-7aac-43da-93d0-8e6d328af7c7") },
                    { new Guid("7c44da2b-5fd5-4ac8-abc0-463f7ffea173"), 0, new DateTime(1988, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon California Proprietor's Reserve", "Sleek and elegant with an overlay of toasty French oak, layers of spice, currant, cassis and cherry flavors that are very attractive, beautifully balanced, supple tannins and a long, satisfying finish. Best after 1992.  ", 20m, 41, 0, 95, "1985", new Guid("9a6fc135-7aac-43da-93d0-8e6d328af7c7") },
                    { new Guid("bff2ded0-e7ce-4092-950d-be6ecc815d62"), 0, new DateTime(1988, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Sonoma Valley Durell Vineyard", "Supple and rich, with spicy cherry aromas and flavors, beautiful overtones of sweet oak and cinnamon; voluptuous and succulent—you could drink it now in a fit of sheer hedonism, but give it till 1991 or '92 for the full effect.  ", 14m, 23, 0, 92, "1986", new Guid("9a6fc135-7aac-43da-93d0-8e6d328af7c7") },
                    { new Guid("92c0aabf-f173-4562-b77d-4adb65614ce2"), 1, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay California Vintner's Reserve", "Plush, with loads of richness to the well-honed flavors of beeswax, baked pear and lemon tart. Minerally midpalate, with a fresh and zesty finish that finishes with pastry notes. Drink now through 2020. 100,000 cases made.", 17m, 28, 0, 91, "2015", new Guid("9a6fc135-7aac-43da-93d0-8e6d328af7c7") },
                    { new Guid("ae783c2e-1086-4427-b93c-516f4b0ab5e9"), 0, new DateTime(2017, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Garnacha Campo de Borja Veraton", "Expressive flavors of cherry, raspberry and dark chocolate mingle in this polished red, balanced by notes of licorice and wild herbs. The tannins are well-integrated, and balsamic acidity keeps this balanced. Dense and harmonious, in the modern style. Drink now through 2022. 3,000 cases made.", 30m, 27, 0, 92, "2014", new Guid("9e85bfad-e240-4e96-88cc-d44293c1a26a") },
                    { new Guid("afefbc8d-0629-4389-9d4c-609d5929b519"), 1, new DateTime(2017, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Patelin de Tablas Blanc Paso Robles", "This vibrant and mouthwatering white shows green apple, Meyer lemon and dried pineapple flavors that are fresh and juicy. Lemon verbena and lime sherbet notes reverberate on the long, detailed finish. Grenache Blanc, Viognier, Roussanne and Marsanne. Drink now. 2,920 cases made.", 25m, 26, 0, 93, "2015", new Guid("9b01c92d-d91c-470b-9c4f-009cc0da078e") },
                    { new Guid("45b28212-5ff2-4be5-bfbd-43779fd5b500"), 5, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Anderson Valley L'Ermitage", "Impeccably refined and elegant, with floral aromas of fresh brioche, baked apple and roasted hazelnut. The flavors are layered and well-focused, showing notes of mineral, fresh ginger and subtle raspberry. Drink now through 2017. 3,283 cases made.", 48m, 60, 0, 93, "2007", new Guid("6e3b28e1-7513-4876-8ba7-2c41300ced5c") },
                    { new Guid("b5aea749-0781-4a23-8223-6201b23eec85"), 5, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Anderson Valley", "A voluptuous and expressive sparkler, with floral red apple, brioche and cinnamon spice aromas and rich, vibrant flavors that finish on a luxurious note. Drink now through 2018. 80,000 cases made.", 24m, 25, 0, 92, "NV", new Guid("6e3b28e1-7513-4876-8ba7-2c41300ced5c") },
                    { new Guid("6bbb43d6-c167-4585-84f4-edccdf6d0790"), 0, new DateTime(2017, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justification Paso Robles", "Smooth-textured, graceful and refined, with a tenderness to the texture and tannins. Features a warm, inviting mix of red and dark berry flavors and subtle shades of licorice, light mocha and savory herbs, revealing floral scents and a long, persistent finish that echoes the core essence. Cabernet Franc and Merlot. Drink now through 2035. 11,000 cases made.", 50m, 24, 0, 94, "2014", new Guid("a115def5-17c4-4f58-ace2-6ad65263e9f7") },
                    { new Guid("8433e85f-1cdb-49fc-ba84-1ea9e350917e"), 0, new DateTime(2017, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maremma Toscana Tenuta Belguardo", "A red of great purity and polish, offering black cherry, blackberry, spice and herb flavors, this evokes tobacco, graphite and leather nuances as it builds nicely on the palate. Finishes with grip, harmony and complexity, as well as terrific length. Cabernet Sauvignon and Cabernet Franc. Drink now through 2028. 1,083 cases made.", 55m, 23, 0, 95, "2013", new Guid("f21151dc-abcd-44e5-8c15-a0840998845b") },
                    { new Guid("149c8b6a-e838-445d-a061-9218ec206dca"), 0, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "James Berry Vineyard Paso Robles Willow Creek District", "A dramatic wine that weds power and opulence, maintaining impeccable balance along the way. Brooding dark berry and loamy mineral aromas lead to rich flavors of currant, licorice, dried sage and smoky pepper. Ripe tannins frame the finish. Grenache, Mourvèdre, Syrah, Counoise and Roussanne. Best from 2018 through 2028. 1,400 cases made.", 98m, 22, 0, 97, "2014", new Guid("31b28d15-4202-4025-82fc-eec2f8c0ffb4") },
                    { new Guid("c385a43c-5690-4f90-9b35-a6122e8c9230"), 0, new DateTime(2017, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Russian River Valley Old Vine", "This is what Russian River Zinfandel is all about. Rich, dynamic and layered, with complex fruit, offering notes of jammy black raspberry, stony mineral, herbes de Provence and licorice. The finish unfurls at length. Drink now through 2026. 1,700 cases made.", 38m, 21, 0, 94, "2015", new Guid("c4e3f274-f07e-423c-bcfc-ecd33e3715fa") },
                    { new Guid("24e9fd6e-dc19-4804-a91b-9ef3e4cfd81b"), 0, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Maipo Valley Reserva", "Dark plum and dried red berry flavors dominate this muscular red, with plenty of minty and savory accents. Medium-grained tannins support chocolate and cream details on the finish. Drink now through 2021. 25,000 cases made.", 15m, 29, 0, 91, "2015", new Guid("b70c8159-9623-470b-a1dc-46e3d12911c2") },
                    { new Guid("5880568a-4f4d-42bc-8833-f6b3fa018348"), 0, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toscana Tignanello", "Aromas of graphite, smoke and tobacco introduce the cherry flavor in this expressive, focused red. Firm tannins and lively acidity balance the fruit and purity, while herbal, spice and mineral elements all gather steam as this plays out on the long finish. Sangiovese, Cabernet Sauvignon and Cabernet Franc. Best from 2017 through 2027. 2,500 cases imported.", 105m, 8, 0, 94, "2013", new Guid("3271d25a-14c0-4e70-86fc-a1c4c53c46b5") },
                    { new Guid("a4c65abc-deb2-4b32-bb9f-6c34c22757a6"), 0, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bolgheri Superiore Guado al Tasso", "Alluring violet, black currant, blackberry, wild herb, spice and mineral aromas coat the dense underlying structure at first, but the latter emerges as this cruises to a long conclusion. Shows excellent balance and expression of fruit and place. Cabernet Sauvignon, Merlot, Cabernet Franc and Petit Verdot. Best from 2018 through 2033. 1,200 cases imported.", 102m, 71, 0, 95, "2012", new Guid("3271d25a-14c0-4e70-86fc-a1c4c53c46b5") },
                    { new Guid("179f2c2c-7113-4a6a-b9d5-bd334d8eace9"), 0, new DateTime(1988, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chianti Classico Pèppoli", "Concentrated and beautifully formed, with sharply focused cherry, blackberr y and plum flavors, firm structure, long and ripe. Needs a year in the cell ar to tame the power.  ", 16m, 24, 0, 92, "1985", new Guid("3271d25a-14c0-4e70-86fc-a1c4c53c46b5") },
                    { new Guid("8e6aa74c-7617-45fa-b8b0-7b243ede1781"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bolgheri", "Sleek and elegant, with concentrated flavors of black cherry, black currant, cedar and vanilla. A wild, aromatic underbrush character lingers on the beefy finish. Merlot, Cabernet Franc and Syrah. Best from 2018 through 2024. 900 cases imported.", 34m, 97, 0, 91, "2013", new Guid("5671bfc1-5741-40cc-96b1-b63f6d0607f1") },
                    { new Guid("497cd5ba-b525-4a88-a1c1-8a03146de48f"), 1, new DateTime(2016, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chablis Domaine", "This is delicate, featuring lemon, herb and stone flavors lifted by the fine acidity. Touches of seashore and oyster shell add depth as this coasts to a clean finish. Drink now through 2018. 4,000 cases imported.", 32m, 94, 0, 90, "2014", new Guid("5a46d4ca-8577-4dff-a7c8-fadba0a348fc") },
                    { new Guid("17660631-2c53-4c1d-ba64-64e68fa7c20d"), 0, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Yiron Galilee", "A rich and plush red, with a deep well of blackberry pie, dark plum and hot stone flavors that fold together seamlessly. Creamy midpalate, presenting a finish that oozes with chocolate mousse and Asian spice details. Unctuous. Cabernet Sauvignon, Merlot, Syrah and Petit Verdot. Kosher. Drink now through 2020. 10,800 cases made.", 32m, 93, 0, 92, "2013", new Guid("4d69ae1c-8f9b-4ce6-956c-911742195350") },
                    { new Guid("5029644a-0703-4597-9a11-fcd80e72ae0c"), 0, new DateTime(2016, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chinon", "Lovely cherry pit, damson plum and violet notes stream through, picking up light savory and olive details along the way. The fresh finish features an iron echo. Very pure from start to finish. Drink now through 2020. 2,300 cases made.", 23m, 92, 0, 91, "2015", new Guid("6476be08-4e5a-4289-a9b7-7dd77b1adff2") },
                    { new Guid("cb73a051-8cfc-4ecc-989a-a1b38913441f"), 0, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Isola dei Nuraghi Montessu", "An elegant version, with Asian five-spice powder and cherry blossom notes wafting through flavors of black raspberry preserves, bresaola and cured tobacco. Long and supple, presenting a mineral-tinged finish. Carignano, Syrah, Cabernet Sauvignon, Cabernet Franc and Merlot. Drink now through 2021. 12,500 cases made.", 30m, 91, 0, 90, "2014", new Guid("58afb020-07b7-4963-b789-29a4df5c4cfb") },
                    { new Guid("54e9cfe5-2888-4579-8554-b335a80b8386"), 6, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bandol RosÃ© Moulin des Costes", "Offers a lovely combination of zip and richness, with creamy edges around a core of delicious white cherry and white peach flavors, all offset by a pure beam of minerality that pierces through from start to finish. Drink now through 2017. 4,000 cases made.", 30m, 90, 0, 91, "2015", new Guid("879d818f-e534-4916-a070-62136ed64320") },
                    { new Guid("24ee3bee-2f7e-4b03-8284-ec1f3a0ceb4a"), 1, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Assyrtiko Santorini Greek Wine Cellars", "A creamy white, with notes of dried coconut to the ripe apple, baked pear and lemon curd flavors. The richly spiced finish features accents of dried mint and sage. Drink now through 2020. 10,000 cases made.", 20m, 89, 0, 90, "2014", new Guid("5e20634b-8044-4d07-9cda-dafb23d9ce95") },
                    { new Guid("2921469f-4cc5-469b-85bf-03ee8dc3518b"), 1, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grechetto Colli Martani Grecante", "Thai basil and spice notes lace the creamy mix of Asian pear, white peach, stone and lemon zest in this well-knit white. Light- to medium-bodied and fresh, with a lingering, savory finish. Drink now through 2020. 10,800 cases made.", 20m, 88, 0, 90, "2015", new Guid("6cadb91e-8631-45e5-89ae-1738c3e54cf7") },
                    { new Guid("698910c1-47e2-489b-8a84-f4cfc356e417"), 0, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cornas", "Dark and brooding, this has a deep well of black currant, fig and bitter plum fruit in reserve, shrouded for now in smoldering charcoal, bay leaf and alder notes. Tapenade and tar details hang in the background. Offers a steel beam of a finish. Tuck this away in the back corner of your cellar. Best from 2020 through 2035. 1,438 cases made.", 120m, 87, 0, 96, "2013", new Guid("dbab5ba2-95f5-4370-8523-2b1f0f78dedc") },
                    { new Guid("70d93382-4458-4505-bbd8-2f55007c0dec"), 0, new DateTime(2016, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aglianico del Vulture Piano del Cerro", "A dense and tarry red that glides on the silky palate, with mouthwatering acidity framing flavors of blueberry puree, chocolate-covered cherry, vanilla, dried thyme and oak spice. An expressive version in a modern style, yet refined and harmonious overall, with the grippy finish echoing the ripe fruit and tarry mineral character. Drink now through 2027. 5,000 cases made.", 36m, 86, 0, 93, "2012", new Guid("83bb1916-5eaf-425b-bd7b-96fb3d0df517") },
                    { new Guid("d431f824-4b72-42f9-b541-a1ef918c927c"), 1, new DateTime(2014, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "GrÃ¼ner Veltliner Federspiel Trocken Wachau Terrassen", "This features a supple texture, with flavors of ripe pineapple and apple tart accented by a rich creaminess. Ginger snap and white chocolate details show on the airy, elegant finish. Drink now through 2017. 17,000 cases made.", 14m, 90, 0, 90, "2012", new Guid("7e6c3ec2-e467-4bef-a69f-3965d5381ee4") },
                    { new Guid("7c81bc2a-4d90-4a51-8d11-2200d8e5d58b"), 1, new DateTime(2016, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "GrÃ¼ner Veltliner Smaragd Trocken Wachau Terrassen", "Voluptuous and richly spiced, with some honeyed notes to the ripe apple, pear tart and glazed apricot flavors. Shows seductive smokiness midpalate, presenting a pastry-accented finish. Drink now through 2021. 6,000 cases made.", 30m, 85, 0, 92, "2013", new Guid("7e6c3ec2-e467-4bef-a69f-3965d5381ee4") },
                    { new Guid("30af8a11-3927-493c-9ba2-f3132bfd95d1"), 0, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Sonoma Coast", "Bold, rich and assertive, with lively acidity and a tight, dense core of raspberry and blackberry, revealing rose, anise and spice scents. Supple, graceful and deep, this ends with a long, rich aftertaste and a supple, caressing texture. Drink now through 2024. 948 cases made.", 125m, 84, 0, 95, "2013", new Guid("9659daf1-4763-46b6-a0a8-7287ce9fbbf5") },
                    { new Guid("d16bfbd2-a485-4af6-9bd6-f30fbf50a51e"), 0, new DateTime(2016, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Central Otago", "Fleshy and appealing, with vibrant cherry and plum notes that have nutmeg and black tea flavors lingering on the finish. Offers good intensity and a velvety texture. Drink now through 2026. 1,000 cases imported.", 15m, 83, 0, 90, "2014", new Guid("a4bc2eaa-7837-47a7-8150-0484d0a89a9b") },
                    { new Guid("7eea220c-9156-475b-87e7-b66f5f159026"), 1, new DateTime(1989, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Sonoma Valley Kistler Vineyard", "Kistler is hot. Complex and delicious, with great balance and a long aftertaste. Brimming with ripe, butterscotchy flavors over ripe, round fruit. Big and full-bodied but elegant. Drink now through 1992.  ", 25m, 84, 0, 92, "1987", new Guid("d1099517-3f4b-4b17-a9f1-55b739f0b5e6") },
                    { new Guid("39ff0045-bd50-4a97-bbe5-fdeba2b2f2cb"), 1, new DateTime(2016, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Carneros Hudson Vineyard", "Combines richness with a creamy texture, allowing the taut citrus, pear, melon and fig notes to fan out, gaining depth and length. Displays beautifully integrated smoky oak nuances. Drink now through 2020. 1,060 cases made.", 80m, 82, 0, 94, "2013", new Guid("d1099517-3f4b-4b17-a9f1-55b739f0b5e6") },
                    { new Guid("3fa1a03c-ac58-404e-9fc0-e7e43fe80f5b"), 1, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Mendoza Felino", "A richly spiced white, with focused, well-structured flavors of dried apple, ripe citrus and guava. Brioche notes show on the firm finish. Drink now through 2019. 4,500 cases imported.", 21m, 81, 0, 90, "2015", new Guid("544a6efd-bded-494e-99f8-64633a8a86bc") },
                    { new Guid("333ec014-12f7-4dd9-bd19-ce6776d85b67"), 0, new DateTime(2016, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Douro Quinta Vale D. Maria", "Ripe, rich and lushly spiced, this muscular red features dark cherry and plum compote flavors that are accented by light pepper notes. Dark chocolate and cardamom accents show on the creamy finish. Drink now through 2022. 1,800 cases made.", 68m, 80, 0, 94, "2013", new Guid("fcfd1fae-328e-469c-aad7-c1225013d11d") },
                    { new Guid("bd1d038e-4e64-4050-a529-054e1e29aab7"), 1, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Judean Hills White", "Offers a spicy aroma, with pure, mineral-infused flavors of Granny Smith apple, lemon curd and pineapple, accented by notes of toasted coconut. The finish has crÃ¨me brÃ»lÃ©e hints that linger with plenty of richness. Chardonnay and Sauvignon Blanc. Kosher. Drink now through 2020. 2,000 cases made.", 30m, 79, 0, 92, "2014", new Guid("a8178f1a-35f4-4575-b2cd-017250c62de9") },
                    { new Guid("3c0e4032-5ade-466b-976b-88f66f56fb0e"), 1, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Savoie Apremont CuvÃ©e Gastronomie", "Yellow apple, fennel and lemon zest notes form the core, while lively floral and quinine accents stretch out the finish. Not big, but offers lovely cut and purity. Very refreshing. Drink now through 2017. 9,500 cases made.", 16m, 78, 0, 90, "2015", new Guid("58a727ba-a1b7-43e9-bccf-5dcaf2e8d527") },
                    { new Guid("00582f9b-129e-4763-a5c6-177fd0c369a8"), 1, new DateTime(2016, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Oloroso Jerez Faraon", "Intense, with roasted almond, Brazil nut and walnut notes lending this a slightly burly aspect, while gunpowder tea, bitter orange and almond accents add a taut feel through the finish. This is a distinctive, edgy version that Sherry geeks will dig. Drink now. 1,500 cases made.", 27m, 77, 0, 92, "NV", new Guid("1f792a6f-c71e-425e-88d7-08e2f2aa9c70") },
                    { new Guid("5df8a3c6-0757-4a27-ae6a-2c11adf7e724"), 0, new DateTime(2016, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vino Nobile di Montepulciano Riserva", "A rich, powerful style, this evokes black cherry, black currant, plum, leather and tar flavors. Balanced and ready to enjoy, with lingering accents of spice and tobacco. Drink now through 2023. 15,000 cases made.", 31m, 76, 0, 93, "2011", new Guid("178bbbb1-420a-4c42-a7bf-a2ee0111fac2") },
                    { new Guid("21f15a3c-9ba4-4a98-99b6-f6d4639b0374"), 1, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Valdeorras ViÃ±a Godeval Cepas Vellas", "Pear, peach and quince flavors mingle in this expressive white, while notes of mineral, tangerine and ginger add complexity. Shows depth and focus, with a clean, juicy finish. Drink now. 1,800 cases imported.", 20m, 75, 0, 91, "2014", new Guid("9f8c45f2-5a1f-41d7-b920-a5210b757502") },
                    { new Guid("f2dbe936-6e81-4ef6-b3ef-a6db9c913f61"), 0, new DateTime(2016, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec Mendoza Reserva", "This has a silky mouthfeel, with rich, plush flavors of boysenberry, dark currant and black olive that carry plenty of creamy accents. Features dark chocolate and Asian spice details on the finely textured finish. Drink now through 2020. 125,000 cases imported.", 19m, 74, 0, 90, "2014", new Guid("34f55b95-4600-4e51-8654-a3e7567086d4") },
                    { new Guid("8cff9a66-4894-4fa1-a851-79c8dc244f0b"), 5, new DateTime(2016, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut California Organic Grapes", "Crisp and luscious, this is a winning bubbly for a big party. Aromas of cinnamon, ginger and citrus lead to creamy flavors of pear and blanched almond. Drink now. 15,000 cases made.", 14m, 73, 0, 90, "NV", new Guid("4cb0720a-c992-41f5-b7fc-f663cc1f2285") },
                    { new Guid("15d8c1c2-888a-489e-bfd1-a7d175a67180"), 0, new DateTime(2014, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shiraz Barossa Valley Bella's Garden", "Utterly seamless, focused, powerful and elegant, layered with cherry, boysenberry and red plum fruit, revealing glints of coffee, jasmine and cardamom that add extra nuances. Delivers complexity without extra weight. The finish won't quit. Drink now through 2022. 6,000 cases made.", 69m, 16, 0, 95, "2012", new Guid("41b654a4-e045-4ea4-a172-0557a969e486") },
                    { new Guid("79073334-13bb-41a0-86f4-ab9065018f70"), 0, new DateTime(2016, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shiraz McLaren Vale Lily's Garden", "Notes of espresso and toasted hazelnut are rich and thick, with mocha-accented tannins that lend a velvety backdrop to the polished blackberry, licorice and black cherry flavors, lingering generously on the long finish. Drink now through 2030. 2,470 cases made.", 69m, 71, 0, 94, "2014", new Guid("41b654a4-e045-4ea4-a172-0557a969e486") },
                    { new Guid("bcaaab00-552a-422c-8290-1d071af2cd06"), 1, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Finger Lakes Dry Argetsinger Vineyard", "Taut, lip-smacking acidity harnesses the core of Jonagold apple, heather, white peach and candied citrus peel notes in this ripe white, keeping this focused and energetic through the finish. Drink now through 2018. 285 cases made.", 30m, 86, 0, 92, "2012", new Guid("d70ddebc-d5d1-4f86-8a25-b9c12387cdf5") },
                    { new Guid("eb53e415-c589-4efc-8920-ebf30548a503"), 1, new DateTime(2016, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Finger Lakes Dry", "A taut, dry style, with pure lime, kiwifruit and pippin apple flavors backed by a slate note that gives the finish good tension and length. Very solid. Drink now through 2017. 5,475 cases made.", 18m, 70, 0, 90, "2014", new Guid("d70ddebc-d5d1-4f86-8a25-b9c12387cdf5") },
                    { new Guid("ffb50cb7-305c-4fc8-9081-1c6f0b6085c8"), 0, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Russian River Valley Treehouse", "Combining power and finesse, this is rich and extracted, with a supple yet gutsy core of mineral-laced tannins that weave into a mix of gravelly, loamy earth, juicy blackberry and wild berry. Drink now through 2022. 1,748 cases made.", 125m, 99, 0, 94, "2013", new Guid("784cfc57-d3d0-417d-bf91-0a738964b6a5") },
                    { new Guid("4b1f49a0-2453-4216-9468-3a1fcee250f7"), 1, new DateTime(2016, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Corton-Charlemagne", "A broad, charming white, featuring lemon, baked apple, vanilla, clove and nutmeg flavors, with fine concentration and length. Shows a bright structure and chalky intensity on the slightly tannic finish. Best from 2019 through 2032. 3,100 cases made.", 175m, 100, 0, 95, "2014", new Guid("96e225c4-e615-4eb8-8760-684be89a3ab7") },
                    { new Guid("330535ca-0f30-4e52-8038-1c9370738de3"), 0, new DateTime(1988, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Romanée St.-Vivant Les Quatre Journaux", "Seamlessly complex, full of flavor yet so beautifully knit it's hard to pic k out the nutmeg-tinged black cherry, chocolate and vanilla flavors. Velvet y in texture, filled with intense, sweet fruit. Full-bodied, toasty, yet de licate, it has all the attributes of greatness.  ", 99m, 11, 0, 98, "1985", new Guid("96e225c4-e615-4eb8-8760-684be89a3ab7") },
                    { new Guid("ffa2a158-ee34-4282-96c9-c3c9f72ed778"), 0, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Oakville Au Paradis", "Deliciously pure and supple, with explosive dark berry and red berry flavors and a silky, polished texture. The tannins become more evident midway through, with a gravelly crushed rock profile that adds a dimension of dust and mineral. Drink now through 2030. 1,785 cases made.", 195m, 1, 0, 96, "2012", new Guid("b69a736a-2059-427f-8233-f929dd43b72c") },
                    { new Guid("37de27b1-54e1-480b-ac6c-b4dc3a1e7a5c"), 1, new DateTime(2015, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chablis Ste.-Claire", "A textbook flinty aroma gives way to green apple, lemon and mineral flavors in this white, which shows fine depth and richness, offset by vibrant acidity. Excellent length. Drink now through 2020. 50,000 cases made.", 22m, 47, 0, 91, "2014", new Guid("fe310ce7-5f44-43da-b073-e2759a14cb8d") },
                    { new Guid("7fa5bda4-ad96-4f68-a0ba-d5dab4d8db40"), 0, new DateTime(2015, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chianti Classico", "Firm and taut, with a core of cherry and berry flavors, accented by underbrush, tobacco and iron notes. Balanced in a lean way, with a lingering aftertaste of earth and mineral. Best from 2016 through 2025. 100,000 cases made.", 19m, 46, 0, 90, "2011", new Guid("83636a14-3cd8-4880-a6d5-b5e0013dc67e") },
                    { new Guid("a397a9a3-10bf-4579-a14e-a054bc86271e"), 0, new DateTime(2015, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malbec LujÃ¡n de Cuyo Premium Reserve", "Redolent of blueberry and dark currant, this fresh, pure style is matched with plenty of minerally components. The complex finish offers white pepper and bittersweet chocolate details. Drink now through 2019. 13,395 cases made.", 17m, 44, 0, 90, "2013", new Guid("a3e57880-5c8c-4a42-b59b-56e6df65fac9") },
                    { new Guid("32d469c4-c247-4b2f-8cfb-1527e9453350"), 0, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "SUMÅ  Amador County", "Shows excellent purity and intensity to the huckleberry and blueberry coulis flavors, with supple, velvety tannins and an aromatic lift from violet and white pepper details. Notes of sandalwood, black walnut, Earl Grey tea and nutmeg gain momentum on the tremendous finish, where the details and elegance persist. Petite Sirah, Syrah and Viognier. Drink now through 2030. 220 cases made.", 70m, 42, 0, 95, "2013", new Guid("a00f3d5e-324d-460b-a64b-9832587ab46f") },
                    { new Guid("2ffeb474-ffc8-451a-bacb-e00a129628bf"), 0, new DateTime(2015, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bolgheri Volpolo", "An enticing combination of black currant, black cherry, violet, cedar and cigar box flavors highlight this intense, structured red, which needs some time to resolve the tannins, but this shows ample fruit and balance. Cabernet Sauvignon, Merlot and Petit Verdot. Best from 2018 through 2033. 7,500 cases made.", 35m, 41, 0, 93, "2012", new Guid("702177f5-7286-430e-8c41-e229f0ef84aa") },
                    { new Guid("b65afc63-718d-4796-afa2-4c2f3530bb28"), 1, new DateTime(2015, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc California", "Graceful, with fragrant orange blossom, ruby grapefruit and white peach flavors that are fresh and lively, set on a light, lithe body. Appealing lime zest and passion fruit accents show on the long finish. Drink now. 38,000 cases made.", 12m, 40, 0, 90, "2014", new Guid("889fca6a-cb75-466c-aed1-4a3d5d11c2d9") },
                    { new Guid("f676f423-5446-4e12-9840-9f03ec168238"), 0, new DateTime(2015, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Willamette Valley Grande CuvÃ©e", "Sleek, lithe and inviting, with juicy cherry, black cherry and gentle spice flavors that glide quickly over polished tannins into a long and vivid finish. This has presence, harmony, depth and persistence. Best from 2016 through 2022. 7,000 cases made.", 25m, 38, 0, 92, "2012", new Guid("4be6dd22-2599-4c96-ae72-8926235cda50") },
                    { new Guid("80d94130-30ce-4cac-b571-831a451201a3"), 1, new DateTime(2015, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Carneros", "A creamy-textured, charming style that's easy to drink yet is deceptively complex and layered, with a mix of vanilla-scented oak and vibrant peach, nectarine, honeydew and apricot flavors. Long on the finish. Drink now. 100,000 cases made.", 36m, 35, 0, 93, "2013", new Guid("b0ca357e-5af2-45bd-8c10-e198406084e0") },
                    { new Guid("768da5a4-2958-4af3-919e-a391f530bdcf"), 0, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Columbia Valley The Pundit", "This shows nice tension between the ripe, dark flavors and crisp, lively structure, featuring a sleek core of plum and smoky tea flavors that carry easily into the long and deftly balanced finish. A little cellaring should soften the tannins. Best from 2017 through 2020. 8,000 cases made.", 25m, 34, 0, 92, "2013", new Guid("b8c27973-b71a-4f9b-be7a-e8308f8261a8") },
                    { new Guid("be0be4f9-537f-4bb8-88f0-0a991c7666a9"), 1, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Riesling Eden Valley Dry", "Taut, sleek, polished and distinctively spicy, with black pepper, white pepper, floral and citrus flavors on a lively frame. Best from 2019 through 2030. 4,000 cases imported.", 17m, 33, 0, 91, "2014", new Guid("12942c20-ccae-4fa7-9801-e605f5d66035") },
                    { new Guid("58b04a39-bbfd-4a7c-864f-c6613bb1bc60"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Maipo Valley Alto Gran Reserva", "A rich, well-spiced red, with luscious flavors of tar, licorice and dark plum, supported by ample acidity and firm tannins. Offers a lip-smacking finish of dark chocolate and pepper. Drink now through 2019. 20,000 cases made.", 15m, 32, 0, 91, "2012", new Guid("da790198-f248-4178-9f51-9ba48be427e0") },
                    { new Guid("1e94898b-77e1-49ec-8910-2165609ef2a4"), 0, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "MencÃ­a Bierzo Cepas Viejas", "The plush texture delivers rich flavors of plum, blackberry and boysenberry, with accents of coffee, mountain herb, cedar and mineral. Fine-grained tannins give this structure, showing enough acidity to stay fresh. A modern-style red. Drink now through 2025. 10,000 cases made.", 30m, 30, 0, 93, "2011", new Guid("2610f310-24c6-46b1-b746-a04afcf907de") },
                    { new Guid("cf83ca20-2211-4763-b98c-816ca2d4f403"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ursa Columbia Valley", "The core glows with ripe blackberry, dark plum, mint and floral flavors, gliding over lightly prickly tannins into the long and compelling finish. Feels almost weightless, but has tremendous depth. Merlot, Cabernet Franc, Cabernet Sauvignon and Malbec. Drink now through 2020. 1,219 cases made.", 39m, 28, 0, 94, "2012", new Guid("dced345b-3637-4bfa-9371-21f5060a163c") },
                    { new Guid("ddbd8cc3-4075-4e8d-8d61-de9038d1db95"), 0, new DateTime(2015, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brunello di Montalcino Pertimali", "This features depth and complexity, from the cherry and menthol notes to the earth and mineral elements. Tightly wound, with a core of sweet fruit offsetting the burly tannins, this lingers on the finish, showing fine equilibrium and the potential to develop. Best from 2019 through 2035. 3,400 cases made.", 55m, 27, 0, 95, "2010", new Guid("2742f760-e961-4ba2-a37e-31913bf7855a") },
                    { new Guid("8abcbb97-8d96-4d2a-b99d-c24f0ecccfa0"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Douro Reserva", "Suave and rich, showing luscious sandalwood notes to the dried cherry and raspberry flavors. The creamy finish lingers with cocoa powder and white pepper accents. Drink now through 2020. 15,000 cases made.", 22m, 69, 0, 91, "2012", new Guid("4223176f-b102-4316-94a7-926a76fc935b") },
                    { new Guid("725a193d-f20a-4954-9349-540827250ee3"), 0, new DateTime(2015, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Douro Superior", "Well-crafted and suave, with refined flavors of raspberry tart, red plum and cherry pastry, matched to cardamom and savory spice notes. Silky tannins and a plush, creamy finish offer chocolate mousse accents.  Drink now through 2022. 15,166 cases made.", 30m, 25, 0, 93, "2012", new Guid("d280215e-9e31-439c-a890-6eeb7e23f20e") },
                    { new Guid("6035617a-891a-435e-b30c-321b274358d2"), 0, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja EdiciÃ³n Limitada", "This rich red delivers ripe, racy flavors of blackberry, kirsch, toast, spice and mineral. Plush but dense, with subtle yet powerful tannins and tangy acidity. A big wine, showing energy and style. Drink now through 2031. 6,250 cases made.", 50m, 23, 0, 94, "2011", new Guid("fee0e091-d33f-4f79-96c9-7b4f2df819e9") },
                    { new Guid("c0a965d3-72a3-4ef4-b39e-e648489cd760"), 0, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Walla Walla Valley The Deuce", "Supple, ripe and provocative, with mineral, licorice and tapenade flavors running through a plush, generous core of dark plum and black cherry. Shows presence and polish. Drink now through 2022. 583 cases made.", 52m, 22, 0, 95, "2012", new Guid("642b7ec4-aac7-46a5-8b8a-a8b0b3db13d6") },
                    { new Guid("08d6bc9e-7409-43e4-8b13-cf52b340d018"), 0, new DateTime(2015, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Monterey-Sonoma-Santa Barbara Counties", "Rich yet medium-weight, offering an exciting interplay of berry, oak, earth and spice notes, with subtle edges to the blueberry, raspberry, mocha and fresh-turned earth flavors. Ends with an aftertaste of melted black licorice. Drink now through 2020. 317,592 cases made.", 22m, 20, 0, 92, "2013", new Guid("a05eca32-f820-4a4e-9d7a-5450de84d7fb") },
                    { new Guid("21a62c5b-d02c-42bd-9d88-16f56c4cb72e"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Russian River Valley Altamont", "A seamless, fleshy expression of juicy, enticing plum, cherry blossom and rose petal, with black cherry flavors at the core. A remarkably charming and seductive effort. Drink now through 2022. 880 cases made.", 60m, 19, 0, 95, "2013", new Guid("6420a7dc-29f3-44a7-9193-73e2a3ba8841") },
                    { new Guid("85d4614b-4c5f-4a14-8d96-56229e00b064"), 4, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Late Bottled Port", "Dense and rich, with amply spiced flavors of ripe dark plum and cherry compote. Mineral notes emerge midpalate, leading to a lush, chocolate-filled finish. A fresh and engaging style. Drink now. 5,600 cases imported.", 25m, 16, 0, 93, "2009", new Guid("9523ee96-85d4-4ca1-8033-4f3ca407d55c") },
                    { new Guid("6b7a435d-0f55-462f-a07f-471029c79e32"), 0, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Ribbon Ridge Le PrÃ© Du Col Vineyard", "Supple, seductive and distinctive, with pure blueberry fruit, shaded with white pepper, pear skin and floral character. The flavors dance merrily into the long, deftly balanced finish. Offers presence and intensity without extra weight. Drink now through 2023. 1,500 cases made.", 60m, 14, 0, 95, "2013", new Guid("197cf1a1-036c-4cb2-9ac9-89f9da8d5564") },
                    { new Guid("1f1acf4f-71ed-4cad-a5ae-4a72c969d08f"), 0, new DateTime(2015, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Russian River Valley", "A knockout Zinfandel, balancing an opulent texture with great focus and depth. Aromas of rose petal and raspberry lead to rich and layered flavors of cherry, herbes de Provence and cracked white pepper. Finishes with a bounce of acidity and ripe, lively tannins. Drink now through 2020. 1,440 cases made.", 32m, 12, 0, 94, "2012", new Guid("f9141298-055a-4996-9cc5-c8da0bfd330f") },
                    { new Guid("fb6360e2-181d-4c00-9dde-3ddfab67e7d5"), 4, new DateTime(2015, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vin de Constance Constantia", "Rich and unctuous, yet superbly racy, this offers a gorgeous panoply of dried apricot, fig, mango and quince flavors, underscored by a lively blood orange note and backed by a long, ginger- and green tea-filled finish. Youthfully tight, this should cruise for some time in the cellar. Muscat de Frontignan. Best from 2016 through 2030. 2,500 cases made.", 80m, 10, 0, 95, "2009", new Guid("b3b79d6d-be91-4526-9538-2ecb13aaf2a8") },
                    { new Guid("839fc78c-f3d2-4aa1-8f36-cd82d30b3b43"), 0, new DateTime(2015, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Amarone della Valpolicella Classico SerÃ¨go Alighieri Vaio Armaron", "An elegant, impeccably balanced red, layering sculpted tannins with finely knit flavors of plumped black cherry, plum sauce, cured tobacco, dark chocolate and woodsy spice. A rich vein of smoky minerality sings on the lasting finish. Drink now through 2035. 3,750 cases made.", 85m, 8, 0, 95, "2008", new Guid("f9dd7163-2937-4576-a6fe-3c79e892d0c7") },
                    { new Guid("a6cc3593-a471-4d65-908d-8635a4a9d889"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Martinborough Kupe Single Vineyard", "Complex, concentrated and intriguing, with fleshy blackberry and plum flavors at the core, showing highlights of black walnut, sandalwood, dried pine needle, black pepper and musky Darjeeling tea. The tannins are refined and plush, and the finish is epic. Drink now through 2030. 500 cases imported.", 69m, 7, 0, 95, "2013", new Guid("a031153e-0cbd-4f00-acc7-e7023c76f757") },
                    { new Guid("eb83e9d1-b5aa-4b5a-88e5-f03622d0ebc2"), 1, new DateTime(1989, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Edna Valley MacGregor Vineyard", "Earthy, ripe and complex, without showing any heaviness. Elegant and ever-changing in the glass, mingling aromas and flavors of toast, honey, apple, pear and more. Drinkable now, but it can only improve with cellaring.  ", 14m, 50, 0, 93, "1987", new Guid("e346a563-69e7-449a-85a3-4a4a80da3af7") },
                    { new Guid("443d15d9-e1d1-49af-80b6-25651c194b6b"), 1, new DateTime(2015, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Santa Cruz Mountains", "Spicy, toasty, aromatic oak offers an enticing start, with a fresh, vibrant core of lemon-lime, lemon curd, white peach and stone fruit that is very tight, dense, focused and persistent. Ends with a juicy Key lime aftertaste. Drink now through 2029. 1,986 cases made.", 60m, 5, 0, 95, "2012", new Guid("e346a563-69e7-449a-85a3-4a4a80da3af7") },
                    { new Guid("273d5c21-66d7-4bfe-8135-137839005480"), 0, new DateTime(2015, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Eola-Amity Hills Seven Springs Vineyard La Source", "Seductive, silky and supple, this red layers its gorgeous currant, plum, blueberry and spice flavors on a lithe frame, coming together harmoniously on the long, expressive finish. Drink now through 2022. 1,176 cases made.", 70m, 3, 0, 98, "2012", new Guid("a1b9fac6-8a1c-4630-b5d5-dd8f4dabfbf7") },
                    { new Guid("c756e2e5-120c-480e-b23b-6a1d472c20fb"), 1, new DateTime(2014, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chardonnay Knights Valley Ma Belle-Fille", "Captivating, sleek, elegant and graceful, this is rich without weight, offering a mix of ripe pear, fig, apricot and melon flavors, with subtle touches of nutmeg, hazelnut and toasted almond. For all its flavor and depth, this displays wonderful lift on the finish. Drink now through 2020. 2,080 cases made.", 90m, 20, 0, 95, "2012", new Guid("b69a736a-2059-427f-8233-f929dd43b72c") },
                    { new Guid("59e5e2ca-0fd1-4dd4-9d1c-f9f3c18bc745"), 4, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bual Madeira", "Deep, rich and exotic-tasting, with plenty of smoky accents to the dried mango, apricot and roasted pineapple flavors, featuring notes of crÃ¨me brÃ»lÃ©e. Very fresh midpalate, presenting an unctuous finish of ginger and cream. Drink now through 2050. 500 cases made.", 50m, 24, 0, 94, "2002", new Guid("0ed0a002-3de1-4b61-8e2a-c7e7b1758f7d") },
                    { new Guid("31f43e87-1b3a-42d2-8d9f-68d3a1177b3e"), 0, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Central Otago Bannockburn", "Supple wild berry, cherry and plum flavors are both powerful and delicate, with details of Earl Grey tea, white pepper, anise and crushed rock. Expansive and expressive, the finish sails on and on, with satiny tannins that never get in the way. Drink now through 2030. 5,174 cases made.", 65m, 49, 0, 95, "2013", new Guid("8c9d431e-cfb9-48c1-9110-9837207abbfa") },
                    { new Guid("fb655ba2-37cc-4acd-b7f7-c47d5aa3c595"), 0, new DateTime(2016, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Willamette Valley Thea's Selection", "Polished, expressive and deftly balanced, this is generous with its baby powderâÂaccented cherry, lingonberry and floral flavors. Remains open and inviting through the long finish. Drink now through 2022. 9,950 cases made.", 30m, 68, 0, 92, "2014", new Guid("73649e60-9c2e-440e-8024-007dae67220a") },
                    { new Guid("4723a40d-0bc1-4cfe-af59-79692a8a72cf"), 4, new DateTime(2016, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vouvray Moelleux Clos du Bourg PremiÃ¨re Trie", "Concentrated, with a core of intense Jonagold apple, glazed Bosc pear, ginger cream and dried quince flavors, carried by filigreed acidity and backed by green tea, verbena, chamomile and persimmon notes. The finish is extremely long. Best from 2018 through 2040. 300 cases imported.", 70m, 66, 0, 97, "2015", new Guid("efcd4e29-198c-4cd7-a2c0-97b5c2cda86e") },
                    { new Guid("ea6fa8d5-459d-4174-b6c0-762b719df3ee"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Walla Walla Valley Cailloux Vineyard", "Broad and expressive, playing the cherry, raspberry and pear notes against fine tannins. Picks up tobacco, tar and mineral notes as the finish sails on. Has terrific presence without weight. Drink now through 2025. 846 cases made.", 80m, 37, 0, 96, "2013", new Guid("f0bdb11b-026c-4d57-b2e5-09d32ba1986f") },
                    { new Guid("d0bee476-0bde-466f-9662-4c35f64a45ac"), 0, new DateTime(2016, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pinot Noir Sonoma Coast Gap's Crown Vineyard", "Lightly aromatic, but rich and layered, this offers excellent density and depth, with fine-grained tannic grip and a long, persistent finish that keeps flashing the core flavors. Drink now through 2020. 1,350 cases made.", 59m, 35, 0, 94, "2014", new Guid("3cb634a7-6df8-418d-8a76-6dc4956c1faa") },
                    { new Guid("82aa37cf-3330-4ef3-af8e-5eebfb1121b5"), 0, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Plexus Red Barossa Valley", "A sophisticated, spicy mix of date bread, cherry compote and clove flavors. Plump and velvety, with persistence and harmony on the finish. Shiraz, Grenache and MourvÃ¨dre. Drink now through 2026. 1,000 cases imported.", 40m, 34, 0, 93, "2014", new Guid("2d88d747-7fce-43aa-af3e-37fc4cbd09d8") },
                    { new Guid("62ff9682-7917-4744-bc4a-ac7b9c63417e"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Columbia Valley", "Firm in texture, brimming with raspberry, black cherry, violet and herb flavors that come together harmoniously on the finish against refined tannins. Offers presence and persistence. Best from 2018 through 2024. 30,000 cases made.", 22m, 32, 0, 92, "2014", new Guid("244199d2-ce28-46d5-bd00-2f9d956809f4") },
                    { new Guid("6961cf92-b5c8-445d-a99c-f88494ab2ed5"), 1, new DateTime(2015, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Santa Barbara County", "This is lush and powerful, offering fleshy peach and apricot flavors at the core, with plenty of aromatic highlights, including orange blossom and honeysuckle. The texture is appealingly smooth and mouthwatering, with the complex details gaining momentum on the finish, where this reveals hints of dried spice and matcha green tea. Viognier, Roussanne, Grenache Blanc and Chardonnay. Drink now through 2020. 3,500 cases made.", 20m, 29, 0, 92, "2014", new Guid("8a4c76cb-0ae8-4d15-86b6-0f4277e9979c") },
                    { new Guid("3b73dcc5-d549-4cd9-ae66-ed0c43d2806b"), 1, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Central Coast", "This expressive white is aromatic and juicy, featuring a rich, ripe, fleshy core of apricot and peach flavors, with accents of vanilla bean, honeysuckle and melon. A spicy note lingers on the long finish. Viognier, Roussanne, Grenache Blanc and Chardonnay. Drink now. 5,100 cases made.", 20m, 31, 0, 92, "2015", new Guid("8a4c76cb-0ae8-4d15-86b6-0f4277e9979c") },
                    { new Guid("208fa27c-b1b0-45be-8a03-e682c2a8e4aa"), 0, new DateTime(2016, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shiraz McLaren Vale Carnival of Love", "Bold, expressive, velvety and generous, with ripe cherry and plum flavors at the core. Complex details of vanilla bean, licorice, Earl Grey tea and gingerbread explode on the long finish. Drink now through 2030. 1,467 cases made.", 75m, 30, 0, 95, "2014", new Guid("e203bf51-678d-466a-9d4b-779126d9f3ea") },
                    { new Guid("de0a19f5-05db-40a8-878b-c4c893bc0490"), 0, new DateTime(2016, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toscana Le Cupole", "Alluring scents of ripe cherry, mulberry and fresh herbs complement concentrated flavors of cherry and sweet spice in this red. Offers a backbone of mouthcoating tannins and remains integrated as the finish lingers. Merlot, Cabernet Franc and Cabernet Sauvignon. Best from 2018 through 2027. 4,600 cases made.", 27m, 29, 0, 93, "2014", new Guid("fdb438df-578c-4d3f-a944-26effb935f8a") },
                    { new Guid("cba88896-daf1-4f3c-b0e5-a835727bab6b"), 5, new DateTime(2016, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brut Carneros Ultra", "Captivating aromas of Asian pear, mature apple and fresh ginger open to complex and polished flavors of brioche, spicy hazelnut and crÃ¨me brÃ»lÃ©e. Drink now through 2018. 2,700 cases made.", 42m, 28, 0, 93, "2011", new Guid("f26392db-3d8f-4d98-ac89-c28fa279e761") },
                    { new Guid("12d2d98d-e7db-479e-81fd-e169e590a4da"), 0, new DateTime(2016, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Claret Columbia Valley", "Firm and focused, with crinkly tannins around a sleek core of blackberry, currant and plum flavors that keep singing on the expressive finish. This has room to grow. Cabernet Sauvignon, Cabernet Franc, Merlot, Malbec and Petit Verdot. Drink now through 2022. 2,129 cases made.", 40m, 27, 0, 93, "2013", new Guid("109fa5d4-70c7-417b-b4ea-d3918585f77b") },
                    { new Guid("ec24cfd9-7b62-4b75-a885-baa8ae02b6b2"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toro San RomÃ¡n", "The polished texture masks depth and muscle in this powerful red, which shows blackberry, anise, tar and mineral flavors, with spicy and floral highlights. Firm tannins and fresh acidity lend good balance. Expressive, in an austere way. Drink now through 2027. 7,750 cases made.", 65m, 26, 0, 95, "2012", new Guid("cec48e51-f3f9-46c4-a84c-b9d8ce51839f") },
                    { new Guid("9d858260-6e0c-4bac-a09e-70e870a6c6b6"), 0, new DateTime(2016, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toscana Borgoforte", "Enticing aromas of violet, black currant and rosemary are accented by licorice and tobacco flavors in this fluid and harmonious red, with fine tannins gracing the long finish. Sangiovese, Cabernet Sauvignon and Merlot. Drink now through 2022. 12,500 cases made.", 12m, 25, 0, 91, "2014", new Guid("309f4a00-ce7d-4c3a-b813-cc377af76f45") },
                    { new Guid("7fc814b8-ad06-43d3-95a2-66533226c822"), 0, new DateTime(2016, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Russian River Valley", "This is plush, rich and impeccably structured, with floral blueberry and raspberry aromas accented by smoky pepper and complex, expressive flavors that combine mineral-tinged tannins with plump fruit. Best from 2018 through 2030. 1,100 cases made.", 55m, 24, 0, 94, "2014", new Guid("4afe5c51-8ca0-44d7-a4a7-557d9cf8079f") },
                    { new Guid("a5e6162a-3373-453a-85f1-4134f4812220"), 1, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja White Monopole", "This focused white shows bright, juicy flavors of white peach and Meyer lemon, with herbal and mineral accents. The texture is quite rich, but crisp, citrusy acidity keeps this lively. Drink now through 2017. 4,000 cases imported.", 15m, 64, 0, 90, "2013", new Guid("9f94419a-211f-496d-b26a-4831620e31fe") },
                    { new Guid("fa1bf482-d635-451c-8c8f-b09b78a150ce"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja Imperial Reserva", "Smoky and tarry notes give this rich red an austere character, but plum, licorice, soy and mineral notes promise an expressive future. The tannins and acidity are balanced and unobtrusive. Best from 2016 through 2030. 1,500 cases imported.", 44m, 56, 0, 93, "2010", new Guid("9f94419a-211f-496d-b26a-4831620e31fe") },
                    { new Guid("7861f3a5-b575-44e3-8cb4-fcbf92a79db8"), 0, new DateTime(2016, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rioja Gran Reserva", "This generous red shows a traditional character, with leafy, dried herb, tea and spice notes framing dried cherry, licorice and leather flavors. Firm tannins and balsamic acidity impart structure, and this shows plenty of depth, with a juicy, spicy finish. Drink now through 2025. 600 cases imported.", 33m, 22, 0, 94, "2010", new Guid("9f94419a-211f-496d-b26a-4831620e31fe") },
                    { new Guid("2f4ee016-8f72-4884-9041-99b12098978f"), 0, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabernet Sauvignon Columbia Valley Holler", "Dense and focused, with a tangy edge to the dark plum and currant flavors, hinting at stony mineral and dusky spice flavors as the finish persists impressively against fine tannins. Best from 2018 through 2023. 912 cases made.", 32m, 21, 0, 94, "2013", new Guid("adda5e7a-d674-4b93-8b49-3379c089ee97") },
                    { new Guid("529512e1-8b6a-468c-89cf-079a5496e775"), 0, new DateTime(2016, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toscana Il Fauno", "A polished, flavorful red, boasting floral, black currant, raspberry and spice flavors. Firm yet harmonious, with the fine aftertaste lingering with fruit, iron, tobacco and tea elements. Merlot, Cabernet Franc, Cabernet Sauvignon and Petit Verdot. Drink now through 2024. 11,829 cases made.", 30m, 19, 0, 93, "2012", new Guid("2c9a0099-e745-46d8-add2-cca6f45b09a0") },
                    { new Guid("1142431a-93da-45d2-841e-ec895ef7d7fa"), 0, new DateTime(2016, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ribera del Duero", "This rich red shows a deep core of plum, bramble and mineral, with notes of loam and game that impart a savory character. Solid tannins support a thick texture, while balsamic acidity keeps this balanced. Austere but harmonious. Drink now through 2024. 35,000 cases made.", 25m, 18, 0, 93, "2012", new Guid("b0c05ff7-74cb-4cba-8931-d9622850ebca") },
                    { new Guid("fd15e99b-ce24-4976-92d5-72e513eed4eb"), 1, new DateTime(2016, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sauvignon Blanc Russian River Valley", "Succulent, lush and rich, with fleshy mango, melon and peach flavors up front, leading to a core of pineapple, lemon and honeysuckle notes. The smoky edge and nervy acidity weave in and out, giving this a fresh finish. Drink now. 9,500 cases made.", 32m, 17, 0, 93, "2014", new Guid("0510b6f5-bfa0-4c5f-9b8a-86ec75dd2054") },
                    { new Guid("75942d01-03a1-4b06-ae52-2c7ae59be355"), 0, new DateTime(2016, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barolo Bricco delle Viole", "Shows fine integration between fruit and wood, with sweet cherry and strawberry flavors matched to spice, floral and briar accents. Fresh, vibrant and firmly structured, this is long on the fruit-, spice- and mineral-tinged finish. Shows fine balance and expression. Best from 2018 through 2032. 333 cases made.", 53m, 15, 0, 94, "2012", new Guid("0804dedb-50e4-42ce-9a27-60550b571ee1") },
                    { new Guid("24720960-86c7-44c8-a580-6b773b137ab9"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zinfandel Russian River Valley Montafi Ranch", "Zinfandel doesn't get much better than this. Rich aromas of black raspberry and orange zest open to balanced, complex and luxurious flavors of blackberry, mint and baking spices. A knockout. Drink now through 2027. 871 cases made.", 47m, 14, 0, 96, "2014", new Guid("59459514-8dca-4e3e-a5c6-0c9cba4965fc") },
                    { new Guid("d2d23d49-ee9e-4970-b2f7-5d1ffc2212bc"), 0, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Syrah Walla Walla Valley In The Rocks", "Supple and expressive, this opens up like a giant flower, spreading the dark plum, blackberry, crÃ¨me fraÃ®che and spice flavors throughout the seamless whole. The finish sails on against barely noticeable tannins. This has tremendous power, but feels like it's floating. Drink now through 2025. 602 cases made.", 70m, 13, 0, 97, "2013", new Guid("740c0d21-f235-4d89-b10b-c955358a5393") },
                    { new Guid("a9a4c6b1-054e-4d84-acfe-86306cf2a82d"), 0, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "ViÃ±o de la Tierra de Castilla y LeÃ³n Sardon de Duero SelecciÃ³n Especial", "Alluring for its plush texture and impressive for its depth, this red delivers plum, currant, licorice, tar and mineral flavors that are rich and focused. The firm tannins are well-integrated, kept lively by fresh acidity. Smoke and floral notes mingle on the long finish. Drink now through 2031. 30,000 cases made.", 30m, 15, 0, 94, "2011", new Guid("504e5830-86f4-4f87-a8d6-74e40095356b") },
